CREATE TABLE `fl_admin_role` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `parent_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '父角色ID',
  `name` varchar(30) NOT NULL DEFAULT '' COMMENT '角色名',
  `desc` varchar(150) NOT NULL DEFAULT '' COMMENT '描述',
  `listorder` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
