/*Table structure for table `fl_cart` */

DROP TABLE IF EXISTS `fl_cart`;

CREATE TABLE `fl_cart` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `goods_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '商品ID',
  `shop_id` int(60) unsigned NOT NULL DEFAULT '0' COMMENT '商品所属的商店ID，预留',
  `goods_number` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '商品数量',
  `goods_attr` mediumtext COMMENT '商品属性',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '购物车商品类型;0普通;1团购;2拍卖;3夺宝奇兵',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `idx_user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='购物车表';

