/*Table structure for table `fl_comment` */

DROP TABLE IF EXISTS `fl_comment`;

CREATE TABLE `fl_comment` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `parent_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '评论的父节点,取值该表的comment_id字段,如果该字段为0,则是一个普通评论,否则该条评论就是该字段的值所对应的评论的回复',
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '发表该评论的用户的用户ID,取值user的user_id',
  `comment_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '用户评论的类型:0评论的是商品,1评论的是文章',
  `id_value` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '文章或者商品的ID,文章对应的是article的article_id;商品对应的是goods的goods_id',
  `comment_rank` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '该文章或者商品的重星级;只有1到5星;由数字代替;其中5代表5星',
  `content` mediumtext COMMENT '评论的内容',
  `is_anonymous` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否匿名，0否',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否被管理员批准显示;1是;0未批准显示',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '评论的时间',
  `ip_address` varchar(20) NOT NULL DEFAULT '' COMMENT '评论时的用户IP',
  PRIMARY KEY (`id`),
  KEY `idx_user_id_id_value_comment_type` (`user_id`,`comment_type`,`id_value`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

/*Data for the table `fl_comment` */

insert  into `fl_comment`(`id`,`parent_id`,`user_id`,`comment_type`,`id_value`,`comment_rank`,`content`,`is_anonymous`,`status`,`add_time`,`ip_address`) values (1,0,3,0,5,5,'质量很好，很好用',1,1,1561702521,'127.0.0.1');

/*Table structure for table `fl_email_verify_code` */

DROP TABLE IF EXISTS `fl_email_verify_code`;

CREATE TABLE `fl_email_verify_code` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `code` varchar(10) NOT NULL DEFAULT '' COMMENT '验证码',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0通用，1注册，2手机绑定，3密码修改，4登录',
  `email` varchar(20) NOT NULL DEFAULT '' COMMENT '手机号',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0:未使用 1:已使用',
  `expire_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '过期时间',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `idx_email` (`email`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

/*Data for the table `fl_email_verify_code` */

insert  into `fl_email_verify_code`(`id`,`code`,`type`,`email`,`status`,`expire_time`,`add_time`) values (1,'1111',1,'123456@qq.com',1,1563326703,4294967295);

/*Table structure for table `fl_feedback` */

DROP TABLE IF EXISTS `fl_feedback`;

CREATE TABLE `fl_feedback` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `title` varchar(150) NOT NULL DEFAULT '' COMMENT '标题，选填',
  `content` mediumtext COMMENT '意见反馈内容',
  `mobile` varchar(20) NOT NULL DEFAULT '' COMMENT '手机号码，选填',
  `type` varchar(20) NOT NULL DEFAULT '' COMMENT '意见反馈类型，选填',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `idx_user_id` (`user_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

/*Data for the table `fl_feedback` */

/*Table structure for table `fl_friendlink` */

DROP TABLE IF EXISTS `fl_friendlink`;

CREATE TABLE `fl_friendlink` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(60) NOT NULL DEFAULT '' COMMENT '名称',
  `url` varchar(150) NOT NULL DEFAULT '' COMMENT 'url链接',
  `target` smallint(2) unsigned NOT NULL DEFAULT '0' COMMENT '跳转方式，0_blank，1_self，2_parent，3_top，4framename',
  `group_id` int(5) unsigned NOT NULL DEFAULT '0' COMMENT '分组ID',
  `listorder` int(11) unsigned NOT NULL DEFAULT '50' COMMENT '排序',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

/*Data for the table `fl_friendlink` */

insert  into `fl_friendlink`(`id`,`name`,`url`,`target`,`group_id`,`listorder`) values (1,'腾讯','https://www.qq.com/',0,0,0),(2,'百度','https://www.baidu.com/',0,0,0);

/*Table structure for table `fl_goods` */

DROP TABLE IF EXISTS `fl_goods`;

CREATE TABLE `fl_goods` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `type_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '栏目ID',
  `tuijian` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '推荐等级',
  `click` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '点击量',
  `title` varchar(150) NOT NULL DEFAULT '' COMMENT '标题',
  `seotitle` varchar(150) NOT NULL DEFAULT '' COMMENT 'SEO标题',
  `keywords` varchar(60) NOT NULL DEFAULT '' COMMENT '关键词',
  `description` varchar(250) NOT NULL DEFAULT '' COMMENT '描述',
  `sell_point` varchar(150) NOT NULL DEFAULT '' COMMENT '卖点',
  `content` mediumtext COMMENT '内容',
  `litpic` varchar(150) NOT NULL DEFAULT '' COMMENT '缩略图',
  `goods_img` varchar(150) NOT NULL DEFAULT '' COMMENT '商品的实际大小图片，如进入该商品页时介绍商品属性所显示的大图片',
  `sn` varchar(60) NOT NULL DEFAULT '' COMMENT '货号',
  `price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '产品价格',
  `market_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '原价',
  `cost_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '成本价格',
  `shipping_fee` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '运费',
  `goods_number` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '库存',
  `sale` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '销量',
  `warn_number` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '商品报警数量',
  `goods_weight` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '重量',
  `spec` mediumtext COMMENT '商品规格，json',
  `point` int(6) unsigned NOT NULL DEFAULT '0' COMMENT '购买该商品时每笔成功交易赠送的积分数量',
  `comment_number` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '评论次数',
  `promote_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '促销价格',
  `promote_start_date` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '促销价格开始日期',
  `promote_end_date` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '促销价格结束日期',
  `brand_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '商品品牌ID',
  `listorder` int(11) unsigned NOT NULL DEFAULT '50' COMMENT '排序',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '商品状态：0正常，1下架，2申请上架',
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '谁发布的',
  `shop_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '店铺ID',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `delete_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除，0未删除',
  PRIMARY KEY (`id`)
