/*Table structure for table `fl_goods_brand` */

DROP TABLE IF EXISTS `fl_goods_brand`;

CREATE TABLE `fl_goods_brand` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `parent_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '父级ID',
  `name` varchar(30) NOT NULL DEFAULT '' COMMENT '名称',
  `seotitle` varchar(150) NOT NULL DEFAULT '' COMMENT 'SEO标题',
  `keywords` varchar(60) NOT NULL DEFAULT '' COMMENT '关键词',
  `description` varchar(240) NOT NULL DEFAULT '' COMMENT '描述',
  `content` mediumtext COMMENT '内容',
  `click` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '点击量',
  `litpic` varchar(150) NOT NULL DEFAULT '' COMMENT '缩略图',
  `cover_img` varchar(150) NOT NULL DEFAULT '' COMMENT '封面',
  `listorder` int(11) unsigned NOT NULL DEFAULT '50' COMMENT '排序',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态，0正常，1禁用',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

