/*Data for the table `fl_job` */

insert  into `fl_job`(`id`,`title`,`seotitle`,`keywords`,`description`,`content`,`click`,`add_time`,`update_time`,`delete_time`) values (1,'高级PHP开发工程师','','高级PHP开发工程师','3年以上网站开发经验，2年以上PHP开发及大流量网站开发经验；精通PHP+MySQL开发，掌握常用设计模式；具备优秀的编程能力，熟练掌握常用数据结构和算法；','<p>岗位职责：<br/></p><p><br/></p><p>1、对现有平台系统进行维护、改造和升级。</p><p><br/></p><p>2、根据需求进行新产品开发，参与架构设计等工作。</p><p><br/></p><p>3、编写核心代码，承担主要开发工作，对代码质量及进度负责。</p><p><br/></p><p>岗位要求：</p><p><br/></p><p>1.计算机或相关专业，专科及以上学历；</p><p><br/></p><p>2.3年以上网站开发经验，2年以上PHP开发及大流量网站开发经验；</p><p><br/></p><p>3.精通PHP+MySQL开发，掌握常用设计模式；</p><p><br/></p><p>4.具备优秀的编程能力，熟练掌握常用数据结构和算法；</p><p><br/></p><p>5.精通DIV+CSS网站架构，熟悉Ajax、JavaScript、CSS、Html；</p><p><br/></p><p>6.熟悉Linux下Apache、Mysql、PHP等相关软件的安装、调试、优化、维护；</p><p><br/></p><p>7.具有良好的沟通能力和团队合作精神，有高度的责任心；</p><p><br/></p><p>8.学习能力强，细心负责，有敬业精神和团队合作精神。</p>',587,0,1542199689,0),(2,'Android开发工程师','','Android开发工程师','独立完成Android客户端的设计、开发、测试和维护；根据项目需要快速学习并掌握新技术；','<p>岗位职责：<br/></p><p><br/></p><p>1、Android应用开发；</p><p><br/></p><p>2、独立完成Android客户端的设计、开发、测试和维护；</p><p><br/></p><p>3、根据项目需要快速学习并掌握新技术；</p><p><br/></p><p>4、与团队中其他成员沟通配合。</p><p><br/></p><p>任职要求：</p><p><br/></p><p>1.专科及以上学历，计算机相关专业优先。</p><p><br/></p><p>2.具备Android平台开发经验。</p><p><br/></p><p>3.了解并能熟练使用Android开发工具。</p><p><br/></p><p>4.具有良好的编程技巧、编码规范、编码习惯和文档编写能力。</p><p><br/></p><p>5.能迅速适应工作环境以及抗压能力。</p>',419,0,1542198285,0),(3,'社群运营','','社群运营','基于微信、微信群、QQ群等社群开展相关工作。负责社群定位、设计、核心内容策划与输出，社群形象打造（可提供培训机会）；','<p>一、岗位职责：<br/></p><p><br/></p><p>1、基于微信、微信群、QQ群等社群开展相关工作。</p><p><br/></p><p>2、负责社群定位、设计、核心内容策划与输出，社群形象打造（可提供培训机会）；</p><p><br/></p><p>3、洞察社群用户，提炼用户画像；</p><p><br/></p><p>4、根据用户画像（需求）及公司需求输出内容；</p><p><br/></p><p>5、指导社群客服完善个人号形象及客户接待与服务工作。</p><p><br/></p><p>6、根据需要策划必要的活动。</p><p><br/></p><p>二、岗位要求：</p><p><br/></p><p>1、本科以上学历，语言、历史、营销、广告、文案类专业毕业。</p><p><br/></p><p>2、至少1年以上文案策划、营销、广告等方面工作经验。</p><p><br/></p><p>3、思维活跃、热衷社群研究，有社群运营经验优先。</p><p><br/></p><p>4、爱岗敬业，具有一定抗压能力。</p><p><br/></p><p>注：提供相应学习培训机会。</p>',460,0,1542198447,0),(4,'文案策划','','文案策划','负责公司项目的创意构思、电商文案企划，微信文章设计创意说明等服务；公司及项目对外宣传资料和文案的撰写；独立撰写各类稿件（新闻稿、综述稿、评论稿、专访稿等）；','<p>岗位职责：<br/></p><p><br/></p><p>1.负责公司项目的创意构思、电商文案企划，微信文章设计创意说明等服务；</p><p><br/></p><p>2.公司及项目对外宣传资料和文案的撰写；</p><p><br/></p><p>3.独立撰写各类稿件（新闻稿、综述稿、评论稿、专访稿等）；</p><p><br/></p><p>4.负责媒体软文和广告资料的收集与整理；</p><p><br/></p><p>5.搜集各行业信息，配合设计及策划团队日常工作；</p><p><br/></p><p>6.根据项目需要，配合完成相关工作。</p><p><br/></p><p>岗位要求：</p><p><br/></p><p>1.大专以上学历，新闻广告专业优先，具备电商策划文案、营销、广告、传播的相关知识，1年以上工作经验；</p><p><br/></p><p>2.能够熟练运营微信、微博及简单图片处理者优先；</p><p><br/></p><p>3.能够协助组织制定市场策略、产品拓展等工作；</p><p><br/></p><p>4.具有较强的表达、理解与沟通能力以及团队合作精神；</p><p><br/></p><p>5.与时俱进，思维活跃，具备扎实的文字功底；</p><p><br/></p><p>7.熟练操作Word、Excel、PPT等办公软件；</p><p><br/></p><p>9.有活动策划能力及活动执行力优先。</p>',476,0,1542198406,0),(5,'总经理助理','','总经理助理','协助落实公司企业文化；协助制定、贯彻、落实公司各项经营发展战略、计划，实现公司经营管理目标；跟进公司具体管理工作的布置、实施、检查、督促，落实执行情况；','<p>岗位职责：<br/></p><p><br/></p><p>1、协助落实公司企业文化；</p><p><br/></p><p>2、协助制定、贯彻、落实公司各项经营发展战略、计划，实现公司经营管理目标；</p><p><br/></p><p>3、跟进公司具体管理工作的布置、实施、检查、督促，落实执行情况；</p><p><br/></p><p>4、落实上级领导交办的其他工作内容。</p><p><br/></p><p>任职资格：</p><p><br/></p><p>1、重点本科院校，文秘/金融/法律/财务/工商/管理等专业优先；</p><p><br/></p><p>2、执行力强，责任心强；</p><p><br/></p><p>3、熟练使用office等办公软件；</p><p><br/></p><p>4、工作认真负责，细心，条理性强，有较强领悟力；</p><p><br/></p><p>5、书面文字表达能力好；</p><p><br/></p><p>(实习期按照实习薪资计算)</p>',462,0,1542198486,0),(6,'产品助理','','产品助理','负责分管产品线的产品策划与设计，提供产品设计、需求分析、功能描述及业务演示原型等文档；负责视觉、前端、开发、测试、业务部门间的资源和信息协调，跟进产品开发进度，保障功能顺利上线。负责产品开发的进度管理与跟踪，组织产品测试；','<p>岗位职责：<br/></p><p><br/></p><p>1、负责分管产品线的产品策划与设计，提供产品设计、需求分析、功能描述及业务演示原型等文档；</p><p><br/></p><p>2、负责视觉、前端、开发、测试、业务部门间的资源和信息协调，跟进产品开发进度，保障功能顺利上线。</p><p><br/></p><p>3、负责产品开发的进度管理与跟踪，组织产品测试；</p><p><br/></p><p>4、负责产品改进与升级；收集与调研用户意见，并提供改进方案；</p><p><br/></p><p>5、负责分管产品的用户体验及效率改进；</p><p><br/></p><p>岗位要求：</p><p><br/></p><p>1、大专及以上学历，计算机、信息管理等相关专业；</p><p><br/></p><p>2、一年以上产品开发经验；</p><p><br/></p><p>3、良好的沟通能力和团队协作能力，具有积极向上的良好心态；</p><p><br/></p><p>4、善于倾听用户声音，对数据敏感，善于数据统计分析、逻辑清晰，能有效地确立产品策略、市场定位和产品核心价值；</p><p><br/></p><p>5、优秀的产品开发能力、文档撰写能力、口头表达与沟通能力；</p>',389,0,1542198368,0),(7,'iOS开发工程师','','iOS开发工程师','维护现有项目的IOS端APP。根据需求开发新功能。根据需要开发新项目。独立完成开发工作，进行模块测试，保证代码的质量。','<p>岗位职责：<br/></p><p><br/></p><p>1、维护现有项目的IOS端APP。</p><p><br/></p><p>2、根据需求开发新功能。</p><p><br/></p><p>3、根据需要开发新项目。</p><p><br/></p><p>4、独立完成开发工作，进行模块测试，保证代码的质量。</p><p><br/></p><p>5、将学习和研究到新的移动互联网技术应用到产品中进行创新。</p><p><br/></p><p>岗位要求：</p><p><br/></p><p>1、精通ios平台，经历过完整的app开发流程，半年以上IOS开发经验；</p><p><br/></p><p>2、良好的编码习惯和规范，一定的文档编写能力。</p><p><br/></p><p>3、精通iosSDK中的UI、网络、数据库、XML/JSON解析等开发技巧；</p><p><br/></p><p>4、富有激情和良好的责任心，认真严谨的工作态度，有良好的团队协作，善于沟通和协作。</p><p><br/></p><p>5、有较强的学习能力，清晰的思维，能独立分析和解决问题。</p>',230,0,1542198531,0),(8,'财务主管','','财务主管','制定并完善公司相应财务制度，制作并规范相应表格、表单和文档等。审核日常报销，付款单据，核对往来账务，并生成报表；负责公司账务的处理，成本核算及分析；','<p>一、岗位职责：<br/></p><p><br/></p><p>1、制定并完善公司相应财务制度，制作并规范相应表格、表单和文档等。</p><p><br/></p><p>2、审核日常报销，付款单据，核对往来账务，并生成报表；</p><p><br/></p><p>3、负责公司账务的处理，成本核算及分析；</p><p><br/></p><p>4、负责公司总账业务核算，编制会计凭证，核对银行存款和现金余额，按时编制会计报表和财务报告；</p><p><br/></p><p>5、负责公司税务申报工作，能独立进行纳税处理、协助事务所进行税款汇清清缴等；</p><p><br/></p><p>二、岗位要求：</p><p><br/></p><p>1、大专以上学历，财务会计专业，2年以上独立操作整套财务经验；</p><p><br/></p><p>2、熟悉企业财务运作，熟悉国家会计、税收政策；</p><p><br/></p><p>3、具有全面的财务专业知识、在财务处理及财务管理方面具备一定经验，熟悉银行业务、日常费用审核、报税流程、开票等财务日常工作；</p><p><br/></p><p>4、工作细致，对数字敏感，责任感强，良好的沟通能力，团队精神。</p><p><br/></p><p>5、工作积极主动，擅于沟通与协调，具有较好的职业操守和团队协作精神。</p>',478,1542198105,1542628729,0);

