/*Table structure for table `fl_order` */

DROP TABLE IF EXISTS `fl_order`;

CREATE TABLE `fl_order` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(30) NOT NULL DEFAULT '' COMMENT '订单号',
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `shop_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '商家ID',
  `order_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '订单状态:0生成订单,1已取消(客户触发),2无效(管理员触发),3完成订单',
  `refund_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '退货退款(订单完成后)，0无退货，1有退货，2退货成功，3拒绝',
  `shipping_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '配送情况:0未发货,1已发货,2已收货',
  `pay_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '支付状态:0未付款,1已付款',
  `goods_amount` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '商品的总金额',
  `order_amount` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '应付金额=商品总价+运费-优惠(积分、红包)',
  `discount` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '优惠金额',
  `pay_money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '支付金额',
  `payment_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '支付方式',
  `pay_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '订单支付时间',
  `pay_name` varchar(30) NOT NULL DEFAULT '' COMMENT '支付方式名称',
  `trade_no` varchar(60) NOT NULL DEFAULT '' COMMENT '支付订单号',
  `shipping_name` varchar(20) NOT NULL DEFAULT '' COMMENT '配送方式名称',
  `shipping_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '配送方式',
  `shipping_sn` varchar(30) NOT NULL DEFAULT '' COMMENT '发货单',
  `shipping_fee` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '配送费用',
  `shipping_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '发货时间',
  `name` varchar(30) NOT NULL DEFAULT '' COMMENT '收货人姓名',
  `country_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '国家ID',
  `province_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '省份ID',
  `city_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '城市ID',
  `district_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '区域ID',
  `address` varchar(240) NOT NULL DEFAULT '' COMMENT '地址',
  `zipcode` varchar(10) NOT NULL DEFAULT '' COMMENT '邮编',
  `mobile` varchar(20) NOT NULL DEFAULT '' COMMENT '电话',
  `message` varchar(240) NOT NULL DEFAULT '' COMMENT '买家留言',
  `is_comment` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否评论，1已评价',
  `integral_money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '使用积分金额',
  `integral` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '使用的积分的数量',
  `bonus_money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '使用优惠劵支付金额',
  `bonus_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '优惠券ID',
  `note` varchar(240) NOT NULL DEFAULT '' COMMENT '商家/后台操作备注',
  `invoice` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '发票类型：0不索要，1个人，2企业',
  `invoice_title` varchar(100) NOT NULL DEFAULT '' COMMENT '发票抬头',
  `invoice_taxpayer_number` varchar(100) NOT NULL DEFAULT '' COMMENT '纳税人识别号',
  `place_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '订单来源：1pc，2weixin，3app，4wap，5miniprogram',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '订单生成时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `delete_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '删除时间，0未删除',
  PRIMARY KEY (`id`),
  KEY `idx_user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='订单表';

