/*Table structure for table `fl_page` */

DROP TABLE IF EXISTS `fl_page`;

CREATE TABLE `fl_page` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(150) NOT NULL DEFAULT '' COMMENT '标题',
  `seotitle` varchar(150) NOT NULL DEFAULT '' COMMENT 'SEO标题',
  `keywords` varchar(100) NOT NULL DEFAULT '' COMMENT '关键词',
  `description` varchar(250) NOT NULL DEFAULT '' COMMENT '描述',
  `content` mediumtext COMMENT '内容',
  `template` varchar(30) NOT NULL DEFAULT '' COMMENT '模板名称',
  `filename` varchar(60) NOT NULL DEFAULT '' COMMENT '别名',
  `litpic` varchar(150) NOT NULL DEFAULT '' COMMENT '缩略图',
  `click` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '点击量',
  `is_auth` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '查看权限：0所有人，1绑定银行卡',
  `group_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '分组ID',
  `listorder` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `delete_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '删除时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_filename` (`filename`)
) ENGINE=MyISAM AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

/*Data for the table `fl_page` */

insert  into `fl_page`(`id`,`title`,`seotitle`,`keywords`,`description`,`content`,`template`,`filename`,`litpic`,`click`,`is_auth`,`group_id`,`listorder`,`add_time`,`update_time`,`delete_time`) values (1,'会员等级','','会员等级','VIP1累计充值投资金额2万元以上可额外赠送0.03%投资收益\r\n例如：选择投资项目收益0.82%+奖励0.03%，预期可获得收益：0.85%','<p><span style=\"color: rgb(255, 0, 0);\"><strong>VIP1</strong></span>累计充值投资金额2万元以上可额外<strong><span style=\"color: rgb(255, 0, 0);\">赠送0.03%</span></strong>投资收益</p><p>例如：选择投资项目收益0.82%+奖励0.03%，预期可获得收益：0.85%</p><p><br/></p><p><span style=\"color: rgb(255, 0, 0);\"><strong>VIP2</strong></span>累计充值投资金额5万元以上可额外<span style=\"color: rgb(255, 0, 0);\"><strong>赠送0.04%</strong></span>投资收益</p><p>例如：选择投资项目收益0.82%+奖励0.04%，预期可获得收益：0.86%</p><p><br/></p><p><span style=\"color: rgb(255, 0, 0);\"><strong>VIP3</strong></span>累计充值投资金额15万元以上可额外<span style=\"color: rgb(255, 0, 0);\"><strong>赠送0.05%</strong></span>投资收益</p><p>例如：选择投资项目收益0.82%+奖励0.05%，预期可获得收益：0.87%</p><p><br/></p><p><span style=\"color: rgb(255, 0, 0);\"><strong>VIP4</strong></span>累计充值投资金额30万元以上可额外<span style=\"color: rgb(255, 0, 0);\"><strong>赠送0.06%</strong></span>投资收益</p><p>例如：选择投资项目收益0.82%+奖励0.06%，预期可获得收益：0.88%</p><p><br/></p><p><strong><span style=\"color: rgb(255, 0, 0);\">VIP5</span></strong>累计充值投资金额80万元以上可额外<span style=\"color: rgb(255, 0, 0);\"><strong>赠送0.08%</strong></span>投资收益</p><p>例如：选择投资项目收益0.82%+奖励0.08%，预期可获得收益：0.90%</p><p><br/></p><p><strong><span style=\"color: rgb(255, 0, 0);\">VIP6</span></strong>累计充值投资金额150万元以上可额外<strong><span style=\"color: rgb(255, 0, 0);\">赠送0.12%</span></strong>投资收益</p><p>例如：选择投资项目收益0.82%+奖励0.12%，预期可获得收益：0.94%</p><p><br/></p><p><span style=\"color: rgb(255, 0, 0);\"><strong>VIP7</strong></span>累计充值投资金额400万元以上可额外<strong><span style=\"color: rgb(255, 0, 0);\">赠送0.15%</span></strong>投资收益</p><p>例如：选择投资项目收益0.82%+奖励0.15%，预期可获得收益：0.97%</p>','page','huiyuandengji','/images/mobile/icon_about5.png',727,0,0,5,1545029916,1584273194,0),(2,'联系我们','','联系我们','服务热线：4000077528\r\n客服QQ：948444555\r\n公司位置：珠海市香洲区人民西路68号（南村豪苑）12栋806室\r\n工作时间：07:00-23:00','<p><img src=\"/uploads/2020/03/202003031056481276.jpg\" alt=\"\"/></p><p>全国统一服务热线：400-000-7782</p><p>官方QQ客服：1029650777</p><p>服务时间：08:00-24:00（全年无休）</p><p>在线帮助：联系在线人工客服或者添加QQ客服</p>','page','contact','/images/mobile/icon_about4.png',637,0,0,4,1545029916,1584271857,0),(11,'常见问题','','常见问题','常见问题','<p><strong>如何成为投资者？</strong></p><p>在APP注册账号，即可成为投资者。</p><p><strong>如何注册账号？</strong></p><p>打开APP，点击官网上方【注册/登录】字样，系统会跳转至【注册】页面，根据页面提示信息填写信息，即可完成注册，完成注册即可成为投资者。</p><p><strong>收不到验证码该怎么办？</strong></p><p>(1）确认短信是否有被手机软件拦截。</p><p>(2）确认手机是否能正常接收短信</p><p>(3）排除因信号问题，欠费，停机等等原因</p><p>(4）短信收发过程中可能会有延时，请耐心等待。</p><p>(5)如还无法正常接收短信验证码，您可联系在线客服进行咨询。</p><p><strong>注册成功后手机号码可以修改吗？</strong></p><p>手机号码是作为用户名登录账号使用的，注册成功后不可以随意修改。</p><p><strong>投资项目前哪些事项需要注意？</strong></p><p>（1）请详细阅读所选择项目的日化收益率、投资周期等信息。</p><p>（2）确保账户的金额充足，如若不够请及时充值。</p><p>（3）必须按照所投资项目的最低标准进行投资</p><p>（4）确认自己将要投资的金额，并核对所选项目剩余金额是否满足自己投资所需。</p><p>（5）一切都需遵从系统要求进行操作，投资完成无法撤销，请知悉</p><p><strong>手机丢失影响账户资金安全性么？</strong></p><p>手机号码尽管作为用户名登录，但还需要知道登录密码和支付密码，此外，账户资金只能提现到您本人经过实名认证的银行卡中，故手机丢失后不会影响账户资金安全，不必担心。</p><p><strong>账户可以申请注销吗？</strong></p><p>平台支持账户注销，请联系在线客服，恪守承诺，将全力保护用户的信息安全。</p><p><strong>账户密码分为几种？</strong></p><p>1)账户密码有登录密码、支付密码两种，登录密码用于登录账户，支付密码在资金发生变化（投资或提现）时均需要使用。</p><p>2)注册时需要设置登录密码和支付密码，为了您的账户安全，请定期更换登录密码和支付密码，并确保登录密码设置与支付密码不同。</p><p><strong>如何找回登录密码和支付密码？</strong></p><p>无法自行修改，可联系在线客服申请重置为初始密码。</p><p><strong>如何修改登录密码？</strong></p><p>登录账户以后，打开【会员中心】页面，点击【账户安全】，找到【登录密码】，根据页面提示信息，输入相应信息，即可完成登录密码的修改。</p><p><strong>如何修改支付密码？</strong></p><p>登录账户以后，打开【会员中心】页面，点击【账户安全】，找到【支付密码】，根据页面提示信息，输入相应信息，即可完成支付密码的修改。</p><p><strong>为什么要进行实名认证？</strong></p><p>(1)为了提高账户安全等级，保障资金的安全性和合同的有效性，要求在首次充值前完成实名身份认证，安全认证的过程简单便捷快速，承诺对所有个人资料均作严格保密。</p><p>(2)实名绑定时，如果身份证号里含有x，直接填写x，不区分大小写。</p><p><strong>如何实名认证绑定？</strong></p><p>登录账户以后，打开【会员中心】页面，找到【实名认证】，根据页面提示信息，输入相应信息，即可完成实名认证绑定。</p><p><strong>实名认证后还能自行修改吗？</strong></p><p>为保证账号资金的安全性，实名认证成功后，不能再自行修改姓名和身份证信息。</p><p><strong>网银充值没有开通，如何申请开通网上银行？</strong></p><p>目前所有的银行都支持个人网银业务，您只需要携带有效身份证件，到当地您所持银行卡的发卡行任意营业网点，即可申请开通网上银行业务。</p><p><strong>为什么需要绑定银行卡？</strong></p><p>绑定银行卡的目的是用于资金提现，因此绑定银行卡的账号信息必须与实名认证的信息一致，绑定时请仔细填写【账号】【开户银行】【开户行信息包括：省级市级区级或县级具体开户所属“分行”及“支行或分理处】名称，（例如：某个省某个市某个区或者县具体所属哪个分行或者支行或者分理处）核对无误后再确认提交收款信息绑定，如果无法确定开户行的信息，请提前致电银行卡所属银行客服进行咨询。</p><p>温馨提示：请绑定申请提现的银行卡账号，并确保该账号的开户人姓名和您绑定的身份证上的真实姓名一致，否则无法提现成功。</p><p><strong>帐户能绑定信用卡收款吗？</strong></p><p>提现资金绑定所用收款银行卡账户仅限储蓄卡，不支持使用信用卡绑定收款。</p><p><strong>帐户能绑定多张银行卡吗？</strong></p><p>不支持多张银行卡的绑定，只限绑定一张银行卡进行提现收款。</p><p><strong>能更改绑定银行卡账户信息吗？</strong></p><p>不可以，绑定成功不支持更改或者删除已绑定银行卡信息。</p><p><strong>更改过绑定银行卡，提现资金会到哪张卡里呢？</strong></p><p>用户提现成功后，提现的资金会进入到提现时所选的银行卡账户里面。</p><p><strong>如何对自己账户进行充值？</strong></p><p>（1）选择微信充值，输入充值金额，点击【确定】，截图二维码，进入微信点击扫一扫识别刚截图的二维码进行识别支付，即可完成充值。</p><p>（2）选择支付宝充值，输入充值金额，点击【确定】，截图二维码，进入支付宝点击扫一扫识别刚截图的二维码进行识别支付，即可完成充值。</p><p>（3）选择银行在线支付方式，输入充值金额，点击【确定】，联系咱们公司的在线客服，下发转账充值银行账号，进入网银或手机银行，转账成功截图发给咱们公司的在线客服提交核实，核实成功系统自动入款，即可完成充值。</p><p><strong>充值需要手续费吗？</strong></p><p>充值没有任何的手续费用。</p><p><strong>充值后多久能到账？</strong></p><p>充值成功后系统自动入款到您的账户上即时到账，如果您通过银行确认已经成功支付，但账号没有显示您的充值记录，您可联系在线客服务进行查询。</p><p><strong>账户对每日的充值有限额吗？</strong></p><p>网银或手机银行转账充值限额是根据您所要用于转账充值的银行账户当日限额。（一般不会限额）</p><p>微信支付充值银行卡当日有限额2万-5万不等，如限额后可在支付的时候选择其它银行卡进行支付充值即可。</p><p><strong>可以用多个银行卡对同一个账户进行充值吗？</strong></p><p>可以，可分别用不同的银行卡进行充值，或者让朋友代为充值都可以，充值成功，资金会到账您所提交充值订单的账户上。</p><p><strong>怎么查询充值记录？</strong></p><p>登录账号以后，点击【会员中心】【充值记录】即可看到所有的充值记录。</p><p><strong>显示支付成功，账户余额却没有增加，怎么办？</strong></p><p>如果您通过银行确认已经成功支付，但账户余额却没有增加，您可联系在线客服进行查询。（一般情况会即时到账）</p><p><strong>帐号为什么显示不能充值？</strong></p><p>为了账户的资金安全，用户需要完成实名认证后才能进行充值操作，登录账号点击【会员中心】找到【实名认证】，根据页面提示信息，输入相应信息，即可完成实名认证绑定。</p><p><strong>支持用信用卡进行充值吗？</strong></p><p>有支持部分的银行信用卡，限制由银行设定的支持充值所决定，如无法支付成功，即表示不支持本张信用卡进行充值。</p><p><strong>提现失败或被系统拒绝是怎么回事？</strong></p><p>（1)检查提现绑定的银行卡姓名是否与身份认证的姓名一致。</p><p>（2)银行开户行信息错误。</p><p>（3)银行账号/户名错误，或是账号和户名不符，如绑定错误，无法自行修改，请联系在线客服处理</p><p>注：如果遇到以上情况，请联系咱们公司的在线客服，必须按照系统要求进行相对应的操作即可恢复正常，否则一切经济损失需自行承担。</p><p><strong>账户怎么申请提现？</strong></p><p>（1)用户登录账号后，点击【提现】，选择银行卡【为保证提现成功处理，请提前绑定银行卡】，输入提现金额和交易密码，点击【确定】，提现申请即可成功提交。</p><p>（2)您可以随时将您在账号中的可提现金额，申请提现到您所绑定的银行账户上。</p><p><strong>申请提现前需要注意什么？</strong></p><p>最低提现金额为500元，请合理安排提现时间</p><p><strong>提现需手续费吗？</strong></p><p>提现均无需任何手续费，全部不需要任何的费用。</p><p><strong>提现后多久可以到账？</strong></p><p>（1)申请提现时间为:每日08:00-24:00，提现申请成功递交后，将于10分钟内可以提现到您所绑定的银行卡账户上。</p><p>（2)夜间01:00-08:00期间提现申请的资金,需在08:00之后由系统自动识别提现到账。</p><p><strong>对投资者收取费用吗？</strong></p><p>郑重承诺对于用户投资项目是不收取任何的费用。</p><p><strong>投资成功什么时候开始计算收益？</strong></p><p>当天投资，当天开始计算收益，24小时后结算当天收益到您账户上（项目1个自然日为24小时）具体请参考项目投放详情。</p><p><strong>什么样的项目适合我呢？</strong></p><p>由于每个人对投资收益和资金流动性的要求不同，专门有不同的项目供您选择投资，在您对所有项目比较之后，根据您自己的需求，确定您的投资方案即可。</p><p><strong>有没有最低投资金额限制呢？</strong></p><p>项目不同，收益不同，投资金额也不同，根据您自己所喜欢的项目进行投资即可。</p><p><strong>什么时候可以投资项目呢？</strong></p><p>项目只要在未满满的情况下，都可以进行投资。</p><p><strong>投资自然日到期资金什么时候进入我的账户上？</strong></p><p>投资到期当天，本金和收益即可返还到用户的账户上，一般会有延迟1-3分钟。</p><p><strong>投资项目到期后可以马上提现吗？</strong></p><p>投资到期后，本金以及收益会在到期日当天返还到您的账户上，一般延迟1-3分钟，到账后可以立即申请提现。</p><p><strong>怎么查看投资记录呢？</strong></p><p>登录帐号以后，点击【首页】【投资记录】页面，可以看到所有的投放记录。</p><p><strong>投资项目以后是否可以取消呢？</strong></p><p>投资以后是不允许取消的，需要按照项目要求进行投资即可，按照要求进行投资项目到期才可进行全额提现或者继续选择其它项目进行投资。</p><p><strong>如何查看合同？</strong></p><p>登录账号以后，点击【首页】【投资记录】页面点击投资记录里面的电子合同，可以看到所有的投资记录，再点击任意投资过的项目即可查看合同。</p><p>注：用户投资前，请仔细阅读以上投资流程问答，如果有不清楚的地方，请提前咨询在线客服，避免操作失误！</p>','page','changjianwenti','/images/mobile/icon_about10.png',432,0,0,10,1583207130,1584279056,0),(13,'收益模式','','收益模式','收益模式','<p>1、第一步，您需要填写必要的注册信息，注册成为参与投资。</p><p>2、第二步，进行充值，充值完成，选择合适您自己的项目进行投放即可。</p><p>3、投放完成，等待24小时项目自动收益资金自动转到您的账户上（详情参考项目结算方式）。</p><p>4、项目到期返还本金，项目到期指的是您所投资项目的自然日进行计算到期日的，例如：投资3个自然日项目，每24小时收益一次，总收益3次，72小时本金和最后一次收益自动转到您的账户上。</p><p>5、投放周期完成即可进行提现或者继续选择其它您所喜欢的项目进行参与。</p>','page','shouyimoshi','/images/mobile/icon_about11.png',591,0,0,0,1584276345,1584277329,0),(3,'公司简介','','公司简介','专业为个人和企业提供全品牌、全方位的融资租赁金融服务，注册资本五仟万人民币，秉承“创造价值，实现共赢”的核心理念','<p>2019年公司携手中天投资共同成立中环天创，实现合作共赢，共谋互联网+金融业务发展，强强联合，充分发挥企业的优势，赋能产业未来。以互联网为辐射中心，对风能、水能、生物质能、太阳能、核能等高利润项目进行投资管理，聚力创新驱动，整合内外资源，构建互联网投资理财产业发展新格局。紧跟时代步伐，把握市场脉搏，顺应互联网+发展大趋势，在实业投资市场取得显著成果，得到了地方政府及社会各界的高度评价和信任。</p><p>专业为个人和企业提供全品牌、全方位的融资租赁金融服务，注册资本1500万人民币，秉承“创造价值，实现共赢”的核心理念，经过不断探索，逐步在行业找准了自己的定位，由一家金融服务机构逐步发展成为立足北京、放眼全国，致力于推动国民经济及社会可持续发展的产业综合运营服务机构。</p><p>公司拥有一支经验丰富、运作高效的精英团队，核心管理层均来自知名融资租赁公司、银行和投行。公司致力于通过融资租赁和其他增值服务，为广大客户提供度身定制的一站式金融解决方案。公司凭借国家扶持政策、统一部署和指导，开展金融、贸易、咨询、投资一体化业务，创造性地将产业资本和金融资本融为一体，形成了具有自身特色的以资源组织能力和资源增值能力相互匹配并协调发展为特征的企业运作优势。除此之外，公司还拥有金融创新试点和多项税收改革政策优势、集团股东的资金优势、政府平台投融资和房地产投融资能力和多元化金融渠道优势。公司的愿景目标是＂融汇北上广、辐射全国，走向全球＂，抓住金融改革和产业创新的历史机遇，打造专业的精英团队，以真诚的服务，为合作伙伴、股东和员工创造持续、稳定、安全的价值回报，成为创新型企业的标杆。</p><p>“汇聚各方资源，助力新兴产业”。面对未来，我们将继续为成为融资租赁行业的典范这一目标而不懈努力，帮助合作伙伴跨越一座座高峰，是我们永远的追求。我们将不断完善企业治理结构，形成富有特色的经营理念；依托深厚的专业素养、完善的风险管理体系及全国资源的整合能力，为公司股东、客户和员工持续创造更多价值。</p>','page','jianjie','/images/mobile/icon_about1.png',761,0,0,1,1545029916,1585383161,0),(7,'邀请好友','','邀请奖励','邀请奖励','<p><img src=\"/uploads/2020/03/202003031028199289.jpg\" alt=\"邀请好友\"/></p>','page','yaoqingjiangli','/images/mobile/icon_about8.png',270,0,1,8,1583202512,1584277737,0),(8,'公司资质','','公司资质','公司资质','<p><img src=\"/uploads/2020/03/202003151924011181.jpg\" alt=\"营业执照\"/></p><p><img src=\"/uploads/2020/03/202003151926504195.jpg\" alt=\"金融许可证\"/></p><p><img src=\"/uploads/2020/03/202003151927069595.jpg\" alt=\"信息系统安全等级保护备案证明\"/></p><p><img src=\"/uploads/2020/03/202003151923257793.png\" alt=\"银行存管\"/></p><p>国家企业信息信用网：https://www.gsxt.gov.cn</p>','page','gongsizizhi','/images/mobile/icon_about2.png',527,1,0,2,1583203953,1585052929,0),(9,'APP下载','','APP下载','APP下载','<p style=\"text-align: center;\"><strong>请保存二维码，扫描下载哦</strong></p><p style=\"text-align: center;\"><img src=\"/uploads/2020/03/202003241521057743.png\" alt=\"APP下载二维码\"/></p>','page','appxiazai','/images/mobile/icon_about3.png',426,0,0,3,1583204050,1585034492,0),(4,'安全保障','','安全保障','APP所发布的投放项目承诺本息保障，保障投资者的资金安全，公司在此基础上之上自有风险准备金做逾期坏账垫付，保障投资者的资金安全。','<p><strong>一、平台本息保障</strong></p><p>APP所发布的投放项目承诺本息保障，保障投资者的资金安全，公司在此基础上之上自有风险准备金做逾期坏账垫付，保障投资者的资金安全。</p><p>A：第三方担保</p><p>公司每个投放产品均由中国太平洋保险（香港）有限公司提供担保，确保投资者本息安全和资金按时回笼。</p><p>B：专业监管的保证金账户</p><p>公司要求担保机构提前向本集团缴存担保总额10%的保证金，同时平台按融资余额专户存储10%的保证金，上述保证金由中国工商银行提供监管，保证逾期借款的足额偿还。担保机构为其保理的每一个产品提供保本连带责任担保，进行全额赔付。</p><p><strong>二、平台资金保障</strong></p><p>1、账户由第三方托管</p><p>资金第三方托管机制，指平台通过接入具有&quot;第三方托管&quot;意义的&quot;清结算分离系统&quot;，使用户间的资金在交易过程中只沉淀在各自的托管账户中，而资金的流转也只在用户间的托管账户中进行，以此保障用户资金安全的机制。在此机制下，可以有效地保证交易资金在平台体外循环，使平台无法通过掌控资金介入到交易中去，同时，用户每一次在平台的交易资金流转都必须经过手机和密码双重验证，确认为用户本人进行操作，确保资金安全。</p><p>2、资金安全由太平洋保险承保，与太平洋保险，共赴&quot;钱&quot;程安全保障全面升级</p><p>公司和太平洋保险达成战略合作，太平洋保险为用户资金安全承担保险责任。用户在APP的充值、提现、投资、赎回等交易过程中，出现资金损失，将由太平洋保险（香港）有限公司承担赔付。</p><p><strong>三、平台风控保障</strong></p><p>1、平台筛选</p><p>公司团队充分利用先进的互联网技术优势结合多年的金融行业风控经验，对两千多个互联网P2P平台进行定性和定量分析并且通过线上互联网数据实时监控的技术手段以及线下考察的方式，在兼顾安全性，流动性以及收益水平的基础上做出最为安全的决策分析，给用户提供资金安全保障，让用户投放的安心。</p><p>2、精选投放产品极致分散</p><p>公司团队根据当前以及未来行业发展趋势分析、平台风险级别以及投放项目流动性等多项指标来设定各平台可选择的各项属性限制，不同地区项目类型及期限都各不相同。例如按照投放项目是否符合国家金融法规以及行业发展趋势，类型是抵押、担保类型还是纯信用，是半年或一年以内期限还是长期，是否可以转让等大量细项指标精挑细选出大量产品进行分散投资，分散风险。</p><p>3、创新流动性管理</p><p>采用创新的项目流动性管理模型，应获收益与理财产品完全智能期限匹配，根除由于产品期限错配导致平台运营流动性风险不可避免增高的顽疾。没有流动性风险，平台自然更安全，投资当然更安心。</p><p><strong>四、平台技术保障</strong></p><p>1、数据安全</p><p>公司拥有一支经验丰富、运作高效的精英团队，核心管理层均来自知名融资租赁公司、银行和投行。在信息安全和数据安全方面有着非常丰富的经验，让您享受银行级别的安全保障；三层防火墙隔离系统的访问层、应用层和数据层集群；有效的入侵防范及容灾备份，确保交易数据安全。</p><p>2、隐私安全</p><p>内部保障，用户的所有重要的个人信息都经过国际领先的SHA1及AES算法加密处理，数据库中不存放明文内容，并且公司内部不同员工设置不同权限，防止内部工作过程中泄密客户信息。</p><p>外部保障，公司在任何情况下都绝不会出售、出租或以任何其他形式泄漏您的信息（逾期客户按照隐私规则被曝光相关信息的除外），严格保护您的个人信息。</p><p>3、通讯安全</p><p>公司平台采用了国际上通用的基于SSL证书的安全传输模块，用户与平台之间的交易数据会经过256位沃通SSL证书加密，全程保护投资者的信息安全。</p>','page','anquanbaozhang','/images/mobile/icon_about6.png',716,0,0,6,1545029916,1584272477,0),(5,'用户注册协议','','用户注册协议','用户注册协议','<p>尊敬的客户，欢迎您注册成为本网站用户，在注册前请仔细阅读如下服务条款。本协议双方为用户与公司，适用于用户注册使用本网站服务的全部活动。<br/></p><p>在注册本网站之前，请您务必认真阅读并充分理解本协议全部内容。您点击本协议下方的“注册”按钮，并按照本网站注册程序成功成为注册为用户，即视为您已经充分理解和同意本协议全部内容，并签署了本协议，本协议立即在您与本公司之间产生合同法律效力，您使用本网站服务的全部活动将受到本协议的约束并应承担相应的责任和义务。<br/></p><p><strong>1、协议组成说明</strong><br/></p><p>1.1本协议的内容包括本协议以下全部条款以及本网站已经公示发布的及将来可能公示发布的各项规则，该等规则均为