></p><p>（7）散布淫秽、色情、赌博、暴力、恐怖或者教唆犯罪的；<br/></p><p>（8）侮辱或者诽谤他人，侵害他人合法权益的；<br/></p><p>（9）煽动非法集会、结社、游行、示威、聚众扰乱社会秩序的；<br/></p><p>（10）以非法民间组织名义活动的；<br/></p><p>（11）含有法律、行政法规禁止的其他内容的。<br/></p><p>4.2在使用本网站时，您不得违反下述规定，如有违反任意一条，本网站基于本网站的独立判断直接删除您在本网站上作出的相关信息，有权要求您改正或直接采取必要的措施禁止（包括但不限于中止、终止、限制您使用本网站服务）而无需通知您，亦无需承担任何责任。如因此而给本公司及本网站造成损失的，您应当赔偿本公司及本网站的损失。<br/></p><p>（1）不得为任何非法目的而使用网络服务系统；<br/></p><p>（2）遵守所有与网络服务有关的网络协议、规定和程序；<br/></p><p>（3）不得利用本网站进行任何可能对互联网的正常运转造成不利影响的行为；<br/></p><p>（4）不得利用本网站进行任何不利于本网站或侵犯本公司利益的行为或言论。<br/></p><p>4.3账户安全及管理：<br/></p><p>4.3.1您在注册时向本网站提交的电子邮箱、用户名、密码及安全问题答案是您在本网站的唯一识别信息。您注册成功后，您应当妥善保管自己的用户名和密码，并对自己的用户名及密码安全性负责，不得将注册的电子邮箱、用户名、密码及安全问题答案转让、赠与或授权给第三方使用。您确认使用您的用户名和密码登陆本网站后在本网站的一切行为以及以您在本网站注册时提交的个人电子邮箱发送邮件的行为均代表您本人，并由您承担相应的法律后果，本公司及本网站不承担任何责任。<br/></p><p>4.3.2协助义务：您如发现有第三人冒用或盗用您账户及密码，或其他任何未经合法授权的情形，应立即以有效方式通知本网站，要求本网站暂停相关服务，否则由此产生的一切责任由您本人承担。同时，您理解本网站对您的请求采取行动需要合理期限，在此之前，本网站对第三人使用该服务所导致的损失不承担任何责任。<br/></p><p>4.3.3本网站有权基于单方独立判断，在其认为可能发生危害交易安全等情形时，不经通知而先行暂停、中断或终止向您提供本协议项下的全部或部分服务（包括收费服务），并将注册资料移除或删除，且无需对您或任何第三方承担任何责任。前述情形包括但不限于：<br/></p><p>（1）本网站认为您提供的个人资料不具有真实性、有效性或完整性；<br/></p><p>（2）本网站发现异常交易或有疑义或有违法之虞时；<br/></p><p>（3）本网站认为您的账户涉嫌洗钱、套现、传销、被冒用或其他本网站认为有风险之情形；<br/></p><p>（4）本网站认为您已经违反本协议中规定的各类规则及精神；<br/></p><p>（5）您在使用本网站收费服务时未按规定向本公司（含关联企业）支付相应的服务费用；<br/></p><p>（6）用户账户已连续三年内未实际使用且账户中余额为零；<br/></p><p>（7）本网站基于交易安全等原因，根据其单独判断需先行暂停、中断或终止向您提供本协议项下的全部或部分用户服务（包括收费服务），并将注册资料移除或删除的其他情形。<br/></p><p>4.3.4您同意，在必要时，本网站无需进行事先通知即有权终止提供用户账户服务，并可能立即暂停、关闭或删除您账户及该用户账户中所有相关资料及档案。<br/></p><p>4.4知识产权：<br/></p><p>4.4.1本网站的所有内容，包括但不限于文本、数据、图片、音频、视频、源代码和其他所有信息，均由本公司及本网站享有知识产权。未经本网站事先书面同意，不得复制、模仿、改编、传播、公布、展示或以任何其他方式侵犯本网站的知识产权。未经本公司书面同意,您不得将本网站包含的资料等任何内容发布到任何其他网站或者服务器。任何未经授权对本网站内容的使用均属于违法行为,本公司有权追究法律责任。注册用户未经本网站的明确书面同意不许下载（除了页面缓存）或修改平台或其任何部分。<br/></p><p><strong>5、用户隐私保护及授权</strong><br/></p><p>5.1您同意本网站在业务运营中收集和储存您的用户信息，包括但不限于您自行提供的资料和信息，以及本网站自行收集、取得的您在本网站的交易记录和使用信息等。本网站收集和储存您的用户信息的主要目的在于提高为您提供服务的效率和质量。<br/></p><p>5.2本网站不对外公开或第三方提供单个用户的注册资料及用户在使用网络服务时存储在本网站的非公开内容，但下列情况除外：<br/></p><p>（1）事先获得