DROP TABLE IF EXISTS `fl_payment`;

CREATE TABLE `fl_payment` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `pay_code` varchar(20) NOT NULL DEFAULT '' COMMENT '支付方式的英文缩写',
  `pay_name` varchar(100) NOT NULL DEFAULT '' COMMENT '支付方式名称',
  `pay_fee` varchar(10) NOT NULL DEFAULT '0' COMMENT '支付费用',
  `pay_desc` text NOT NULL COMMENT '支付方式描述',
  `pay_config` text NOT NULL COMMENT '支付方式的配置信息,包括商户号和密钥什么的',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否可用：0否，1是',
  `listorder` int(11) unsigned NOT NULL DEFAULT '50' COMMENT '排序',
  PRIMARY KEY (`id`),
  UNIQUE KEY `pay_code` (`pay_code`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

/*Data for the table `fl_payment` */

insert  into `fl_payment`(`id`,`pay_code`,`pay_name`,`pay_fee`,`pay_desc`,`pay_config`,`status`,`listorder`) values (1,'balance','余额支付','0','使用帐户余额支付。只有会员才能使用，通过设置信用额度，可以透支。','a:0:{}',1,0),(2,'weixin','微信','0','微信','a:0:{}',1,0),(3,'alipay','支付宝','0','支付宝','a:0:{}',1,0),(4,'cod','货到付款','0','开通城市：×××\r\n货到付款区域：×××','a:0:{}',0,0),(5,'bank','银行汇款/转帐','0','银行名称\r\n收款人信息：全称 ××× ；帐号或地址 ××× ；开户行 ×××。\r\n注意事项：办理电汇时，请在电汇单“汇款用途”一栏处注明您的订单号。','a:0:{}',0,0);

/*Table structure for table `fl_project` */

DROP TABLE IF EXISTS `fl_project`;

CREATE TABLE `fl_project` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `type_id` int(11) unsigned NOT NULL COMMENT '栏目ID',
  `tuijian` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '推荐等级',
  `click` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '点击量',
  `title` varchar(150) NOT NULL DEFAULT '' COMMENT '标题',
  `content` mediumtext COMMENT '内容',
  `litpic` varchar(150) NOT NULL DEFAULT '' COMMENT '缩略图',
  `cover` varchar(150) NOT NULL DEFAULT '' COMMENT '封面',
  `keywords` varchar(60) NOT NULL DEFAULT '' COMMENT '关键词',
  `seotitle` varchar(150) NOT NULL DEFAULT '' COMMENT 'SEO标题',
  `description` varchar(250) NOT NULL DEFAULT '' COMMENT '描述',
  `sell_point` varchar(150) NOT NULL DEFAULT '' COMMENT '卖点',
  `guarantee_agency` varchar(150) NOT NULL DEFAULT '' COMMENT '担保机构',
  `scale` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '项目规模，单位：万元',
  `progress` decimal(6,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '项目进度，单位：%',
  `min_buy_money` int(11) unsigned NOT NULL DEFAULT '1' COMMENT '起购金额，单位：元',
  `max_buy_money` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '最高买入金额，0为无限制',
  `stock` int(11) unsigned NOT NULL DEFAULT '10000000' COMMENT '库存，投资人数',
  `dividend_mode` int(11) unsigned NOT NULL DEFAULT '1' COMMENT '还款方式，0到期还本还息，1每日返息到期返本，7每周返息到期返本，10000每日复利到期返本返息',
  `is_repeat` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否可以复投，0可以，1不可以',
  `daily_interest` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '日化收益',
  `term` int(11) unsigned NOT NULL DEFAULT '1' COMMENT '产品期限，单位：天',
  `sale` int(11) unsigned NOT NULL DEFAULT '1000000' COMMENT '销量，单位：笔',
  `distribution_yiji` decimal(6,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '一级分销奖励，单位%',
  `distribution_erji` decimal(6,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '二级分销奖励，单位%',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '投资状态：0投资中，1已投满',
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户发布者ID',
  `shop_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '店铺发布者ID',
  `admin_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '管理员发布者ID',
  `listorder` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `delete_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除，0未删除',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=394 DEFAULT CHARSET=utf8;

/*Data for the table `fl_project` */

insert  into `fl_project`(`id`,`type_id`,`tuijian`,`click`,`title`,`content`,`litpic`,`cover`,`keywords`,`seotitle`,`description`,`sell_point`,`guarantee_agency`,`scale`,`progress`,`min_buy_money`,`max_buy_money`,`stock`,`dividend_mode`,`is_repeat`,`daily_interest`,`term`,`sale`,`distribution_yiji`,`distribution_erji`,`status`,`user_id`,`shop_id`,`admin_id`,`listorder`,`add_time`,`update_time`,`delete_time`) values (1,1,0,521,'【云南农副产品物流集散综合基地发展项目】','<p><span style=\"col: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 14px; text-indent: 28px; background-col: rgb(255, 255, 255);\">项目名称：农业产业化项目</span><br/><span style=\"col: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 14px; text-indent: 28px; background-col: rgb(255, 255, 255);\">　　副标题：农副产品综合交易基地</span><br/><span style=\"col: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 14px; text-indent: 28px; background-col: rgb(255, 255, 255);\">　　项目所在地：大理巍山</span><br/><span style=\"col: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 14px; text-indent: 28px; background-col: rgb(255, 255, 255);\">　　项目介绍：项目抓住巍山县“十三五”农业发展机遇，以土地流转为载体，开发的农业产业化项目。走绿色化、特色化、规模化、品牌化的现代农业发展道路，突出蔬菜特色产业，深度融合巍山县文化旅游资源，发展休闲、观光、体验、创意相结合的田园综合体，着力打造集科研、生产、加工、销售、休闲于一体的现代农业创新园区。</span><br/><span style=\"col: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 14px; text-indent: 28px; background-col: rgb(255, 255, 255);\">　　建设规模：园区占地99900㎡，拟建农副产品交易区12000㎡，综合型产品交易区12000㎡，冷链物流区7500㎡，配套用房500㎡，综合办公楼4500㎡，配套商业中心14000㎡，商业酒店用房6000㎡，建筑面积合计70500㎡。另外，项目建设道路、停车区等配套设施25000㎡，绿化带12000㎡，项目容积率1.02，建筑密度49.00%，绿化率30%。</span><br/><span style=\"col: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 14px; text-indent: 28px; background-col: rgb(255, 255, 255);\">　　运营模式：发展“基地+合作社+农户”模式，打通农副产品的电商交易渠道及物流运输渠道，以优质特色农产品征服市场，走出巍山，走出大理，走出云南。特色农产品的流通离不开综合交易基地，特此公司提出本项目，拟将现园区东北侧99900㎡土地建设为农副产品综合交易基地。</span><br/><span style=\"col: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 14px; text-indent: 28px; background-col: rgb(255, 255, 255);\">　　项目定位：项目以农副产品交易、展示、储存、物流、集散为主，包括蔬菜、水果、肉类、冻品、粮油副食、农副产品等。项目率先启用移动智慧管理系统和先进农残检测溯源体系，执行标准化管理，保证食品安全，成为惠及市民的“菜篮子”“果盘子”“米袋子”，且积极促进“云品出滇”，打好云南“绿色食品牌”。</span><br/><span style=\"col: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 14px; text-indent: 28px; background-col: rgb(255, 255, 255);\">　　发展目标：发展巍山周边最具规模的优质农副产品集散地；其次，逐步发展集散中心配套商业体系，将美食、酒店、娱乐、农副产品交易融合为一体，最终打造成为西南片区首屈一指的农副产品综合交易基地。</span><br/><span style=\"col: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 14px; text-indent: 28px; background-col: rgb(255, 255, 255);\">　　项目收入：</span><br/><span style=\"col: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 14px; text-indent: 28px; background-col: rgb(255, 255, 255);\">　　（1）交易区经营收入：项目建成后，预将农副产品交易区和综合型产品交易区进行租赁，本案中拟取50元/月·㎡计算，年收入可达1440.00万元；</span><br/><span style=\"col: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 14px; text-indent: 28px; background-col: rgb(255, 255, 255);\">　　（2）冷链物流区经营收入：项目建成后，冷库可对外租赁使用；另对草莓、中草药、蔬果等进行冷链运输。本案中拟取7.5元/天·㎡计算，冷库租赁、冷链运输等所产生年收入可达2053.13万元；</span><br/><span style=\"col: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 14px; text-indent: 28px; background-col: rgb(255, 255, 255);\">　　（3）商业中心经营收入：项目建成后，将对28000㎡商业建筑进行租赁，本案中拟取60元/月·㎡计算，商业中心租赁年收入可达为2016万元/年</span><br/><span style=\"col: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 14px; text-indent: 28px; background-col: rgb(255, 255, 255);\">　　（4）酒店及其他营业收入暂估200万元/年；综上，项目年收入达5709.13万元，增值税按营业收入的6%计为342.55万元，增值税及附加为27.40万元。</span></p><p><span style=\"col: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 14px; text-indent: 28px; background-col: rgb(255, 255, 255);\">&nbsp; &nbsp; &nbsp; 效益优势：项目建设完成后预计可新增200个就业岗位，有效解决剩余劳动力。项目将带动当地就业，增加当地税收，带动当地经济发展。项目建设还将形成集聚效应，拉大产业链条，对项目地经济发展起到很大的促进作用。因此，本项目的建设不仅会给企业带来更好的经济效益，更是社会效益极佳的投资项目，且符合国家鼓励投资项目，将得国家及当地政府的大力支持。</span><br/><span style=\"col: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 14px; text-indent: 28px; background-col: rgb(255, 255, 255);\">　　区位优势：大南高速项目的建设对完善滇西南地区综合交通运输体系，全面构建东连越南、西接缅甸的互联互通布局具有重要战略意义，将为全面动云南省面向南亚东南亚辐射中心建设提供坚实的交通基础保障，也将彻底改变巍山无快速交通的落后局面，极大的加快巍山经济社会发展步伐。目前根据相关规划，大临铁路（大理——临沧）近年内也将经过巍山，且距选址地600m左右为高速路出口；距离选址地2.5km辐射范围内有铁路货运站及铁路客运站。优越的交通位置，有利于项目建成后的市场运输，助力巍山优质产品“走出去”。</span><br/><span style=\"col: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 14px; text-indent: 28px; background-col: rgb(255, 255, 255);\">　　产业优势：巍山——“全省畜牧业生产重点县”、“云药之乡”，具有发展农、林、牧、渔业的优势，盛产各类果蔬、中药材及养殖业资源丰富。巍山县是全省商品粮、油菜、红花、玉米制种、红雪梨生产的重点县，特色产业优势突出。另外鉴于大临高速即将建成通车，项目后期可辐射临沧市。</span></p>','','','【,云南,农副产品,物流,集散,综合,基地,发展,','','项目名称：农业产业化项目副标题：农副产品综合交易基地项目所在地：大理巍山项目介绍：项目抓住巍山县“十三五”农业发展机遇，以土地流转为载体，开发的农业产业化项目。','','中國太平洋保險（香港）有限公司',8000,'34.96',20000,0,10000000,1,0,'1.50',30,1000000,'2.00','1.00',0,0,0,1,6,1583040471,1583040471,0),(2,1,0,41,'【云南自发自用分布式发电项目】','<p>项目市场分析及前景</p><p>1、光伏分布式市场潜力巨大</p><p>就我国而言，太阳能资源十分丰富。据公开数据显示，我国仅利用现有建筑屋顶安装分布式光伏发电，其市场潜力就达到3亿kW左右。同时国内长期依靠燃煤发电为主的电源结构，造成了严峻的环境问题。因此使用光伏发电，同时结合用户需求进行分布式电力供应成为能源格局调整的迫切需求。仅2016年，我国太阳能发电量达到662亿kWh，同比增长72.0%，新增并网太阳能发电设备容量为3459万kW，较上年同期增长1.5倍，远大于其他电源种类增速。根据国家能源局统计数据表明，截至2016年底，我国现有分布式光伏累计装机容量1032万kW。这表明今后4年内分布式光伏装机量每年将至少新增1242万kW。2017年上半年，全国新增光伏发电装机容量2440万千瓦，同比增长9%，其中分布式光伏711万kW，同比增长2.9倍。<br/></p><p>另外由于光伏电池组件效率的提升、制造工艺的进步以及原材料价格下降等因素，使光伏发电成本持续下降。目前光伏标杆电价在0.80~0.98元/kWh左右，预计2020年左右，光伏发电成本可达到0.3~0.7元kWh，在部分地区即可实现平价。成本降低同时带来光伏产业利润大幅度提高，将持续吸引资本投入，促进光伏市场发展。<br/></p><p>2、我国光伏发电的发展前景<br/></p><p>光伏发电系统分为独立光伏发电系统和并网光伏发电系统。前者可以独立进行发电，这种独立光伏发电系统通常会在边远地区及野外的电源中进行应用，由于独立光伏发电系统在日常应用中稳定性还较为欠缺，往往需要建立普通电站作为辅助，这不仅导致发电成本增加，而且与绿色能源的目的也不相符合。后者是指将光伏发申设各与电网连接在一起的发电系统，其转换率比独立光伏发电系统高很多，所以发电系统的供电比较稳定，是光伏发电产业比较合理发展方向。家庭光伏发电是分布式光伏发电的一种形式，分布式光伏发电特指采用光伏组件，将太阳能直接转换为电能的分布式发电系统。它是一种新型的、具有广阔发展前景的发电和能源综合利用方式，它倡导就近发电、就近并网、就近转换、就近使用的原则，不仅能够有效提高同等规模光伏电站的发电量，同时还有效解决了电力在升压及长途运输中的损耗问题。目前应用最为广泛的分布式光伏发电系统，是建在城市建筑物屋顶的光伏发电项目，即以家庭或单位为组成单元的光伏发电形式。<br/></p><p>从世界形势看，近几年来发达国家主要开拓屋顶式并网光伏发电系统，其原因是发达国家电网分布密集，电网峰值用电电费较高，在太阳光好的地区采用光伏发电的电价已经接近商品电价。如德国的光伏发电峰值发电量超过22GWlh。相当于其全国用电量的--半。这个面积比我国云南省还小、年日照小时数与我国东南省份相近的国家，却有着全球最大的光伏发电装机数26GW。其中近90%的电站都是用户端的屋顶电站，更可观的是，这90%的装机容量都是并网发电的。所以说，家庭分布式光伏发电站项目是极具潜力可挖的朝阳产业，发展前景广阔。<br/></p><p>随着社会经济快速发展，光伏发电技术的优势逐渐凸显。目前，光伏发电是一种比较理想的绿色能源，在我国的应用领域非常广阔，并充分发挥了其优势功能。我国在对光伏发电的保护方面，应积极制定相应措施、完善相关政策法规，从而促进光伏发电技术可持续发展，为未来的绿色工程建设起到推进作用。<br/></p><p>建设内容：占用屋顶面积200000平方米，建设容量为28MW的屋顶分布式光伏发电项目，建成后年发电5110万度，采用自发自用，余电上网。<br/></p><p>效益分析：现目前我们所申报的项目为余电上网，所发出来的电先以工业区用电为主，余电卖给南方电网为辅，顾收益增多，而且稳定。<br/></p><p>由一个千瓦每年发电量1823度。投资的电站为余电上网，2017年以前签署的光伏电站，发电一度国家补贴0.1元/度，工业园区电费为0.675元/度，合计为0.775元/度，每个千瓦每年收益1423.5元，28000个千瓦，每年毛收益为3960.25万元。<br/></p><p>同时工业园区管委会收取0.05元/度管理费用。园区业主用电优惠0.03元/度。两项合计：0.08元/度。另外每年的运维费用为0.02元/度。3项总计为0.1元/度。<br/></p><p>由此可得，纯收益为0.675元/度，一个千瓦每年发电量为1823度左右。28000个千瓦，每年共计发电为：5110万度电左右，总计收益为：3449.25万元。<br/></p><p>项目亮点<br/></p><p>政策优势</p><p>在2016《太阳能发展“十三五”规划》中，设定目标到2020年底，太阳能光伏发电装机达到1.05亿千瓦以上。国家决定利用6年时间组织实施光伏扶贫工程。国家发改委发布《关于完善光伏发电价格政策通知》一要及时计量和审核光伏发电项目发电量和上网电量，并根据其计量和审核结果申请电价补贴。<br/></p><p>资源本身的优势<br/></p><p>太阳能，无资源枯竭危险，不会受到能源危机和燃料市场不稳定因素的影响，干净无污染，不受资源分布地域的限制，可在用电处就近发电，能源质量高，获取能源花费的时间短，供电系统工作可靠，并且，太阳能光伏发电大量使用可以减少对石油、煤炭等不可再生资源的依赖。<br/></p><p>节能环保优势<br/></p><p>太阳能的产生不需要燃料，使得运行成本大大降低，太阳能光伏发电不会产生任何废弃物，并且不会产生噪音、温室及有毒气体，是很理想的洁净能源。<br/></p><p>市场优势<br/></p><p>据统计，目前我国太阳能新能源利用市场销售占有率还不到10%，远低于国际市场的50%。太阳能发电将成为未来农村的主导能源并呈现爆发式增长！<br/></p><p>太阳能光伏发电项目，属绿色能源，是永不枯竭的节能、环保，减少污染的洁净能源。有很强的市场竞争能力，有着巨大的市场潜力和广阔的发展前景，社会效益和经济效益都很好。<br/></p><p><br/></p>','','','【,云南,自发,自用,分布式,发电,项目,】','','','','中國太平洋保險（香港）有限公司',8000,'99.99',25000,0,10000000,1,0,'1.66',30,1000000,'0.00','0.00',1,0,0,1,255,1583040471,1583040471,0),(3,1,0,384,'【新疆基础设施工程建设项目】','<p>项目情况</p><p>项目名称：基础设施工程建设项目；</p><p>项目所在地：新疆自治区；<br/></p><p>项目介绍：本公司主要从事建筑工程业务。内容主要为公路工程、水利工程、环保工程的施工与管理；公司拥有公路工程施工总承包二级、市政公用工程施工总承包二级、城市及道路照明工程专业承包三级、水利水电工程施工总承包三级、房屋建筑工程施工总承包三级等建筑业企业资质和认证。<br/></p><p>未来规划：<br/></p><p>2020年<br/></p><p>1、明确公司的市场定位和发展战略，整合现有资源，建立标准化的运营模式和管理模式，提高企业经营效率；<br/></p><p>2、立足主业的同时，加强对水利工程、环保工程等业务领域的布局，增强持续盈利能力；<br/></p><p>3、继续深耕新疆市场，把公路工程总承包资质提升为一级；<br/></p><p>2021年<br/></p><p>1、完善公司营销团队建设和品牌营销体系，全面提高企业的运营管理能力，提升在新疆的市场占有率；<br/></p><p>2、加强与政府及社会资本的深入对接，针对性地拓展目标客户，保证市场发展的广阔性和良好的经济收益率，实现持续稳定发展；<br/></p><p>3、随着业务规模的不断扩大，持续不断优化产品结构；<br/></p><p>2022年<br/></p><p>1、通过前期的稳定发展，企业经营状况良好，形成市场品牌效应，拥有一定的市场号召力；<br/></p><p>2、进一步完善公司运营体系和团队专业化水平，加大品牌营销力度，推动新一轮的快速成长；<br/></p><p>3、整合资源，加速产业融合布局，利用并购、投资、合资经营等方式与优秀的合作伙伴和创业团队精诚合作，不断壮大公司在工程建设行业的布局；<br/></p><p>运营模式：中标项目公司人员施工管理及和其他有资源、实力的项目经理挂靠合作。<br/></p><p>项目优势<br/></p><p>1、区位优势：随着地方经济实力的增强，新疆维吾尔自治区财政实力得到大幅提高，区域经济快速发展、财政收入稳步增长，为公司发展提供了较好的外部环境。近年来，随着国家新一轮改革政策的实施，新疆区域跨越式发展的区位优势日渐显现。在“丝绸之路经济带”的带动下，新疆被定位于国际运输的门户和枢纽，必将持续构建大量交通基础设施以满足整体发展需求。同时，随着“藏水入疆”等项目的逐步推进，未来新疆市场上水利工程也是重头戏。公司作为新疆本土基础设施建设领域的优质企业，将会在改革释放的红利中受益。</p><p>2、品牌优势：公司自2005年成立以来一直致力于自身品牌建设和企业形象塑造，通过不断提高产品质量和服务质量，使公司承建的工程项目合同履约率和质量合格率均保持在较高水平，并先后荣获吐鲁番市“农村公路建设先进单位”，哈密地区“重点农村公路建设先进单位”，吐鲁番地区农村信用社“重合同，守信用”客户，吐鲁番市工商局“AA企业”等多项荣誉，进一步提升了公司品牌知名度和美誉度，赢得了客户的广泛认可和一致赞誉。<br/></p><p>3、资质优势：在竞争日趋激烈的工程建设领域，资质成为博弈的重要工具。公司拥有公路工程施工总承包贰级、市政公用工程施工总承包贰级、水利水电工程施工承包叁级、城市及道路照明工程施工总承包叁级、房屋建筑工程施工总承包叁级、环保工程专业承包叁级、建筑工程施工总承包叁级、钢结构工程专业承包叁级等工程资质，涵盖了公路工程、水利工程、照明工程等行业的诸多领域，且等级较高，保障了公司市场竞争能力。<br/></p><p>4、市场竞争优势：随着建筑施工行业中低端市场竞争的加剧，公司加速从单纯的工程施工，向设计施工总承包、技术研发等全产业链转型升级，业务遍布新疆13个州，形成了高效快捷的经营开发管理模式，初步实现了由资产经营向资本经营、低端项目向中高端项目、单一产业向多元产业转变的业务布局。<br/></p><p>5、人才优势：公司现有职工共计130余人，各类专业管理人员46人。从专业构成来看，技术人员72人，占比达到55%。公司与同行业其它公司相比，在人力资源结构、年龄结构、文化结构、专业技术职务结构等各方面具有一定的优势。<br/></p><p><br/></p>','','','【,投资,此,项目,赠送,588,元,红包,】,【,新疆,','','项目情况项目名称：基础设施工程建设项目；项目所在地：新疆自治区；项目介绍：本公司主要从事建筑工程业务。内容主要为公路工程、水利工程、环保工程的施工与管理；公司拥','','中國太平洋保險（香港）有限公司',9000,'99.19',50000,0,10000000,0,0,'5.45',90,1000000,'0.00','0.00',1,0,0,1,7,1583040471,1583040471,0),(4,1,0,32,'【北京城市垃圾智能分类综合产业项目】','<p>项目背景项目背景</p><p>随着垃圾分类在全国各个地区的推进，垃圾处理行业也愈发壮大，人们对生活清洁的要求也自此疫情开始越来越高。根据国家统计局和OECD数据显示，近几年我国生活垃圾产量保持5%左右的增长，2018年全国生活垃圾清运量达到2.28亿吨，在过去全国生活垃圾清运量始终高于无害化处理量，大量城市生活垃圾未经处理直接堆放，垃圾分类显然很有必要。</p><p>住房和城乡建设部的数据显示，目前全国46个重点城市居民小区垃圾分类覆盖率达到53.9%，其中上海、厦门、宁波、广州等14个城市生活垃圾分类覆盖率超过70%。30个城市已经出台垃圾分类地方性法规或规章，237个地级及以上城市已启动垃圾分类。<br/></p><p>近年来，垃圾处理企业年增量逐年攀升：2017年、2018年新增垃圾处理企业分别为3889家和5378家，而截至11月18日，2019年新增该类企业已超过7300家，占总量的26.49%，平均每天就有约23家新企业出现。但都未真正意义上解决垃圾处理给生活上带来的痛点。<br/></p><p>《“十三五”全国城镇生活垃圾无害化处理设施建设规划》要求，要建立与生活垃圾分类、回收利用和无害化处理等相衔接的收运体系，积极构建“互联网+资源回收”新模式，打通生活垃圾回收网络与再生资源回收网络通道，实现“两网融合”。2018年7月，国家发改委公布《关于创新和完善促进绿色发展价格机制的意见》，提出到2020年底前，全国城市及建制镇全面建立生活垃圾处理收费制度。在其后的其他各类文件中，也陆续提到了研究制定收费制度的目标，意味着，在鼓励、试点、强制等手段，垃圾分类收费时代已到来。<br/></p><p>项目情况项目情况<br/></p><p>项目名称：城市垃圾智能分类综合产业项目</p><p>项目所处地区：北京</p><p>项目介绍：本项目为城市垃圾智能分类综合产业项目，基于针对生活上解决废品处理、回收与保洁清洁的上门服务O2O平台。当前，垃圾分类行业正面临着诸多痛点：垃圾分类本身的痛点、垃圾点对点丢弃痛点、解决国家垃圾分类普及困难痛点、可再生资源回收再利用痛点、超小型清洁痛点、居住空气对空气造成严重污染痛点，等等。而本项目的产品包含但不限于代扔垃圾、可再生废品回收、二手家电回收、保洁清洁等上门服务，致力于最大力度解决用户在生活上因无时间、无精力、身体因素等而最容易忽视且最重要的生活痛点——免费提供专业上门培训，平均培训时间在5分钟左右；同时对于无时间、无精力、身体因素等造成的无法分类垃圾无法丢弃垃圾等生活痛点提供服务；另外，根据用户社区的整体素质针对性的组织垃圾分类宣传活动，定期向居民派发宣传手册、资料，以及知识讲座培训等模式，以便提供用户垃圾分类意识，为垃圾分类后续工作提供良好的实施环境。</p><p>项目规划项目规划<br/></p><p>第一阶段：完成公司注册，逐步推进完善软件开发及前期准备工作。</p><p>第二阶段：优化线上平台，先在当地设立区域服务中心，进行线下铺点式运营，区域化管理。同步结合线上线下实行链接互联网+垃圾分类、可回收物回收再利用服务。<br/></p><p>第三阶段：全国各大城市设立区域服务中心，预计3-5年内平台活动用户量达到3亿人，日活用户5000万，年收入10亿美元。<br/></p><p>盈利模式：平台产品及服务销售、垃圾分拣营收、可回收物资源再利用加工产业，政府补贴、网约上门代理分类+回收业务。<br/></p><p>项目优势项目优势<br/></p><p>1、市场需求：随着最近垃圾分类强制措施的施行，互联网+垃圾分类似乎又迎来新契机。在互联网技术带动下的积分兑换模式，有效推动了垃圾回收的资源化和减量化进程。在居民意识方面，互联网+垃圾分类可以通过激励的形式，为居民提供物质奖励，在回馈的持续性和吸引力上下足功夫，引导居民自觉进行垃圾分类，提高居民参与率。用户体验也是提高居民垃圾分类意识的关键，互联网+垃圾分类让居民的垃圾分类与回收更加方便、快捷，相关服务是更加贴心，居民的分类意识自然会提高。推进垃圾分类，政府、企业和公众三方面合作。</p><p>2、本项目技术人员都具有大型互联网多年工作经验，项目将采用最先进的移动互联网、大数据、物联网、云计算服务等，通过信息化技术，从垃圾分类宣传，投放，服务，清运，处理全方位建立套综合性垃圾分类的软件系统。<br/></p><p>3、全名参与化：鉴于我国环保产业今后的良好发展前景，尤其是城市生活垃圾综合处理市场趋势。在法律法规逐步完善的情况下，明确垃圾分类责任主体，因地制宜，循序渐进，加强宣传，培训和投放督导，引导居民自觉加入开展生活垃圾分类。<br/></p><p>4、政府搭台，企业实施：政府全面鼓励社会资本和专业化服务公司参与垃圾分类工作，建设城市智能垃圾分类系统，推广互联网+新技术，新模式，实现城市垃圾智能分类系统与资源再生系统相融合。<br/></p><p>5、效益优势：平台通过线上+线下的模式，并结合各类增值服务，可以有效解决更多人员就业，同时也可增加新型行业的产生，带动其他产业的发展。<br/></p><p><br/></p>','','','【,北京,城市,垃圾,智能,分类,综合,产业,项目,】','','','','中國太平洋保險（香港）有限公司',3500,'99.99',9800,0,10000000,1,0,'1.07',18,1000000,'0.00','0.00',1,0,0,1,255,1583040471,1583040471,0),(5,1,0,38,'【河南商丘分布式清洁能源供热项目】','<p><br/></p><p>项目背景</p><p>随着我国综合实力的不断提高，人们对生活舒适度的要求也在不断提升，供热行业作为国民经济的基础行业备受重视。就目前来看，河南地区度冬期间电网供电形势较严峻，豫中东地区备用不足，豫南地区供电缺口由个别地区向大范围区域延伸，500千伏豫西北外送、豫中-豫南输电通道长期重载运行，安全运行压力较大。另外，豫南地区电煤供应压力较大。受豫南地区负荷增长以及南方来水减少影响，预计豫南统调燃煤电厂出力较高，耗煤量将持续增加，部分电厂可能出现电煤紧张局面。同时，豫南电厂汽运煤占比较大，受冬季河南大气污染防治管控措施影响，电煤供应压力可能进一步加大。本项目通过分布式清洁能源供热模式运作，向当地地区提供供热服务，具有很大的市场空间。</p><p>项目情况</p><p>项目名称：分布式清洁能源供热</p><p>项目所在地：商丘地区</p><p>项目介绍：本项目项目地“商丘”属于多年集中供热的城市，由于城市发展，商丘现有热力电厂已达到供暖瓶颈，当地不允许新建大型热电厂。目前在商丘市区供暖缺口大概达3000万平方米，本项目拿下商丘地区的独家市场运作，开展分布式清洁能源供热，填补供暖缺口。<br/></p><p>项目发展阶段：总项目需投资5000万资金，目前已投入3000万资金，主要用于项目建设上，公司现有人员50人，已与10个小区签订合作，并且与政府部门已对接有数百万平方米供暖面积。<br/></p><p>项目规划：计划在未来3年内做到1000万平方米供热面积，并且以商丘地区为中心，逐步向周边地区发展，辐射至更多城市。<br/></p><p>盈利点：通过收取安装费、取暖费获利。<br/></p><p>项目亮点<br/></p><p>政策优势：项目目前与示范区政府及宁陵县政府（无集中供热）达成初步共识，所在地区新建住宅和安置房没有集中供热的使用此种方式来进行为居民供暖。</p><p>市场优势：提供暖气，有舒适的环境，与人们的生活息息相关。供暖是居民生活生产和工作必备条件，供暖问题解决不好将带来诸多的弊端，会制约城市的发展，因此城市供暖已成为各级政府都非常重视和高度关注的百姓民生大事因。它是城市发展和建设的需要，所以公司的发展前景非常乐观。<br/></p><p>渠道优势：本项目在商丘地区属于独家经营，与政府等单位合作，已和多个厂家达成特许经销及战略合作，可以非常稳定发展。<br/></p><p>竞争优势：本项目独家经营，签了合同之后，其余热力公司便不能进入该市场，具有很好的竞争垄断优势。<br/></p><p>团队优势：项目方拥有专业的技术团队3组，具有10多年的暖通安装队，可进行施工、维修、维护。<br/></p><p>盈利优势：项目收入稳定，并且还有更高的可待开发价值。<br/></p><p><br/></p>','','','【,河南,商丘,分布式,清洁能源,供热,项目,】','','','','中國太平洋保險（香港）有限公司',2000,'99.99',5600,0,10000000,1,0,'0.86',13,1000000,'0.00','0.00',1,0,0,1,255,1583040471,1583040471,0),(6,1,0,408,'【浙江家居智造协同运营平台项目】','<p>行业背景</p><p>2013年以后，我国家居行业虽然增速有所放缓，但受益于地产后周期、人口中年化再来二次置业、个性化和空间利用最大化等需求兴起，近年家居行业尤其是定制行业又迎来了新一轮增长需求。首先，随着我国10年人口变迁，我们发现其中最明显的趋势是20-40岁的人口基数增多，而人口中年化带来的最大改变即是消费升级，其中，也包括二次置业的需求。家居消费群体呈现年轻化，他们对家居个性化、人性化、智能化、健康化和功能化的追求与日俱增，带动定制家居需求增长。此外，一线城市房价高企，中小户型房源热销，因此如何使住房空间利用最大化已成为一线城市小户型家装的首要任务，定制家居逐步成为现代装修的首选。</p><p>此外，随着消费主体的转变，营销模式也开始进行之前单一的实体店转变。越来越多的传统家具企业尝试向O2O模式转变，顺应互联网发展趋势，能够更好的满足客户的需求。相对于传统企业的经营模式有着更强的竞争力，相信在不久的将来，它们会在整体经济中的占比将逐步上升，并将成为家居销售的主流。<br/></p><p>互联网家居的O2O服务模式正在兴起。家居产品具有非标准化特性，尤其是家具、建材等风格多样、单价较高且规格维度较多的大件商品，以及个性化、差异化消费需求高的定制类商品和装修服务等细分品类，重体验的消费特点十分明显。O2O模式将线上产品信息展示与线下产品体验相结合，为用户选购商品提供了便利，越来越得到用户肯定，销量也得到大幅提升。到2016年，中国家居020行业交易规模达992亿元。由此可见，互联网家居市场空间巨大。<br/></p><p>项目情况<br/></p><p>项目名称：家居智造协同运营平台项目</p><p>项目介绍：项目以互联网及大数据为载体，以家居产业为依托，以创新型的专业化和标准化服务为手段，凭借新媒体网络营销和信息系统支持，全面整合家居品牌方、供应方、房产商等资源，通过图形图像、SAAS系统和专业技术解决方案赋能运营商全链路、全周期、全服务的家居智造协同平台，利用区块链技术及智能中台（PASS/BAAS/SAAS/云计算/云存储/LAAS）等产品和服务服务好C端客户。<br/></p><p>项目产品介绍：</p><p>1、图形图像：在线设计、在线体验、在线应用、在线培训；<br/></p><p>2、SAAS：BI工料机/成本/报价、数字化排版/加工、数字化施工/验收/交付、智能报表/对账/O2O支付；<br/></p><p>3、专业技术：设计/深化/销售、生产/施工物流、安装/验收/交付、全链贯通闭环。<br/></p><p>商业模式：本项目采用S2B的模式，根据用户的关联需求，逐步建立一个综合服务的生态平台。携手众多品牌供应商、B端用户入驻，为S端行业各个品类供应商和B端的装企，双向赋能，赋予新技术、新机会，共创整装生态，实现低成本的实时互动，方便理解客户的需求，寻找客户的痛点，再利用S供应端平台对设计、生产和运输等的协同能力，完成对客户的个性化服务。<br/></p><p>运营模式：<br/></p><p>1、线上为主结合线下运营；<br/></p><p>2、在线消费；<br/></p><p>3、线下服务；<br/></p><p>4、社交流量转换。<br/></p><p>项目优势<br/></p><p>平台优势：本项目平台具备低成本轻资产运营的特点，相对于重资产企业来说，大量减少人力、物力，降低了成本，突破时间和空间的限制，可以快速进行扩张，且覆盖面广，信息量大，破除了地域的壁垒，提供了丰富的信息资源，为各种社会经济要素的重新组合提供更多的可能。</p><p>团队优势：项目创始人从事本行业32年，第三次创业，前两次创业资金高达5亿，带过上千人的团队，在行业中已深耕多年，具有高度执着的钻研精神和开拓精神，能够敏锐地把握行业内的发展趋势，抓住业务拓展机会，对市场有深刻的了解，拥有丰富的行业经验和行业资源。<br/></p><p>项目团队年轻有激情，对本项目的市场和情况非常清楚，能深刻洞察行业的发展趋势，对本项目的发展契机、目标市场定位、营销策略、运营模式、盈利模式、发展战略、预期达到的目标以及相关的风险等已有深入的思考与清晰的规划，并且可以适应公司持续发展的需要。<br/></p><p>先发优势：目前国内市场上与本项目做类似业务的平台较少。本项目既追求产品及服务项目上的广度，也追求专业的深度，同时注重项目整体的前瞻性、系统性及协调性。本平台以广大市民群众为服务对象，市场潜力巨大，未来发展前景广阔，具有良好的经济效益。<br/></p><p><br/></p>','','','【,浙江,家居,智,造,协同,运营,平台,项目,】','','行业背景2013年以后，我国家居行业虽然增速有所放缓，但受益于地产后周期、人口中年化再来二次置业、个性化和空间利用最大化等需求兴起，近年家居行业尤其是定制行业又迎来','','中國太平洋保險（香港）有限公司',10000,'99.30',20000,0,10000000,0,0,'5.35',100,1000000,'2.00','1.00',1,0,0,1,8,1583040471,1583040471,0),(7,1,0,23,'【吉林省“洞宫葬+互联网”项目】','<p>项目背景</p><p>随国家深化改革转型高速发展，我国人口、土地、环境、资源和国家城镇发展之间不协调性的矛盾日益突出。经长时间考察，我公司瞄准了这项为国家与民众未来谋福祉的利好项目，团队经对历史、民俗、实践、区域的论证，比对全国各亲民接地气的前沿科技模式，选定“地宫塔陵葬+物联网”相结合新型智能技术的项目。</p><p>项目以遵循绿色发展理念、融入创新保护性开发及物联网+的科技应用，量身设计打造的以“国学教育”、“孝葬文化”、“节地生态”、“乡村采摘花海观光旅游”、“有机棚膜果蔬”、“医养结合温泉养老产业”、“产业扶贫助力”等项目为主旨的连锁性国家级示范基地。<br/></p><p>项目概况<br/></p><p>项目名称：“洞宫葬+互联网”项目；</p><p>建设单位: 中铁**集团有限公司；<br/></p><p>项目设计：西北西安设计院；<br/></p><p>建设地点:吉林省通化市二道江区；<br/></p><p>项目占地：300亩；<br/></p><p>建设期限为：1.5年；<br/></p><p>目标用户：低端、高端、公益三种。<br/></p><p>项目介绍：本项目是采用“地下骨灰堂塔陵葬+互联网”合作开发建设的新型智能陵园，秉承“以人为本”的宗旨，推出更为科学、现代、网络的殡葬与祭祀方式，以满足广大民众需求。<br/></p><p>项目建设主要内容:洞宫灵位堂、文化景观广场、配套服务区。<br/></p><p>1、洞宫灵位堂：洞宫利用自然山体约50亩，山体表面保持原生态，采用隧道盾构机技术向山体横向挖洞穴面积合计4万平方米，就可以在洞宫内安置灵骨位50万个，且洞宫形状可圆可方，规模可大可小，地上需要土地250亩。<br/></p><p>2、文化景观广场：主要由周易广场8200平方米、孝德广场10000平方米、民俗文化广场7000平方米、祭祀广场8800平方米、莲花广场6600平方米等组成。<br/></p><p>3、配套服务区：规划建设停车场2处；办公楼1栋；五星级主题酒店1栋；水上游乐园以及配套道路、绿化等工程。<br/></p><p>项目规划：<br/></p><p>1、以地方整体规划确定建设规模，预计投资3亿元人民币，扩建50万个安置灵骨位。<br/></p><p>2、本项目竣工投入运营预计解决就业100人，兼职销售人员约1000人。<br/></p><p>3、项目计划以当地文化民俗传统习俗相结合，以县域发展和规划为方针，与区域整体发展相融合，携手共同发展和打造属于我们当地民俗特色的文化产业旅游。<br/></p><p>竞争对手：福寿园、福成五丰、新疆九龙生态园等。<br/></p><p>盈利模式：线上线上相结合的现代化管理经营模式。<br/></p><p>项目优势<br/></p><p>文化创新：园区突出生命纪念主题，以中华易经等经典文化为指导，行孝道、兴德业以智能创新打造人类生命文化殿堂。项目理念是增强孝德文明、感知生命轮回、情感永恒等，是一座思念寄托的“公园”、一座崇尚孝德心灵净化的世间乐园。在实操中我们将凝聚社会共识，走出一条具有中国特色的孝葬文化产业新模式，为建设美丽中国、实现中华民族永续发展作出贡献。</p><p>产业创新：项目依据国家产业导向，将“洞宫葬+互联网”项目与寺庙、陵园、光伏农业大棚、养老公寓等相关及附属产业整合：<br/></p><p>一、恢复了土地生态平衡、控制了土地资源流失转换退化，解决了“死人与活人争地的问题，为国家与子孙万代集约上万亩土地；<br/></p><p>二、依托乡村生态资源，加快打造乡村旅游休闲农业的发展，与国家提出农村“乡村振兴战略”思想同步推进；<br/></p><p>三、公司的设计理念就是开拓一域、造福一方，协助政府为当地民众培育具有造血功能的、有效的扶贫项目，为当地百姓早日脱贫与建设添砖加瓦。<br/></p><p>模式创新：项目根据国家与社会的发展趋势，将相关产业给予高度集约，巧妙的解决了节地、生态、污染、陋习、安全、佛道、祭祀、公祭、休闲、旅游和传承文明、促进区域发展诸多难题。<br/></p><p>技术优势：与传统殡葬和祭祀技术比对，本项目研发的是一种洞宫八卦体智能陵园结构，具有占地少设计拓展空间充足的优势。<br/></p><p>服务优势：提供永久灵骨位和免费日常管理服务；采用VIP视频祭祀+互联网结合；距城区近民众祭拜便捷化；灵骨位费用工薪化；特殊群体优抚化；扶助政府公益化；带动产业链条一体化和一墓难求的民生问题等优势。<br/></p><p>竞争优势：本项目在北方的同行产品销售竞争压力小，且项目方有着土地使用整合、价格的先天优势，为项目的可行性排除减少阻碍，项目区域前景广阔，市场容量大，科技与服务理念的精准定位，品牌价值市场利润巨大。<br/></p><p><br/></p>','','','【,吉林省,“,洞宫葬,+,互联网,”,项目,】','','','','中國太平洋保險（香港）有限公司',15000,'99.99',30000,0,10000000,1,0,'1.28',31,1000000,'0.00','0.00',1,0,0,1,255,1583040471,1583040471,0),(8,1,0,14,'【广西北牛南养肉牛养殖项目】','<p>行业分析<br/></p><p>随着人们生活水平不断提高，中国的牛肉消费人群和消费量也在持续增加，消费整体处于稳步增长态势。但我国不是传统的肉牛养殖大国，养牛业受饲养周期、生产成本、发展方式等多种因素的影响，在未来几年，牛肉供给偏紧的趋势将继续存在。整个牛肉产业市场容量在4000亿元以上，但是国内排名前十的企业加起来不到1/10的产值，在行业有一定知名度和影响力的品牌较少。随着近几年80后、90后、00后消费群体的崛起，在肉类产品的消费习惯上更加容易接受牛肉类产品，或者说更加西化的饮食习惯中包括大量的牛排等产品，使得牛肉产业跟其他产业一样，基础虽然薄弱但是增长可期。</p><p>据博思数据发布的《2018-2023年中国肉牛养殖市场深度调研与投资前景研究报告》表明：2018年上半年我国鲜、冷藏肉产量达1585万吨，累计增长7.8%。我国的肉牛饲养规模化水平仍然很低。当达到世界平均水平时，我国牛肉消费量将突破1100万吨，牛肉消费额将达到7000多亿元，相比现在有近40的增长，需求上升潜力巨大。<br/></p><p>项目概况<br/></p><p>项目名称：北牛南养肉牛养殖项目；</p><p>项目所在地：广西贵港市；<br/></p><p>项目简介：本项目主要养殖肉牛项目，将年养殖500头肉牛，主要养殖鲁西黄牛、利木赞，项目位于贵港市港北区，该项目总用地19公顷左右，其中占用农用地16公顷左右，本项目已和当地的村委会签订了《用地协议书》。<br/></p><p>建设规模：项目总建筑面积约6500平方米，<br/></p><p>建设内容：其中牛舍建筑面积5000平方米，办公和生活用房建筑面积500平米，储料场1000平方米。<br/></p><p>项目现状：目前已投入2000多万，员工6位左右，目前围墙、办公楼，还有盖牛栏场地建设，平整土地等都在建设当中。<br/></p><p>项目优势<br/></p><p>产品优势：牛肉营养丰富，高蛋白低脂肪，其营养价值高于猪肉及其它肉类产品，其肉质鲜美细嫩而不肥腻易消化。</p><p>综合优势：本项目集成相关资源优势，创新有数运作机制，发挥科技支撑作用，开展现代肉牛业优质高效养殖与产业化开发，构建五河肉牛业生产技术推广新体系和产业化生产模式，提升肉牛业科技创新能力，促进肉牛传统养殖技术升级，推动肉牛业由传统数量型向现代质量效益型发展，提高肉牛业科技含量和生产水平，增强本地肉牛业整体实力和牛肉制品市场竞争力，使本地肉牛业生产和产业化经营技术得到较大的提高。通过本项目的实施，使之成为全省畜牧业发展的突破口和标杆，为现代肉牛业发展积累经验。<br/></p><p>市场优势：肉牛业是一个朝阳产业，投资见效快，养殖效益好，是农民增收致富的好途径，有利于全市畜牧结构的调整。随着人们生活的提高和消费习惯的改变，人们对绿色无公害牛肉的消费需求越来越大，市场潜力巨大。<br/></p><p>政策支持：近年来，中共中央及国务院各部委出台了一系列与养殖业、肉制品加工业发展状况相适应的政策性文件，尤其是多次以中央一号文件的形式对我国现代养殖业的发展做出战略性部署。各级地方政府一直都在加大对畜牧业支持力度，不仅出台许多加速畜牧业发展的政策，而且在资金和技术上都给予了很大投入，为我国未来畜牧业的持续增长提供了良好的发展环境。<br/></p><p><br/></p>','','','【,广,西北,牛,南,养,肉牛,养殖,项目,】','','','','中國太平洋保險（香港）有限公司',9000,'99.99',18000,0,10000000,1,0,'1.15',26,1000000,'0.00','0.00',1,0,0,1,255,1583040471,1583040471,0),(9,1,0,818,'【深圳智能电缆测控系统推广应用项目】','<p>项目背景项目背景</p><p>城镇化和工业化是驱动电缆行业规模快速增长的重要因素，电网扩容和智能化是应对我国经济总量的不断提升的基础技术支撑。电力电缆是电网应用最广泛的电力设备之一，功能重要，资产庞大，然而其可靠性监测、智能化技术严重滞后于电网技术的发展趋势和要求，主要表现为欠缺高效的在线监测，故障诊断和信息互联共享等功能，不利于电缆实时状态评估，弱化了相关决策的准确性和时效性。</p><p>本项目智能电缆测控系统技术是解决上述困难的重要方向，该技术实时采集监控数据，经过大数据分析，在线监控电缆热状态，为监控中枢提供数据支撑和判断依据，最终实现电缆工况在线监测、高效故障诊断、快速隔离故障区域等目的，并通过电缆及附件的健康指数评估，合理安排电缆更换和检修，有效提高设备资产利用率，实现对电缆的有效管理。本项目是集智能化、一二次融合、数据资产、泛在互联为一体的具体体现，亦可以成为区块链中数据依据，前景非常广阔。</p><p>项目概况项目概况<br/></p><p>项目名称：智能电缆测控系统推广应用</p><p>项目所在地：深圳<br/></p><p>项目阶段：成长期<br/></p><p>项目介绍：本项目主要致力于电网智能测控系统建设，通过对真实可靠数据进行分析、诊断、实现风险预防与快速故障诊断，并通过电缆及附件的健康指数评估，有效提高设备资产利用率。<br/></p><p>&nbsp;&nbsp;&nbsp;&nbsp;项目发展进度：项目总需投资8000万资金，目前已投入3000万元。发展阶段如下：<br/></p><p>1）2013年-2016年完成110kV智能电缆测控系统开发，被深圳市政府列为2013年新兴战略产业扶植项目，拨付100万扶植资金。<br/></p><p>2）2018年-2019年完成10kV配电网智能电缆测控系统开发(设备和软件），属于深圳**局科研项目。<br/></p><p>项目发展规划：计划2020年5月前完成示范工程；2020年6月开始电网推广应用。<br/></p><p>团队情况团队情况<br/></p><p>项目带头人为原深圳供电**设计院有限公司电缆专业主任工程师，从事高压电缆设计及运维抢修技术服务二十余年，担任百余电缆工程项目设计总工程师，多次获得中国电力规划设计协会优秀工程设计一、二等奖，优秀工程咨询成果一、二等奖。</p><p>开发团队拥有多名博士和硕士，顾问团队为国内从事高压电缆检测知名专家及多所知名大学教授，博导。<br/></p><p>项目亮点项目亮点<br/></p><p>1、行业发展优势：国家发改委、国家能源局提出，到2020年前后也就是“十三五”期间，我国将大面积新建和完善智能电网，电缆应用市场加速发展，技术检测需求量大，前景广阔。</p><p>本项目主要致力于电网智能测控系统建设，通过对真实可靠数据进行分析、诊断、实现风险预防与快速故障诊断，并通过电缆及附件的健康指数评估，有效提高设备资产利用率。<br/></p><p>2、团队优势：本团队人员都是来自电网技术岗位，精通电网技术，积累了丰富的行业经验，具有良好的资源。<br/></p><p>3、技术独创性：已开发的智能电缆测控系统是国际首创，通过带领国内电缆厂（上市公司）和附件厂（上市公司）组成了智能测控系统关联团队。拥有发明专利5项，实用新型专利3项。国内没有拥有本技术的厂家，本技术论文获得中国机电工程学会优秀论文三等奖。鉴于技术保密性，具体项目发展阶段、总资产、关键团队人员情况和关键技术只能提供有意向并实地考察投资方。<br/></p><p><br/></p>','','','【,深圳,智能,电缆,测控,系统,推广,应用项目,','','项目背景项目背景城镇化和工业化是驱动电缆行业规模快速增长的重要因素，电网扩容和智能化是应对我国经济总量的不断提升的基础技术支撑。电力电缆是电网应用最广泛的电力设','','中國太平洋保險（香港）有限公司',5000,'98.16',8000,0,9999997,0,0,'5.26',150,1000003,'2.00','1.00',1,0,0,1,254,1583040472,1583040472,0),(10,1,0,10,'【云南汽修汽贸商业城建设项目】','<p>项目背景</p><p>汽车行业是一个多层次一体化的行业，能够在一定程度反映国家的经济发展运行情况。近年来，中国经济保持中高速增长，居民收入与消费水平稳步提高，工业化水平逐步提高，中国汽车产销量整体提高。根据中汽协统计数据显示，2011-2017年，我国汽车产销量处于不断增长态势。2018年，我国汽车产量为2780.9万辆，汽车销售为2808.1万辆，销量连续十年蝉联全球第一。</p><p>项目介绍</p><p>项目名称：永胜县汽修汽贸商业城建设项目；</p><p>项目所在地：云南省丽江市永胜县永北镇；<br/></p><p>计划前期投入：3000万元；<br/></p><p>建设周期：一年；<br/></p><p>经营理念：志在长远，稳健经营，坚持高质量、高效率的持续增长。<br/></p><p>项目概述：经过长期调研，本项目计划通过在永胜县内建设汽修汽贸商业城的方式，对县内目前的汽车销售、汽配店铺进行资源整合，使得在保护买卖双方利益的同时，规范行业秩序，引导汽车业在永胜地区的健康发展。<br/></p><p>项目以汽车服务为基础支点，通过现代化汽车商贸中心的确立，进行人才导流、客户导流，并开展智能化管理、金融结算、营销匹配、产业链升级等方面的转型。汽修汽贸商业城将提供一体化管理，建成后可提供500家以上的商铺入驻，并配备美食街、公共活动区域等相关场地。后续，随着项目的发展，还将吸引昆明地区的汽配企业前来入驻。商贸城主要致力于提升行业集中度，打造高端的区域汽贸汽配品牌服务，实现产品、营销、服务、渠道的规模化运营，构建“规范化+智能化”的新零售模式。<br/></p><p>项目方依托自身的行业及人脉资源，目前已和当地政府取得联系（正在村委办理手续，并和副省长取得了联系），确保项目切实可行。此外，项目方拥有项目所在地70亩土地11年的使用权（前期租赁15年，尚有11年的使用时间）。后续，项目方计划通过土地买断（一次性购入80亩土地）的方式开展商城的建设，并进行运营管理。<br/></p><p>项目亮点<br/></p><p>1、项目拥有行业经验丰富的创始人及丰沛的上下游资源。项目创始人关总，具有超高的执行力，能充分调动各方资源，把控项目进度，确保项目建设速度以及运营安全。</p><p>2、核心业务定位准确，服务体系完善，潜在客户群体庞大，盈利模式清晰，可行性强。<br/></p><p>3、项目全面整合行业资源，进行永胜地区汽修汽贸零散店铺的聚拢，形成规模化的商贸城。集中力量办大事，全面提高效益，充分利用规模化效益创造新的盈利增长点。<br/></p><p>4、纵观近几年我国有关汽车后市场政策，不难得出国家在引导市场走完全竞争路线，打破市场垄断刺激汽车消费，提高行业的透明度与公平性。而本项目通过汽车商贸中心公开、透明的信息展示以及商铺间比对，将加速行业朝着更健康、更公平的方向发展。<br/></p><p>5、项目采用区域化经营模式，充分整合供应链资源，集中引流消费者，同时积极发挥战略合作宣传效应，有利于拓宽销售渠道，极大降低商铺入驻者的营销推广成本。<br/></p><p>6、后续将建设信息管理中心，引入专业管理人才，通过现代化技术全面提高效益，充分利用科技提高运营效率以及优化商业城管理模式。<br/></p><p>7、品牌化运作，消费者认可度高。<br/></p><p>8、项目计划在运营过程中不断扩大入驻群体，吸引新客户，处于上升发展期，市场潜力巨大，未来发展前景广阔，具有良好的经济效益。<br/></p><p>综合来看，本项目抓住了市场痛点，面对永胜县内汽车销售、维修行业管理混乱、成本高昂以及消费者选择困难的难题，进行了合理布局。本项目业务操作模式简单，落地性强。具有较强的竞争力，同时由于行业发展前景良好及市场刚需性强，公司业务的规模还有进一步拓展的空间。<br/></p><p><br/></p>','','','【,云南,汽修,汽,贸,商业城,建设项目,】','','','','中國太平洋保險（香港）有限公司',3000,'99.99',6600,0,10000000,1,0,'0.89',14,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(11,1,0,10,'【黑龙江牡丹江市天然气供热项目】','<p>项目概述</p><p>项目介绍</p><p>　　项目名称：天然气供热</p><p>　　由于煤炭供暖已经处于淘汰之中，因而天然气、太阳能以及其他清洁能源将逐渐成为冬季供暖的新生力量。2017年冬季，因2016、2017两年煤改气政策的实施，京津冀地区乃至全国大范围大规模的开展了一场居民生活、供热锅炉和工业锅炉的煤改气运动。</p><p>　　未来规划：通过牡丹江政府接头，对牡丹江市区内及外围乡镇统一改造燃煤锅炉，预计面积50万平米。</p><p>　　项目进展：目前已投入800万资金、截至目前，本公司为牡丹江水利四处办公楼及家属楼、牡丹江第二粮库、牡丹江粮食检测站、牡丹江盐业有限公司、牡丹峰国家自然保护区东村林场办公楼及家属小区提供天然气供热，总供热面积约45000平米</p><p>项目优势</p><p>在党和国家的领导下，北方清洁取暖各项工作有序推进，大气污染防治工作取得了明显成效。2019年，打赢蓝天保卫战仍是工作的重中之重，国家和地方政府的相应政策是引导市场发展的主力，政策风向对国家能源和地方发展都具有重要影响，近期，各省陆续发布“煤改”相关政策，继续实施“煤改电”专项行动，国家发展改革委网站印发的《2019年新型城镇化建设重点任务》，明确2019年新型城镇化工作的重点任务，并在加强城市基础设施建设工作内容中指出，督促北方地区加快推进清洁供暖。</p><p>　　1、煤改气后锅炉热效率得到很大的提升。</p><p>　　2、投资成本低：虽然天然气价格要比煤炭价格高，但除了燃料费用以外，只要投资管道就可以。燃煤锅炉不一样，除了燃料费用，还有运输费用、人工费用、储存费用等，总体价格也不便宜。因此从性价比来看，天然气整体更有优势。</p><p>　　3、环保效益：由于天然气本身燃烧充足，且燃烧清洁、排放无污染，是至今为止最为环保的能源之一。煤炭燃烧排放含硫分、灰分比较多，对环境造成的污染比较严重，这也是与燃气锅炉不可比拟的。燃气锅炉能够给企业带来更大的环保效益。</p><p><br/></p>','','','【,黑龙江,牡丹江,市,天然气,供热,项目,】','','','','中國太平洋保險（香港）有限公司',1800,'99.99',3800,0,10000000,1,0,'0.76',8,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(13,1,0,39,'【青海物流园区建设项目】','<p>项目概述</p><p>&nbsp; &nbsp; &nbsp;格尔木市西出口“**之家”多功能物流园建设方面。该项目地点位于格尔木市郭勒木德镇西出口***线以南，占地325亩，计划总投资1.8亿元。物流园是集货物配送、运输、仓储、交易结算、广告、信息发布、咨询服务于一体的专业物流市场。因近年来，随着西部大开发战略的深入实施和柴达木循环经济试验区的稳步发展，省道***线从新疆过往的大型运输车辆密集，每天约有二千多辆大车过往，由于过往车辆流量大，乱停、占道及沿途乱扔垃圾现象十分突出，同时道路更显狭窄，交通阻塞已成普遍现象，严重影响了西出口正常的交通秩序。同时危化品车辆随意停靠，因郭勒木德镇西有一个中国石化加油站，一旦发生交通事故将会给周边居民及学校带来不可预计的损失及伤害。给周边群众以及学校中小学生的人身安全带来了巨大安全隐患。加之目前西出口至郭勒木德镇没有一个停车场及危化品独立停车区域，目前过往车辆及**的吃饭难、住宿难、停车难问题，更没有一个转运和仓储点，迫切需要建设一个功能齐全，配套设施完备，运载能力较强的综合性物流服务园区，保证过往车辆的停放及司乘人员的食宿势在必行，刻不容缓。格尔木市西出口“**之家”综合物流服务园项目建设规划总建筑面积199800平方米，占地约300亩，建设集物流仓储、配送、总部办公、O2O商品经营展示、电商培训服务，供排水及供暖设施、辅助用房、围墙、服务等配套设施设备。其中物流用地121亩，建筑面积54319平方米，含物流仓储用房面积45953平方米，配套后勤用房面积7030平方米，另建物资堆场33334平方米。危化品停本区建筑面积46019平方米，含商贸物流总部办公面积7375平方米，O2O商品经营展示区面积37644平方米，电商培训中心面积1000平方米。</p><p>项目优势<br/></p><p>格尔木优越的地理优势和良好的交通状况公司提供了相当大的发展空间。西部大开发十年来，国家对西部地区的发展予以高度重视以及政策支持，而盐湖城格尔木焕发出的勃勃生机正是西部开发的见证。近年来格尔木招商引资硕果累累，循环经济稳步发展，使得格尔木经济发展有了质的飞跃，正是这一系列的优势为公司发展做了良好的铺垫，同时具有优势的太阳能发电、矿泉水品牌培育、盐湖资源综合开发、油气产业链延伸等优势资源和项目隆重推出，为公司开启了互惠互利之门。</p><p><br/></p>','','','【,青海,物流,园区,建设项目,】','','','','中國太平洋保險（香港）有限公司',23000,'99.99',150000,0,10000000,1,0,'4.38',120,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(14,1,0,19,'【云南省蒙自棚户区改造工程项目】','<p>项目概述</p><p>&nbsp; &nbsp; &nbsp; &nbsp;蒙自市小天鹅片区棚户区改造项目位于红河州蒙自市老城区，已列为省、州、市2015年棚户区改造项目，项目总投资18.26亿元，项目地块范围：东至四川庙街、义正路，南至人民中路、人民西路，西至新村北路、龙井巷，北至龙井路。项目占地309亩，开发建设用地228.75亩，三小改扩建用地23.63亩，道路、配套设施建设用地56.62亩。</p><p>　　全项目均需进行房屋征收补偿安置，改造棚户区总户数约1090户，拆迁面积约179175.54平方米。在满足城市规划条件下，新建房屋总面积676574.3平方米，其中地上建筑面积509243.74平方米，地下建筑面积167330.56平方米，停车位4024个，绿地面积43531.52平方米，绿地率25.03%，主要建设内容为回迁住宅，商业住宅，公寓、农贸市场、幼儿园等。</p><p><br/></p><p>项目优势</p><p>小天鹅片区改造地理位置优越，项目内西南向是蒙自第三小学，地块内包含蒙自老城的保护片区，蒙自市内米轨穿过本项目地，该区域市蒙自市区传统商业区，商户林立，商业氛围浓郁，随着区域内几个项目的建设施工将有效的改善目前区域内交通道路狭窄交通复杂情况，真正形成一个具有现代化城市感的新型城市商业核心区，区域周边市政生活配套完善，项目周边北部现状有荣军医院，小学，项目将新建一所幼儿园。</p><p>　　项目毗邻南湖，雄踞蒙自老城中心绝版地段，背靠城市中心商业区“月牙塘”，“百年铁路活化石”——滇越铁路穿越而过！交通区位得天独厚、文化底蕴源远流长，约2700户新中式山水社区，诉说这百年蒙自故事，传承千年历史文化。</p><p><br/></p>','','','【,云南省,蒙自,棚户,区,改造,工程项目,】','','','','中國太平洋保險（香港）有限公司',15000,'99.99',80000,0,10000000,1,0,'3.58',90,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(15,1,0,17,'【投资此项目赠送888元红包】【河北碳基蓄热材料研发生产项目】','<p>项目概述</p><p>&nbsp; &nbsp; &nbsp; 项目名称：碳基蓄热材料研发生产项目；</p><p>　　项目所在地：河北唐山；</p><p>　　项目介绍：本公司自主研发生产蓄热材料，该材料可用来代替传统煤电供暖，节约能源，降低消费成本。目前项目研发专利已经获批通过，已经有自己的生产流水线；未来计划增加新的生产线，进行宣传推广，积极响应国家煤改电政策，配合政府推广计划，研发高端智能全谷电供暖家具，利用低温蓄热特点与太阳能结合进一步节省用电量，划分代理商，并协助代理商的推广计划。</p><p><br/></p><p>项目优势</p><p>1、本产品用电量少，蓄热量大，供暖效果好，体积小搬运方便，综合供暖费用低。</p><p>　　2、本蓄热材料是有机石蜡，属低温蓄热，无需大功率，不用改造电路，升温快，不受环境温度影响，占地面积只有0.15平方米，搬动方便。</p><p>　　3、产品费用低，仅为其他供暖设施的1/3；本公司产品供暖效果受室外温度影响极小，供暖效果平稳可实现24小时不间断供暖。</p><p>　　4、节能环保，同类型设备中，本公司产品供暖效果达标国家供暖标准，符合国家政策。北方冬季供暖主要以煤电为主要能源，对空气和环境造成了很大污染。研究显示，北京PM2.5有6个重要来源，分别是土壤尘、燃煤生物质燃烧、汽车尾气与垃圾焚烧、工业污染和二次无机气溶胶，其中燃煤占比约为18%燃煤污染对雾霾天气的形成产生了巨大的影响。为了减少冬季燃煤污染、改善空气质量，我国北方许多城市开始推广“煤改电”一系列政策补贴也相应出炉。</p><p><br/></p>','','','【,投资,此,项目,赠送,888,元,红包,】,【,河北,碳,基,蓄,热材料,研发生产,项目,】','','','','中國太平洋保險（香港）有限公司',6000,'99.99',16000,0,10000000,1,0,'1.55',30,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(16,1,0,9,'【投资此项目赠送388元红包】【广东立体轨道运输车项目】','<p>项目概述</p><p>&nbsp; &nbsp; &nbsp; &nbsp;技术背景：</p><p>　　随着火车、汽车等机车的发展，机动交通运输工具在人们日常生活中占的比重越来越重要，而现有技术中的机动交通运输工具中，火车作为轨道运输工具，虽然运输速度快、单次运输量大，但还无法解决青藏高原等环境恶劣地区的交通运输问题，更不能解决海上直达交通运输的难题，传统的铁路运输速度依旧比较低，运行速度也只有350km/h，对环境的破坏也比较严重。</p><p>　　项目名称：广东某立体轨道运输车项目。</p><p>　　运作原理：立体轨道运输车的设计原理非常简单，就是把报废的飞机用三根轨道支撑，在陆地或海面行驶，所有报废或即将退役的小型客机都可以改造成立体轨道运输车在地面或海面行驶。</p><p>　　产品介绍：</p><p>　　简易版立体轨道运输车1：用报废或即将退役的小型客机，以新舟60客机为例，去除前后机翼，起落架，引擎和驾驶舱，前后各加三个轮子，即可获得简易版立体轨道运输车，简易版立体轨道运输车可解决青藏高原、东南亚岛屿不通车，不通路的难题。</p><p>　　升级版产品2：由几架飞机连在一起在地面运行，不加载燃料喷射动力，时速可达400公里以下。适用于雪山高原行驶。</p><p>　　升级版产品3：机翼下方加载飞机引擎，重心低于主轨道，主轮隐藏于机体内，机体运行平稳，车轮全部脱轨不侧翻，时速可超过600公里。适用于海上和国际长途客运。</p><p>　　升级版产品4：城市轨道交换车，产品无机翼，无飞机引擎，时速100公里以内，速度和效率是地铁的2倍以上，可彻底解决城市交通拥堵和环境污染问题。适用于城市和岛屿之间运行。</p><p><br/></p><p>&nbsp; &nbsp; &nbsp;项目优势</p><p>该车车身重量只有高铁的1/10，用新舟60飞机为例，这个飞机净重13.7吨，长24.7米，如果去除飞机引擎，每个引擎至少有2吨重，还有起落架，机翼，驾驶室，总重量不超过10吨。相当于这个轨道每米承受的压力只有450公斤，高铁8节车厢长120米重640吨，相当于每米承受的压力5.3吨。立体轨道运输车每米轨道的承受重量不到高铁的1/10，而支撑架承受的重量更低，只有铁路的1/50，车身轻，承载路基更轻，因此解决海上直达交通运输完全可能。</p><p>　另外，立体轨道运输车具有低噪音、低碳环保、经济高效、安全、快速便捷等优点。可以大量节约土地和地基的建设成本和运行管理成本，对耕地和植被，以及环境破坏相对较小。立体轨道运输车按速度可分为快速车和慢速车，快速车可解决远距离的海上运输难题，慢速车可解决东南亚海岛、雪山高原等环境恶劣地区的交通运输难题。</p><p><br/></p>','','','【,投资,此,项目,赠送,388,元,红包,】,【,广东,立体,轨道,运输车,项目,】','','','','中國太平洋保險（香港）有限公司',4500,'99.99',10000,0,10000000,1,0,'1.35',24,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(17,1,0,3,'【山东德州某SPF鸡（蛋）养殖基地项目】','<p>项目概述</p><p>&nbsp; &nbsp; &nbsp; 项目名称：spf鸡（蛋）养殖基地项目；</p><p>　　项目介绍：</p><p>　　SPF鸡指无特定病原体鸡，SPF蛋指不含有国际规定的19种病原体和相关抗体的卵。SPF鸡的培育建立在对无菌鸡培育成功的基础.上，最初是通过挑选生产性能良好的母鸡，经各种检测证实无主要传染病病原（特别是可经蛋垂直传播的病原），对种蛋消毒，孵育而成。SPF鸡（蛋）是生物制品的原材料。主要用于生物制品及有关制品的疫苗制作、检验、检疫，其生产繁育条件在万级净化环境设施条件下进行。</p><p>　　本项目预计存栏蛋鸡40000只，并配自己的育雏舍种鸡舍冷库，饲料杀菌间，粪便处理间，污水处理间、20kw光伏发电，500立方沑气池。</p><p>　　应用领域；</p><p>　　1、为禽病研究提供优良的实验动物。</p><p>　　2、繁殖种毒、病毒学研究：进行鸡胚培养，提供细胞制备原材料、用于种毒传代、制备高免血清、可保持毒种纯净、血清的特异性和高效价。</p><p>　　3、可保持毒种纯净、血清的特异性和高效价。</p><p>　　4、SPF种蛋的安全性能及营养价值极高，也可供应高档餐饮渠道，更可作为婴儿蛋白粉原料及成人蛋白补充。</p><p>　　5、SPF无菌蛋可生吃，能够迅速补充能量，激发身体活力。</p><p>　　创始人介绍：任总曾任某建筑装饰有限公司总经理，某园林有限公司技术主管，别墅、厂房、办公楼等均创始人一人设计并施工，园林、灯光、音乐喷泉等都是一人完成，创始人对建筑力学、电子、机械原理、电路都运用自如，拥有丰富的社会经验。</p><p><br/></p><p>项目优势</p><p>产品优势：</p><p>　　SPF鸡具有良好的生长和繁殖性能的鸡群。SPF鸡及SPF鸡胚因其微生物学上的相对纯净性而成为病毒学、营养学、病理学研究及生物制品生产、检验中不可缺少的标准实验动物和实验材料。</p><p>　　资源优势：有直系亲属在此行业已有10余年，对于SPF蛋鸡行情能做到随时掌控。</p><p>　　SPF鸡及其种蛋的优越性：</p><p>　　1、无鸡主要的传染病，如：ND、IBD、AI等烈性传染病；</p><p>　　2、无影响实验效果的疾病，如CAA、REV等隐性感染或亚临床症状；</p><p>　　3、无人禽共患病，如结核分枝杆菌病、沙门氏菌病等；</p><p>　　4、无本国或本地域的发病特点，如禽霍乱、鼻气管炎等；</p><p>　　5、根据研究需要须特别控制，如腺病毒病的各个亚型、IB的血清型；</p><p>　　6、无新发生、发现的禽病，如鸡轮状病供毒病、病毒性肾炎等；</p><p>　　7、SPF鸡饲养过程中不使用任何疫苗及抗菌素类药物。</p><p><br/></p>','','','【,山东,德州,某,SPF,鸡,(,蛋,),养殖,基地,项目,】','','','','中國太平洋保險（香港）有限公司',2000,'99.99',4500,0,10000000,1,0,'0.89',15,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(18,1,0,6,'【北京中高端舒适经济型酒店运营项目】','<p>项目概述</p><p>&nbsp; &nbsp; &nbsp; 北京**大酒店位于北京；比邻北京西**南广场，每日流动性客源充足，紧依**池公园。现有部门总经理办公室、行政人事部、客房部、销售部、前台部、安保部、采购部等8个部门，员工总人数为56人；</p><p>　　酒店的地理位置优越、交通便利、环境优美、商业环境极佳，周边大型企业林立。酒店建筑面积10920平方米，地上8层，地下一层，是一家集接待、商住、餐饮、会议、娱乐于一体的综合性中高端酒店。客房总数为196间，种类多样，有商务标准间、高级大床房、特色圆床房、豪华套间；</p><p>　　北京**酒店的配套有停车场、会议厅、自助餐厅、多功能厅、音乐茶吧、宴会厅、宴会包间、商务中心等多元化特色经营项目；</p><p>　　其中停车场在酒店建筑前面，拥有停车位58个；会议厅在酒店四楼，拥有面积140平方米；自助餐厅和多功能厅在一楼，其中自助餐厅占地280平方米，多功能厅占地面积为310平方米；宴会厅和厨房均在B1楼，占地面积1250平方米；</p><p>　　酒店整体装修独特、优雅大方，多功能厅和会议厅可以举办各种宴会、召开各种类型会议，配备线对应的视听设备，视觉效果良好，宴会厅装修豪华大气，包间装潢独具特色。</p><p>　　二、合作企业</p><p>　　1、业务合作企业：有电力医院、通用技术公司、铁路总公司、**国电、中国*业总公司、**集团等大型国有企业及外资企业，均有固定的长期合作；</p><p>　　2、网络平台合作企业：**网、深圳**、同**龙、去**网等国内知名品牌旅行社及网站有良好的合作关系；</p><p>　　定位明确与规划清晰：项目创始人对本项目的发展契机、运营模式、盈利模式、发展战略、预期达到的目标以及相关的风险等已有深入的思考与清晰的规划；</p><p>　　项目宗旨：项目创始人立志在发展中一直秉承“以创新求发展，以质量求生存，以服务求信誉，以管理求效益”的发展理念，本着“信誉第一、客户至上”的经营宗旨，依托资源优势，坚持科学发展观，走新型企业道路，努力打造公司的优秀形象，创建“质量环保型、科技创新型、和谐发展型”现代型观光旅游酒店开发企业。</p><p>项目优势</p><p>发展前景：项目将打造成为当地的旅游酒店特色项目，并带动地方旅游经济的蓬勃发展，提供就业机会，帮助更多的贫困家庭走向小康生活；项目发展定位好，市场空间发展大，每年可接待游客量规模大，收益非常可观；</p><p>　　政策优势：符合国家旅游发展的趋势，江西省旅游发展工作会议召开，敲定了2020年长远发展目标，提出以加快把文化旅游业培育成我省战略性支柱产业为主线，以深化旅游景区景点体制机制改革创新为突破口，以“旅游+”为手段，不断促进全省旅游业改革创新、转型升级、提质增效的发展思路；</p><p>　　性价比高：酒店高品质服务，经济价享受；相对中低端酒店相比，价格飙高覆盖面毫无压力，相对高端酒店相比，我们的定价更容易让消费者接受，平衡了周边价格两极分化的区间，扩大了高低端人群的覆盖面，已达到最大化入住率。</p><p><br/></p>','','','【,北京,中,高端,舒适,经济型,酒店,运营,项目,】','','','','中國太平洋保險（香港）有限公司',1200,'99.99',1800,0,10000000,1,0,'0.78',6,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(19,1,0,6,'【四川商业住宅综合体项目】','<p>项目概述</p><p>项目背景：阆中市2016年末数据显示，全市总人口为87万，总户数为36万户，其中农业户口为58万人，占总人口67%。非农业户为29万人，占总人口33%，另有流动人口13万余人。根据国家及省市及人口农民工进城落户的政策支持，阆中计划每年进城人数为3万至5万人。2016年全市GDP为275亿，同比上年增长11.6%。其中另外阆中市25万农民工到全国各地及国外务工，每人年收入3.5万元，可为阆中市增加近90亿元收入。</p><p>　　项目名称：“**府邸”商业住宅综合体</p><p>　　项目实施单位：四川****置业有限公司</p><p>　　项目建设地址：四川省阆中市七里新区</p><p>　　用地性质：商业、居住混合用地</p><p>　　建设工期：2年</p><p>　　用地面积：43.66亩，建筑面积：119800平方米，住宅面积：9.48万平方米。</p><p>　　国土挂牌规划指标：容积率3.5，建设性质商业20%，居住80%；建筑高度100米，最高可建33层。</p><p>　　项目现状：项目前期用于6000多万元，主要用于土地的定金，各种手续的办理。已完成土地的三通一平、打围、售楼咨询中心、施工临时设施的建设，目前正在基础土石方挖运。</p><p>　　项目介绍：公司致力打造阆中首屈一指的环保、智能、绿色、现代化住宅，结合阆中旅游特色打造阆中千年古城的旅游文化，配套商业综合体、酒店、商业农贸、超市一体化，打造七里新区核心商业区，为外地人士旅游居家，置业，休闲养老多方需求。</p><p>项目优势<br/></p><p>交通优势：有G75兰海高速，兰渝铁路构成阆中交通主干线。高速公路离成都230公里，离重庆250公里，离南充80公里，离广元100公里。</p><p>　　设施齐全：本项目位于四川省阆中市七里新区**地块（市教育局对面），处阆中市七里新区最核心位置，距阆中市政府办公大楼300米，面对教育局、计生局、国税局、粮食局等政府部门不足30--50米，周围有金阆名都、英伦庄园、阳光丽都、欧锦国际、博雅华庭、罗马假日、中央华城、万鑫国际、南池华章等十多个成熟社区。周围配套商场有汇洋购物广场，四川省阆中中学，四川省阆中市江南职业中学，阆中市七里小学、阆中市客运中心等单位，背靠占地600亩体育公园。</p><p>　　增值空间：于该项目是2017年购入的土地，成本较低，今年以来土地价格在逐渐的增长相比今年土地购置要优惠很多。项目位于阆中市七里新区最好地段，地理位置优越。现住宅销售定价为5000至5500元每平，商业销售价为均价18000元每平，负一层商业暂定8000元每平。此楼盘地理位置得天独厚，潜在巨大的升值空间等，本项目在开发市场将具备强劲的竞争优势。</p><p>　　政策支持：国土挂牌的支持性政策，阆中市市政府与****有限公司所签订的土地购买合同，总价款为1.26亿，土地面积为29300平方米（约43.66亩），实际建设面积为18000平方米（约28.22亩)，本项目工商注册、立项、环评、用地规划建设、申报等行政审批环节提供高效服务，并为重大项目提供优质服务及绿色通道。项目各项配套费用减半征收，土地款交付50%可办理开工各项手续，工程进行到±0时可办理销售许可证。</p><p>　　区位优势：阆中为国家5A级景区，国家级最佳环境居住城，中国历史文化名城，中国四大古城之一，中国春节发源地，国家最佳旅游城市。2017年重启阆中机场建设工程，建成后与中国民航飞行学院共同经营航空运输及培训一体，年培训飞行员1000名。2018年正式动工阆中首所公立大专院校“***旅游职业学院”建设，于2020年秋季开始面向全国招生3000名专科学生。阆中生态资源丰富，区内有阆中市规划中的黄土坡湿地公园面积为1500亩滨江公园、阆中古城、春节文化主题公园、白塔山风景区、大佛寺景区、锦屏山景区，熊猫乐园，滕王阁景区、沟溪河湿地景区等国家级旅游风景区。</p><p><br/></p>','','','【,四川,商业,住宅,综合体,项目,】','','','','中國太平洋保險（香港）有限公司',6000,'99.99',16000,0,10000000,1,0,'1.22',30,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(20,1,0,2,'【陕西动力放大机发电厂建设项目】','<p>项目概述</p><p>项目名称：动力放大机发电厂建设</p><p>　　项目所在地：陕西省洋县</p><p>　　项目介绍：本项目主要是把最新发明的动力放大机专利技术应用到实践中，拟建设一家动力放大机发电厂投入运营。项目总计需要3-5亿元人民币，项目目前技术已成熟，专利已申请。</p><p>　　项目原理</p><p>　　动力放大机是创始人在作力学摆轮升降变化试验的基础上研制而成的。《动力放大机》就是把原来摆轮运转的正方向和反向的动力，分解开来给它们各自一个工作平台（即作用力一正方向平台和反作用力一反方向平台），然后给它们配上适当的动力，使它们在动力的作用下，不断改变方向，互相转化，互相支持。来提升摆轮的高度，使它们在势能加速度的状态下产生更大的能量，然合给摆轮和杠杆连杆连接，把它们所产生的动能再经过整合传递出来作功。动力放大机就是把我们一般动力机械作功的反作用转化成作用力的过程，所以如果说作用力用A表示反作用是B。那么动力放大机作的功就是A+B。</p><p>　　该专利技术提高了机械效率，产生了所需的动能或电能。而这项技术可以广泛应用于工业、农业等各行各业。</p><p><br/></p><p>项目优势</p><p>1、本项目高效、节能、环保；</p><p>　　2、用途广泛：可应用于发电厂、舰船、厂矿，还有人们取暖生活以及大型动力机械、电力机械；我们还可以在海洋、天空建造大型农场、城市、工厂，供人们度假、旅游，使天更蓝，大地山川更绿、水更加清澈、甜香，使人类生存的环境更加优美。</p><p><br/></p>','','','【,陕西,动力,放大机,发电厂,建设项目,】','','','','中國太平洋保險（香港）有限公司',5000,'99.99',13500,0,10000000,1,0,'1.07',25,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(21,1,0,0,'【云南人力资源服务行业数字化解决方案项目】','<p>项目概述</p><p>目标市场：人力资源服务（HRS）行业。</p><p>　　人力资源服务（HumanResourceService，HRS），是为用人单位和人才提供各类人力资源服务，从而促进人力资源的有效开发与优化配置的生产性现代服务业。</p><p>　　《第十二个五年规划纲要（2011-2015年）》首次将人力资源服务业纳入五年规划，明确提出规范发展人事代理、人才推荐、人员培训、劳务派遣等人力资源服务。2011年，人力资源服务业首次列入国家产业目录（鼓励类），正式成为国家重点发展的产业领域。</p><p>　　HRS行业目前处于初始成长阶段，增长潜力较大。HRS行业是国家2020年开始实施的《产业结构调整指导目录》中鼓励产业（第46条），其7小条中6条与信息化建设和软件服务相关。2020年将是HRS行业数字化转型元年。</p><p>　　据国家人社部报告，2018年底，全国经营性人力资源服务机构30523家，服务2.2亿人次，劳务派遣人数3.6千万。</p><p>　　◆HRS行业目前处于信息化初级阶段：缺乏懂业务的高级信息化技术人才，缺乏完整有效的行业信息化解决方案和通用信息模型，缺乏行业信息化技术标准；数据孤岛问题严重，信息安全差、数据无保护；急需企业信息化基础平台、业务流程标准化和自动化服务软件、业务过程管理软件、业务协同支持软件；需要数据驱动的决策支持系统、体系化知识服务平台。</p><p>　　◆HRS行业数字化转型时机到来：HRS行业已充分认识到数字化转型的重要性和急迫性，急需高水准、可落地的行业数字化解决方案，急需业务过程管理和协同支持软件！目前仅少数HRS企业在用或用过业务软件，对所用软件普遍不满意，准备替换，需要接地气可全面解决业务痛点的高可用业务软件！专注HRS行业信息化的软件公司极少，且公司缺乏高水平企业信息化专家及具有企业级大规模复杂信息系统研发能力的技术团队！互联网、IoT、大数据、AI、区块链、5G等新一代信息技术在HRS行业的创新应用产品少！</p><p>　　◆HRS行业数字化市场规模：软件服务十亿级，信息服务十亿级，知识服务十亿级，大数据增值服务百亿级。</p><p>　　项目名称：HRS行业数字化解决方案。</p><p>　　项目目标：通过学术研究和一系列落地的软件服务、信息服务、知识服务和数据分析服务产品，引领行业数字化转型，为行业赋能。通过一系列面向HRS企业、用工单位、员工的业务支持软件解决其业务痛点，获得业务过程数据，形成行业大数据，基于价值密度极高的业务过程数据，研发金融、广告、电商、教育、健康等增值服务产品和公益服务产品。</p><p>　　项目路线：市场驱动、理论研究、创新应用研究、产品研发、品牌营销、产品服务，多个团队合作，顶层规划HRS行业数字化解决方案，按市场需求优先级、产品依赖关系和重要性逐步实施。</p><p>　　◆产品介绍：HRS行业数字解决方案包括HRS企业信息化解决方案报告、软件—信息-知识-商业服务集成平台、大数据和知识库平台。规划的产品如下：</p><p>　　（P01）企业信息化基础平台：为用户免费搭建。该平台包括组织结构管理、统一门户与用户单点登录、应用系统管理与集成、数据交换等服务模块。[已上线]</p><p>　　（P02）彩云HRSSaaS：HRS全业务过程管理、业务自动化及业务协同系统，分为基础版和全业务版。[已上线]</p><p>　　（P03）彩云工友：为雇员提供信息管理和消息服务。管理个人信息-简历-工作日历等，查看分享招工信息，查看考勤-工资-社保，信用授权，预支工资等。[已上线]</p><p>　　（P04）彩云用工：用工单位用工管理和HRS业务协作。包括单位信息和用工信息管理发布，HRS人员的社保、考勤、工资和服务费确认，收开电子发票等。[已上线]</p><p>　　（P05）彩云记工：采用IoT、互联网和5G技术，解决灵活用工的考勤记工、算薪和发薪难题。分工厂、快销行业和工地三个版本，与彩云用工集成。[研发中]</p><p>　　（P06）彩云易聘：与已有招聘平台不同，有技术和传播上的创新，采用通用信息模型和自动程序技术生成和维护上万个版本，打破已有的市场格局。[已出Demo]</p><p>　　（P07）彩云易工：灵活用工公共交易服务平台。[已规划]</p><p>　　（P08）劳动监察与服务平台。[一个子系统已在人社局试点]</p><p>　　（P09）农村劳动力转移就业服务平台：就业服务和工资支付保障两个系统，软件免费，增值服务收费。[已规划]</p><p>　　（P10）HRS大数据平台：基于数据的商业服务。[已建框架]</p><p>　　（P11）HRS知识库平台：公益服务和增值服务。[已规划]</p><p>　　◆平台特点：</p><p>　　（T01）技术有保障：理论水平与实践能力都够硬；军用技术保障数据安全和系统性能；多学科技术应用保证产品高度贴合业务；大规模复杂信息系统建模及形式化验证技术保证产品的通用性（适应不同业务模式）；工匠精神保证产品的专业性和易用性；新技术应用研究保证产品领先性。</p><p>　　（T02）HRS行业领先的信息化解决方案：首个行业信息化基础服务平台、业务协同支持平台。</p><p>　　（T03）通过业务软件、大数据和知识库一体化平台提供创新性服务：大数据和知识库为基，面向业务各方的系列业务软件产品为抓手（数据源），信息服务、知识服务和商业服务产品隐含地植入业务过程和各端工作界面中，有效提升服务命中率。</p><p>　　（T04）多端应用，多方协同。业务工作颗粒化，业务流程标准化。数据流转和计算自动化，数据校验和比对智能化。多系统界面和数据无缝集成，实时共享数据。</p><p>　　（T05）统一应用架构：一用户一入口。无论用户使用一个还是多个系统工作，一端只需一个账号登录，且只需要在一套为其智能生成的界面中工作，不用来回切换。</p><p>　　（T06）对接或集成一系列第三方服务，保证业务闭环：短信服务、卡证识别与校验、航天信息电子发票、薪太软跨行发薪、招商银行跨行发薪、支付宝、微信支付、云闪付及其跨行转账、社保士兵、法大大电子签等。</p><p>　　销售计划与营收预测</p><p>　　市场目标：三年占有20%市场，服务7千家HRS企业及其甲方（用工单位）和雇员（蓝领为主），总服务人数2.0千万人。</p><p>　　销售服务计划：市场占有、数据获取、用户粘性优先；2020年重点区域推广（代理为主），2021年开始全国市场；品牌营销；设立办事处，面对面售后服务（最好的营销是贴心的服务）。</p><p>　　营收预测：2020年2700万，2021年1.0亿，2022年3.15亿，2023年7.95亿；七年后，软件服务、信息服务、知识服务、大数据增值服务的年综合营收可达20亿。</p><p>项目优势</p><p>◆市场刚需：行业信息化初期，缺乏高质量、高可用和高安全的业务支持软件产品。</p><p>　　◆时机刚好：国家鼓励，用户已习惯使用电脑、手机和软件辅助工作，已有HRS业务软件不满足需求需要更换，HRS行业需要互联网、物联网、大数据、人工智能、区块链、5G等新技术的创新应用产品来赋能。</p><p>　　◆竞争者少：全国专注HRS行业软件研发的公司少，可查到的共8家，已上线产品中只有我们的彩云HRSSaaS产品具有全业务过程管理和多方协同支持的能力。我们成功打开了湖北（武汉）和福建（福州）市场，被行内认为最难进入的两个区域。</p><p>　　◆专心服务客户：竞争者多数本身或股东从事HRS业务，与客户存在业务竞争关系。我们专心为客户软件-信息-知识服务，帮助客户用信息技术解决业务痛点。</p><p>　　◆专业、专注、接地气、工匠精神：我们以科研的方法规划产品，以工程的方法研发接地气的产品，以工匠精神打磨产品，贴心的服务是最好的营销，不为短期利益迷惑。</p><p>　　◆资源优势：与大学合作，成立两个校企合作中心。HRS行业信息化研究中心，建立行业信息化标准、行业通用信息模型和本体库，开展IoT、大数据、AI、区块链、5G等新技术在行业中的应用研究。HRS科技创新中心，探索人力资源和人力资本服务科技创新产品，如人力评价、信用评价和商业服务等创新产品。</p><p>　　◆技术优势：产品总设计师是公司创始人，是研究大规模复杂信息系统的博士、大学教授，是一流的软件工程和数据集成专家，有二十多年的企业信息化和业务流程标准化经验，七年军品软件研发经验，具有跨学科的IT应用研究和工程实现能力，其深厚的专业理论和工程经验保证了产品的高屋建瓴和高可信的技术水准。技术团队是跟随创始人3-5年的学生，有较好的业务理解力和技术实现能力。</p><p>　　◆团队优势：行业专家、技术大牛、追求卓越的技术工匠团队。</p><p><br/></p>','','','【,云南,人力资源,服务行业,数字化,解决方案,项目,】','','','','中國太平洋保險（香港）有限公司',3500,'99.99',11000,0,10000000,1,0,'0.96',20,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(22,1,0,2,'【山东汽车零部件项目】','<p>项目概述</p><p>一、公司背景及简况</p><p>　　基本情况</p><p>　　莱州**汽车零部件有限公司，位于沿海城市莱州市**工业园区**号，现有国有土地28亩，可利用土地145亩（需征用），紧靠206国道，四周距离村庄2公里。</p><p>　　公司法定代表人为安*，经营范围为制造、销售：汽车零部件、金属结构件、粉末冶金件、钢铁铸造件；货物进出口业务（国家限制或禁止进出口的除外；以上项目须报经审批许可经营的，未获批准前不得开展经营活动；依法须经批准的项目，经相关部门批准后方可开展经营活动）。</p><p>　　二、主营业务</p><p>　　公司始建于1998年，主导产品为发动机排气歧管、齿轮室、飞轮壳、旋压皮带轮、涨紧轮及其它管类铸造产品。公司拥有日本新东自动铸造线。先进的四轴机加工中心，有全技能数控车床、专用机床、通用机床等生产设备。</p><p>　　公司的主要客户为国内汽车发动机厂，拥有为国内上市汽车发动机厂的配套资质。产品主要为主机厂配套，部分产品出口美国。主要客户包括：潍柴、三一动力、扬柴、安徽华凌、奇*、长城汽车、**轿车、潍坊**重工、天津*、北汽福田、**等厂家。2012年，公司成功进入韩国**的全球采购体系。</p><p><br/></p><p>项目优势</p><p>公司价值分析</p><p>　　公司目前拥有多个国内外汽车发动机厂的配套资质，产品主要为主机厂配套。为降低风险，相关主机厂通常针对某个特定部件选择两家供应商进入其采购体系，在上述供应商生产的产品未发生严重质量问题或未进行重大价格调整的情况下，主机厂通常不会对已选择的供应商进行更换，以保持主机质量的稳定性。</p><p>　　针对公司目前的主要客户所采购的相关产品，公司主要与**股份进入上述客户的采购体系，从而形成一定的竞争关系。由于经营规模相差悬殊，公司与**股份对相同客户的议价能力有较大差距。相关主机厂为了避免因**股份议价能力过强导致采购成本增加，对公司的经营发展进行了一定的扶持。从短期来看，公司的生产规模仍将与**股份保持较大的差距，上述扶持将为公司的产品提供充足的市场需求。</p><p>　　综上所述，公司目前拥有的汽车发动机厂配套资质以及相关发动机厂目前对公司的扶持倾向是公司的核心价值所在；从短期来看，公司在取得资金以提高生产能力后，因相关产品的需求充足，公司能够迅速提高盈利能力。尤其对于尚未进入**动力、**汽车等公司主要客户采购体系的汽车发动机配件生产企业，公司的上述核心价值更具吸引力，对公司进行并购后，相关企业可以与公司在下游客户资源上形成互补，扩大市场占有率。</p><p><br/></p>','','','【,山东,汽车,零部件,项目,】','','','','中國太平洋保險（香港）有限公司',2800,'99.99',7500,0,10000000,1,0,'0.85',15,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(23,1,0,11,'【深圳移动社区短视频项目】','<p>项目概述</p><p>项目名称：移动社区项目</p><p>　　项目内容：产生社交效应、分享校园活动的短视频、智能推荐、统计计算、互动。</p><p>　　目标用户：使用智能手机并且思维活跃，互联网参与度高，对信息和社交的需求旺盛的18-35岁年轻人。</p><p>　　项目介绍：本项目主要打造一个专注于校园的开放移动社区平台，项目着力点专注于大学社区，主打短视频、校园社区版抖音+twitter、加速5G智能校园的构建，基于推荐算法的开放社区媒体平台。</p><p>　　项目规划：</p><p>　　1、2020年5月：计划打造的项目简约版本正式上线；</p><p>　　2、2020年9月：计划打造的短视频功能上线；</p><p>　　3、计划在1年内：推广至清华、北大等国内具有代表性的前10名大学；</p><p>　　4、计划在2-3年内：推广至国内重点大学和双一流高校；</p><p>　　5、计划在4年内：在原有基础上，进一步扩展，在国内的高校中达到80%以上的占有率；</p><p>　　6、计划在5年内：在高校的基础上，进一步向社区扩展，拓展产品线。</p><p>　　竞品：人*网、BB*。</p><p>　　盈利点：项目通过广告、电商、付费内容的方式获利。</p><p><br/></p><p>项目优势</p><p>产品价值：本项目应用开发的最大价值就是为商家带来更多的盈利，其开发迎合时代发展的趋势，符合当代年前人的使用习惯。随着智能手机用户规模的不断扩大，以及学生对应用的依赖程度不断增加，未来，还可以开发更多的盈利方式。</p><p>　　政策优势：近几年国家发展迅猛，科技实力不断增强，互联网+时代的大潮已不可忽视，“大众创业，万众创新”的口号已在全国各地打响，李克强总理提出“大众创业、万众创新”，以简政放权的改革为市场主体释放更大空间。</p><p>　　资源优势：作为一个针对高校的平台，毗邻各大高校，有众多的大学生参与和支持，师生资源丰富，传播速度快。</p><p>　　平台优势：通过本项目，用户个人可以及时了解校园有趣的短视频和动态，可以更好的融入校园生活，更便捷的获取校园资讯，如讲座，考研、出国、实习、招聘等跟自己切身利益相关的信息，因此来建立更多的连接，帮助自己成长；对于高校而言，可以更有效的加速学校内的信息传递速度，更高质量的进行校园文化建设，专门针对校园的网上商城和互联网服务让校园生活更加便利。</p><p>　　技术优势：项目打造利用AI+推荐双引擎Turbo，其AI智能精准对接成员的影响力、成员之间的亲密度、事件的热度，基于上述各个因子的精准推荐，让热点事情可以基于移动端，更及时的传播。</p><p><br/></p>','','','【,深圳,移动,社区,短,视频,项目,】','','','','中國太平洋保險（香港）有限公司',1200,'99.99',3800,0,10000000,1,0,'0.74',8,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(25,1,0,6,'【陕西热电联产资源节能综合利用项目】','<p>项目概述</p><p>随着全球经济的发展，环境问题和常规能源耗竭问题日益突出，为促进社会经济的可持续发展以环保和可再生为特质的新能源越来越受到世界各国的重视。因此，新能源产业是对环境保护和满足人类社会可持续发展需要的最终能源选择。</p><p>　　环境问题与能源短缺成为我国经济持续发展面临的新挑战，我国相应提出了“可持续发展”战略，对新能源的开发与利用逐渐兴起。新能源发电及用电设施均对配电开关控制设备构成了直接需求；同时也将促进配电网建设的逐步完善，从而对行业形成间接拉动作用。</p><p>　　项目名称：热电联产资源节能综合利用项目；</p><p>　　项目介绍：本项目充分利用现有企业在兰炭生产过程中产生的兰炭尾气和下脚料兰炭沫，煤矸石等废料通过循环流化床锅炉燃烧，得到高品质的电能和热能。经陕西省工程咨询中心评审，属资源综合利用项目。项目利用兰炭生产的余热发电，超低排放，节约能源，提高资源利用率的同时提高地区电网供电能力，创造经济效益。另一方面本工程属于热电联产项目，符合国家产业政策，建成后将成为该地区重要热源，实现该地区集中供热，不仅能提高市民的生存质量和生活水平，而且有效的实现了经济效益、社会效益、环境效益的有机统一，有益于促进榆林市地区经济和环境协调发展。</p><p>　　区位介绍：项目地址位于陕西省榆林市神木县，厂址距神木县城50km，距府谷县城32km公里，西（安）—包（头）、神（木）—朔（州）铁路、包（头）—府（谷）公路，均从厂区穿过，厂区交通方便，公路铁路四通八达。</p><p>项目优势</p><p>1、新民镇供热基础设施落后，不能满足居民要求改善供热条件的迫切需求，本项目依托府谷县**兰炭有限公司兰炭尾气等资源综合利用的契机，解决新民镇的供热问题，为群众谋福祉；</p><p>　　2、本项目建成后将为府谷县电网提供电源点支撑。满足府谷电网用电的需要，提高地区电网供电能力；</p><p>　　3、本项目工程采用单机50MW高温高压供热机组，燃用企业生产工艺中的兰炭尾气、兰炭沫为燃料，属于国家鼓励的建设项目，符合国家产业政策。工程设计采取的各项污染防治措施先进，特别是同步建设烟气脱硝、脱硫设施，设计效率高，满足目前最新环保政策。本项目实施后使区域内二氧化硫和烟尘排放总量减少，环境空气质量将得到改善，社会效益、环境效益和经济效益好；</p><p>　　4、本项目厂区总平面布置方案具有生产工艺流程顺畅、功能分区明确、占地面积小等特点。向南出线，再折向西。厂区布置合理、规整，施工条件较好，工艺流程顺畅，运行费用小；厂区占地面积较小；循环水管线较短；</p><p>　　5、项目的建设和运营将会增加地方财税收入和就业机会，带动当地加工制造业、运输业、服务业、地方材料供应等多种产业的发展，符合国家产业政策和国家西部大开发的战略。项目的工程建设将会带动当地建材、服务等行业的发展，缓解就业矛盾，增加当地的财政收入，对榆林地区乃至陕西省及周边省份的经济社会发展同样有正面影响；</p><p>　　6、从工程财务看，财务内部收益率高于社会基准收益率，财务净现值大于零，投资回收期短，借款偿还期满足贷款机构要求；从敏感性分析看，该项目具有较强的抗风险能力。</p><p><br/></p>','','','【,陕西,热电,联产,资源,节能,综合利用,项目,】','','','','中國太平洋保險（香港）有限公司',17000,'99.99',38000,0,10000000,1,0,'1.32',50,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(26,1,0,384,'【广州综合性短视频APP研发项目】','<p>项目概述</p><p>项目名称：综合性短视频APP研发项目；</p><p>　　项目所处阶段：初创期；</p><p>　　本项目负责人立志于打造一款能够冲击短视频行业的APP，同时能够冲击传统的电商产品广告的推广模式；我们APP会员通过首页短视频的互动，包括观看、点赞、评论、拍摄等可以获得金币，金币的每日上限根据会员等级不同上限不同，目前设定等级为五级，有普通免费会员有相应等级付费会员；会员通过金币的累计可以去我们的商城免费兑换商品，商城商品目前和网易严选合作，商品价格由我们自己定义；同时会员可以通过“赚钱攻略”领取线上线下的兼职任务，赚取相应的等级佣金，针对会员来说本项目是一款能够娱乐、购物、赚钱的一款APP。</p><p>　　项目功能：</p><p>　　1、在某聊天会友的同时，能让自己和伙伴们享受更好的生活，领先行业的标准化服务，可任意挑选世界大牌潮品；</p><p>　　2、想找人请吃饭？用简友招募饭友。有秘密？发条简友找个聊友一吐为快。旅途太孤单？简友一下召唤小伙伴。找闺密？用某APP诉情怀；</p><p>　　3、自由拍摄短视频，将个人创意加入短视频，通过快速上传实时与他人分享精彩内容；</p><p>　　4、通过短视频的互动，利用商城金币兑换系统，会员可以自由选择金币，余额等多种方式对商城产品进行消费，拉动市场经济发展，进一步促进会员留存和活跃指标；</p><p>　　5、赚钱攻略的线上线下兼职收益灵活性高，时间地点方式的多样性以及收益的多元化，进一步提升企业的营收。</p><p>　　项目进展：</p><p>　　本项目已经从1.0更新到1.7版本，在上线过程中我们根据实际的会员反馈以及内测的BUG，已经在不断完善修复APP；已经实现初步安卓端的试运营，能够提供运营数据，如注册用户、日活跃度等指标；</p><p>　　项目规划：</p><p>　　1、安卓端以及苹果端的全面上线，3-5天内内测相应BUG以及修复完善；</p><p>　　2、未来半年内通过互联网广告以及线下广告打开用户知名度市场，吸引粉丝；</p><p>　　3、未来一年内通过APP的板块增加，添加相应直播以及礼物功能，实现流量的进一步变现；</p><p>　　4、未来3年内通过知名度的提升以及会员用户量的增加通过广告接入以及APP内部功能实现流量的变现；</p><p>　　5、通过内部会员引流功能实现老会员留存以及促活和拉新，保持有源源不断的会员引进，实现新会员的流量变现。</p><p>　　盈利模式：</p><p>　　1、会员注册APP升级等级已经实现第一步的会员流量变现的过程；</p><p>　　2、“赚钱攻略”公司的分成部分高达34%-44%；</p><p>　　3、APP内部功能的增加，会员的礼物充值赠送以及主播收到礼物提现的相应利润；</p><p>　　4、自然量广告的接入，包括信息流，CPL等主流广告方式的展示；</p><p>　　5、电商产品的商城接入，如目前通过主流明星代言的产品并不能保证销量，但是我们APP可以通过金币兑换系统保证电商商家的产品销量，可以大量接入此类电商产品。</p><p>项目优势</p><p>1、竞争优势：市面上所见的短视频APP几乎都是以针对单一领域为主打的种类，竞品特点是以电商+本地化为主，粉丝粘性大多不高，个性化需求没有被充分打开，盈利模式单一，且在新媒体或者短视频这块领域投入较少，本项目的竞争优势主要表现在三方面：粘性高、强分享裂变传播、盈利模式多样；</p><p>　　2、项目优势：会员留存促活率高：针对会员来说这不止是一款娱乐的app，同时也是一款满足自身省钱赚钱的一款app，通过金币以及邀请返佣系统，实现会员间的自主拉新，流量促活；并且项目灵活性高，金币兑换比例，以及金币获得上限和方法，商城商品价格完全有自己定义，后台操作方便简单；</p><p>　　3、满足用户自我表达的需求：随着社交产品的不断完善，人们越来越倾向于通过软件在网络上展示自己美好的一面，作为一款轻体量的短视频APP软件，用户只需要打开手机就能随时录制属于自己的个性化视频，并且能在短时间内获得大量社会关注，充分满足了广大用户群体的虚荣心；</p><p>　　4、短视频即短片视频，是一种互联网内容传播方式，一般是在互联网新媒体上传播的时长在5分钟以内的视频传播内容。相比传统的图文，短视频不仅同样具有轻量化的特点，而且信息量大、表现力强、直观性好。人们利用碎片时间浏览短视频，并且通过弹幕、评论、分享进行社交互动，让短视频具备了病毒式传播潜力，大大增加了短视频影响力；</p><p>　　5、互联网最基本的是流量生意，在如今流量越发珍贵背景下。短视频在传播上能以较低成本获取流量。性价比很高。基于如今一个庞大的用户基础且还有大量用户市场未开发，也许这才是资本市场看中的关键。</p><p><br/></p>','','','【,广州,综合性,短,视频,APP,研发,项目,】','','项目概述项目名称：综合性短视频APP研发项目；项目所处阶段：初创期；本项目负责人立志于打造一款能够冲击短视频行业的APP，同时能够冲击传统的电商产品广告的推广模式；我们','','中國太平洋保險（香港）有限公司',7000,'98.52',15000,0,10000000,0,0,'5.19',120,1000000,'2.00','1.00',1,0,0,1,9,1583040472,1583040472,0),(27,1,0,2,'【湖南PET聚酯织造布研发产销项目】','<p>项目背景项目背景</p><p>1、行业概况</p><p>我国聚酯织造布、聚酯塑钢带、聚酯切片作为聚酯产品需求量一直存在，并随着聚酯产能的不断增加而不断扩大。<br/></p><p>再生型PET聚酯是指对废弃的PET塑料（包括废弃PET瓶、纯涤纶面料加工生产过程中产生的边角料和下脚料、涤纶化纤制作的废织造布等）进行再加工的循环利用技术，目前我国的PET再生主要是以纤维为主，用于化纤行业和服装行业。<br/></p><p>据统计，1吨废弃PET瓶可生产约0.98吨再生聚酯纤维，等同于少用了6吨石油，节约了3m³的填埋空间。<br/></p><p>再生型PET聚酯原材料来源广，以涤纶废丝、泡泡料及矿泉水瓶瓶碎料为原料。每年国内的可使用原料超过1000万吨以上，却未被充分使用。<br/></p><p>2、项目要解决的行业痛点<br/></p><p>PET聚酯工业迅猛发展，在生产和加工过程中约有3%-5%成为废料，环境污染和资源短缺两大问题严重影响PET聚酯工业的发展，实现PET聚酯生产、加工、回收的资源良性循环，已成为PET聚酯工业发展中日益重要的问题。<br/></p><p>从可持续发展、循环经济的角度出发，回收废弃聚酯加工成再生聚酯材料，既符合回收利用、循环再生的环保理念，也有利于缓解资源短缺问题。<br/></p><p>项目概况项目概况<br/></p><p>项目介绍：我公司是一家专业从事再生PET聚酯切片、PET聚酯织造布研发、生产、销售和服务一体化系统集成商。</p><p>本项目生产工艺是将废涤纶料加工成再生增粘聚酯切片以及PET扁丝，主要工序包括分拣、团粒、熔融挤压、均化、模头挤出（切粒或切割拉伸）。<br/></p><p>我公司目前可生产的产品包括：再生PET聚酯切片、再生PET聚酯扁丝、再生PET聚酯织造布。其中再生PET聚酯织造布于目前市场PE产品相比的优势如下：<br/></p><p>产品类型<br/></p><p>PE产品<br/></p><p>再生PET聚酯产品<br/></p><p>材 料<br/></p><p>聚乙烯<br/></p><p>服装边角料、矿泉水瓶瓶碎料<br/></p><p>材料成本<br/></p><p>6000~8000元/吨<br/></p><p>3000~4000元/吨<br/></p><p>销售价格<br/></p><p>12000~15000元/吨<br/></p><p>11000-12000元/吨<br/></p><p>抗老化<br/></p><p>1-3年<br/></p><p>3-5年<br/></p><p>耐性温<br/></p><p>长期使用60℃左右<br/></p><p>长期使用120℃及以上<br/></p><p>防晒性能<br/></p><p>高温下易老化、变脆<br/></p><p>耐高温，防晒性能好<br/></p><p>拉力强度<br/></p><p>机械强度低，表面硬度差，易变形<br/></p><p>强韧性是所有热塑性塑料中最好的，冲击强度好，耐折性好，比较硬朗，<br/></p><p>尺寸稳定，不易变形</p><p>综上所述，利用再生PET聚酯生产的扁丝不裂丝、拉力强度大、耐老化性能及耐高温性能突出、防晒性能（抗紫外线性能）好、耐冲击性好、耐磨性能良好。因此，用其生产的织造布特别适用于野外，使用寿命长，是新生的绿色产业，具有广泛的市场前景。<br/></p><p>项目进展：目前项目属于初创期，项目预计总投资5000万元，目前项目已完成前期投资3000万元，现有厂房（租用）面积约6000平方米，熔体设备生产线1套、拉丝生产线2条、圆织机生产线28台。<br/></p><p>目前公司现有产能：再生PET聚酯切片日产量40吨。<br/></p><p>公司已于2019年12月完成试生产，共计生产200吨再生PET聚酯切片并开始销售。<br/></p><p>项目规划：</p><p>1年内建设计划：原拉丝编织设备需增加配置，再增加挤出机1台，拉丝生产线4条，圆织机生产线12台。<br/></p><p>预计产能和收益：建成后年产聚酯织造布6000吨、聚酯切片12000吨，可实现年产值1.25亿元，实现利润3000万元，预计投资2年可回收成本。<br/></p><p>盈利点：销售费用。<br/></p><p>项目亮点项目亮点<br/></p><p>1、团队优势：</p><p>项目技术负责人黄总工程师有着40年的塑料工艺和塑料机械设计制造经验，以黄总工程师为主的技术团队,经多年的研究，利用自主研发的工艺设备，突破了再生PET聚酯制造扁丝的多项技术难关，是目前国内唯一制造再生PET聚酯织造布的企业，并获得了国家知识产权局颁发的多项国家专利。<br/></p><p>2、技术优势：<br/></p><p>拥有自主研发的工艺设备，国内唯一制造再生PET聚酯织造布的企业<br/></p><p>3、市场应用广阔：<br/></p><p>适用于新兴绿色环保农林产业，例如果园、农业种植的防草保肥、遮阳防晒、防寒保温等用途，水利堤坝等建设等。<br/></p><p>4、成本回收快：<br/></p><p>建成后年产聚酯织造布6000吨、聚酯切片12000吨，可实现年产值1.25亿元，实现利润3000万元，预计投资2年可回收成本。<br/></p><p>5、定位明确与规划清晰：<br/></p><p>本项目经营模式、研发模式、生产/采购模式、营销模式等商业模式完整明确，对于项目的推进和发展有清晰的规划和战略布局。<br/></p><p><br/></p>','','','【,湖南,PET,聚酯,织造,布,研发,产销,项目,】','','','','中國太平洋保險（香港）有限公司',5000,'99.99',7500,0,10000000,1,0,'0.92',20,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(28,1,0,1,'【山东超轻质纳米气凝胶节能隔热材料项目】','<p>项目概述</p><p>&nbsp; &nbsp; &nbsp; 用户痛点：能耗成本过高，环境污染罪魁祸首！</p><p>　　产品描述</p><p>　　本质：气凝胶是一种具有超低密度的固体新材料。</p><p>　　结构：纳米多孔结构（99%为空气），使其具有极强的保温隔热性能。</p><p>　　前景：与石墨烯同被誉为改变世界的10大材料，其14项性能依然保持着吉尼斯世界记录。</p><p>　　合作资源：公司目前是中*油、中油*建、中**设、中石化*建、巨*、武*、**科等公司合格供应商。</p><p>　　目标客户：中**海工项目；中石**工项目；巨*项目；武*项目；博**项目；中*项目；惠*项目；中**陆重工项目；赤湾**旺项目；中**方；中**春；特**（特*电）；**时代；比*迪；合肥*轩；力*电池；孚*科技；比*；亿*锂能；北*能；中*电；卡*新能源。</p><p>　　预计产值：5000万元/年。</p><p>　　产品应用</p><p>　　广泛应用于各类高耗能制造行业、冶金工业、燃煤火力电厂、石油石化医药化工行业、建筑节能（新建&amp;改造）、新能源电动汽车行业、充电桩、家用电器行业、电池制造行业、LNG保冷系统、船舶及海洋工程、高铁车厢隔热、城市居民供热热网、冷藏冷冻、海底管道、军工、航空航天等行业。</p><p>　　一、石油/天然气工业</p><p>　　气凝胶隔热材料凭借着高弹性，低导热系数，高疏水性，易于施工，耐用寿命长等特点，成为石油和天然气工业热损失管理的一个非常好的解决方案。</p><p>　　二、工业、公共与民用建筑</p><p>　　与传统的保温材料相比，气凝胶保温材料的优势是导热系数极低，主要由无机材料制成，防水防火阻燃，使用寿命长，建筑节能降耗，打造绿色城市首推产品。</p><p>　　三、冶金窑炉、火电、热力</p><p>　　气凝胶隔热材料的使用可以达到相同的保温量，且显著降低炉壁厚度，在不增加外部尺寸的情况下增加炉的有效容量。同时，也可优化保温结构和降低能耗。</p><p>　　四、交通运输领域</p><p>　　气凝胶隔热材料凭借着优异的隔热性能、防火性能、隔音性能，为高速铁路、冷藏车、新能源汽车、船舶、飞机和宇宙飞船提供最佳的热保护。</p><p>　　应用细分领域方面，2018年，石油、天然气领域依然是气凝胶最大的应用场景，占气凝胶市场一半以上，第二大市场为工业用隔热材料。预计未来10年建筑物、建设市场用气凝胶将成为增长最快的一个领域。</p><p><br/></p><p>项目优势</p><p>1、前景广阔：中国作为新兴经济体，在市场增长方面将会以快于国际平均水平的速度迅速增加，未来几年将进入快速增长阶段。未来，进入“十三五”节能环保产业将继续获得快速发展，气凝胶材料将在工业和设备领域获得大批量应用，2020年开始全面替换传统工业保温材料，分享国内每年约500多亿的市场。预计2020年开始，气凝胶材料在建筑领域将开始大规模的应用，2025年将全面替代传统建筑保温材料，分享国内每年1000多亿的市场。这还只是在工业保温市场的应用，如果新产品新应用出现之后，气凝胶制品进入日用保温和电子领域之后，未来的市场更加不可估量。</p><p>　　2、政策支持</p><p>　　1）十八届五中全会提出的“创新、协调、绿色、开放、共享”的五大发展理念，首当其冲的就是深入推进科技创新发展。气凝胶被列为十大热门科学技术之一，被称为可以改变世界的多功能新材料。</p><p>　　2）2014年和2015年，发改委连续两年将气凝胶材料列为《国家重点节能低碳技术推广目录》，开始了对气凝胶材料的初步推广应用。</p><p>　　3）我国第一个气凝胶材料方面的国家标准——《纳米孔气凝胶复合绝热制品》，已经制备完成，并将于2018年9月1日起正式实施。</p><p>　　3、技术优势</p><p>　　我们拥有行业新工艺技术，这样的技术先进，节能，环保！</p><p><br/></p>','','','【,山东,超,轻质,纳米,气,凝胶,节能,隔,热材料,项目,】','','','','中國太平洋保險（香港）有限公司',8000,'99.99',10000,0,10000000,1,0,'1.01',14,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(29,1,0,3,'【陕西集装箱运输车融资租赁业务项目】','<p>项目概述<br/></p><p>蒙古国毗邻中国，其优质焦煤资源对中国冶金用煤形成重要补充，2017年中国从蒙古国进口煤炭合计3399万吨，占蒙古国煤炭出口总量的95%以上。目前，中蒙边境已经形成了一条完善的煤炭运输产业链，仅在嘎顺苏海图边境口岸运煤作业的就有170家余企业的1.5万多台运输车辆。受蒙古国交通运输发展部2019年6月发布的新政策要求，这些车辆急需向集装箱运输转变。由于蒙古国的交通路况、油品等级等的限制，境内适用国三排放标准的集装箱平板运输车辆。而我国已经采用国六排放标准，相关法律法规导致国内银行和贷款公司无法为这些国三标准的车辆办理贷款业务。大量缺乏流动资金的运输司机面临无法全款购车的困境。</p><p>　　项目名称：中蒙边境集装箱运输车融资租赁业务项目</p><p>　　项目创始地：陕西</p><p>　　项目介绍：本项目计划开发一个专项运输集装车融资租赁产品，致力于为急需更换车辆的中蒙边界煤炭运输司机提供国三标准的集装箱运输车租赁分期服务，缓解资金压力，尽快实现车辆更换，符合我国甘其毛都口岸通行标准。</p><p>　　项目所处阶段：中期</p><p>　　为最大程度把控运营风险，公司采用融资租赁模式进行业务操作。车辆贷款申请批复后，公司交付车主的不是车款，而是整车车辆。车主只拥有车辆的使用权，而无所有权。当融资租赁协议履行到期后，公司再将产权过户给车主，完成整个业务流程。</p><p>项目优势<br/></p><p>&nbsp; &nbsp; &nbsp; 1、需求较急迫：中蒙煤炭运输企业及司机皆面临新政策越来越严厉的管控，非集装箱运输车动辄数天才能过关口，严重耽误合同履约和运费赚取；而集装箱运输车通过绿色通道几乎不需要等待。司机看在眼里，急在心上。</p><p>　　2、盈利空间大：以1.5万辆更换需求、首付20%保守计算，本项目专项集装箱运输车融资租赁产品资金需求达到30亿，可操作利润空间高达5.4亿元。</p><p>　　3、金融风险低：本项目是为中蒙煤炭货运司机购置集装车所开发的专项项目。目标客户由运输公司牵头来开发。这批客户运输路线单一、固定，非常便于追踪；运输利润较高，司机每月纯收入可达5万元，足以支付贷款费用；由运输公司或车队进行担保，几乎没有风险。此外，公司具有丰富的金融经验和强大的风控团队，做好贷前贷后工作。</p><p>　　4、行业潜力大：融资租赁行业发展潜力巨大，受益因素众多，符合政策方向，市未来将呈现爆发性增长。</p><p>　　5、创始人能力：创始人从事于金融行业多年，是三家金融公司的实际控制人，拥有充足企业运营经验，行业上下游资源丰富，风控能力强劲。此外，宋总拥有蒙古国政府人脉资源，基本掌握了蒙古运矿铁路的项目运营权，完全可以灵活把控本项目的业务节奏，在规避风险的基础上充分获利。</p><p><br/></p>','','','【,陕西,集装箱,运输车,融资租赁,业务,项目,】','','','','中國太平洋保險（香港）有限公司',10000,'99.99',14800,0,10000000,1,0,'1.11',7,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(30,1,0,15,'上海中式生活美学馆项目','<p>项目概述</p><p>&nbsp; &nbsp; &nbsp; 项目地点：上海奉贤区</p><p>　　项目介绍：本项目以融汇了“中式元素生活”、“中式精神生活”与“中式美学生活”的“中式生活美学方式”为特色，对5000多平米楼顶空间花园庭院进行创意设计，融入“互联网+”的思维开发线上平台，为客户提供吃、住、养、游、购、学等全方位一站式中式休闲生活综合解决方案，打造中式生活美学生态链，构建中式生活美学产业新生态。</p><p>　　项目服务：“线上+线下”的模式提供服务，打造吃、住、养、游、购、学一体化的服务链。</p><p>　　项目进展：</p><p>　　1、项目目前邀请国内专业设计团队，中式生活美学馆的设计工作稳步推进中。</p><p>　　2、项目核心团队已经初步组建完毕，团队成员在企业经营、项目运营、品牌策划等多领域经验丰富，并且组建了多领域资深专家团队。</p><p>　　3、项目已于政府部门接洽，后续项目开展将享受政策、税收、融资等多方面的政府支持。</p><p>　　项目规划：</p><p>　　第一年：完成36间中式客房的众筹。</p><p>　　第二年：建设自己品牌，完善各种的软硬件。加强团队建设、拓展市场。</p><p>　　第三年：开启海内外市场，实现模式多地域复制。开始筹备A股上市前期准备工作。</p><p>　　第四年：加强资源整合，拓展业务通路，完善上市数据。</p><p>　　第五年：巩固原有业务与市场，扩大加盟店数量，加盟店数量达到15家，证券交易所上市首次公开募股。</p><p>　　项目模式：“线上+线下”的模式。</p><p>　　盈利点：通过预租收入、艺术品销售、品牌入驻、会员收入、流量价值、商品销售、入驻及服务费用、品牌加盟收入等获利。</p><p><br/></p><p>项目优势</p><p>服务优势：</p><p>　　1、多样化的服务、多元化的盈利渠道：打造吃、住、养、游、购、学一体化的服务链，服务范围涵盖文化娱乐、旅游、中式生活美学体验馆、养生保健等诸多领域，能够满足客户多元化的需求，实现多样化的盈利渠道。</p><p>　　2、传统与现代的结合、全身心的服务享受：项目使客户得到听觉、视觉、嗅觉、味觉、触觉、心觉等六觉上的沉浸式体验，使客户在“身”得到享受的同时，“心”也得到净化与升华。</p><p>　　3、高品质的软硬件配套、健康安全的服务保障：项目方在建筑与相关软硬件设施的配置时，采用国内外先进的技术与装置，如“负离子”材料、先进的消毒装置、养生熵璇技术等，确保服务的绿色环保、安全无毒。</p><p>　　区位优势：奉贤区临江濒海，属于亚热带季风气候，常年主导风为东南风，气候温和，日照充足，四季分明，雨水充沛。空气质量在上海内陆部分为最好。</p><p>　　政策优势：中共上海市委、上海市人民政府指出，“未来五年，上海文化创意产业增加值占全市生产总值比重达到15%左右；到2030年，上海文化创意产业增加值占全市生产总值比重达到18%左右，基本建成具有国际影响力的文化创意产业中心；到2035年，全面建成具有国际影响力的文化创意产业中心”。项目方已于相关部门接洽，政府鼓励公司上文创板，企业进入文创板后将享受财政、资金、税收等多方面的支持。</p><p>　　社会效益：本项目通过高品质的产品及服务的提供，能够让人们获得身心灵放松、活动肌体、交流情感。同时，文化自信是一个民族、一个国家对自身文化价值的充分肯定和积极践行，并对其文化的生命力持有的坚定信心。项目的开展，能够让客户以生活的方式，从生活中感受传统文化的魅力，从而陶冶情操、温养心灵，潜移默化中增加对传统文化的认同，推动社会文化事业的发展。</p><p><br/></p>','','','上海,中式,生活,美学,馆,项目','','','','中國太平洋保險（香港）有限公司',20000,'99.99',60000,0,10000000,1,0,'1.35',48,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(31,1,0,3,'江苏大型恒温仓储冷库建设项目','<p>项目概述</p><p>&nbsp; &nbsp; &nbsp; &nbsp;项目背景</p><p>　　邳州是个农业大市，是全国大蒜三大主产区之一，全市种植大蒜面积达到百分之九十八，发展生态农业离不开冷链物流的支持。该项目的建成，有利于降低农业生产成本，有利于推动农业产业化，有利于提升农产品品质及价值。</p><p>　　有数据表明，我市农副产品在采摘、运输、物流等环节上的损失率在百分之三十左右，发达国家的农产品损失率则控制在百分之五以内。</p><p>　　目前，我市百分之九十九农副产品都需要仓储冷存，一些仍在服役的老冷库是上个世纪末的产物，失去了维修改造价值，到了淘汰落后产能必须关停的时候。现国家对环保和土地的政策严重控制土地资源及建设，我市农副产品仓储冷库不足，在大蒜市场的冷库就更加稀缺。导致当地大多农副产品流失到外围冷库及周边省份冷库。其产生了巨大的人力及运输成本。每年都有部分种植户因没有订到周边冷库而又不想花费高额运输成本，导致发芽、腐烂的损失。</p><p>　　项目名称：大型恒温仓储冷库建设项目；</p><p>　　项目所在地：江苏省邳州市；</p><p>　　项目发展阶段：已投入资金900万元建立12间门面、收购大蒜钢棚一座、中转储存钢棚一座、办公大楼一栋。</p><p>　　项目介绍：项目创始人从事大蒜行业28余年，有稳定的客户资源，深耕行业市场及行业变动。本次融资规划用地8亩建设大型恒温仓储4至5千吨冷库、是以储存大蒜为主，目前，大蒜市场冷库偏少，大多冷库都在外围，而我们此次建冷库的位于大蒜市场正中心、是不可多得的黄金地段，与外围的冷库相比、我们可给储存商节约一大笔短途运输费用。是储存商不二选择的位置。</p><p>　　运营模式：以租赁形式出租冷库、收取冷库存储费用。</p><p>　　合作模式：</p><p>　　1、前期所有利润可全归投资商，投资商收回全部成本后，盈利三七分配（我方三成，资金方7成）；</p><p>　　2、也可每年获取50%利润，五年后一次性退还本金。</p><p>　　盈利模式：冷库仓储费。</p><p>项目优势<br/></p><p>&nbsp; &nbsp; &nbsp; 政策优势：</p><p>　　国家对农业大宗农产品和鲜活农产品冷链物流非常重视。从2014年-2020年支持力度在不断加大，冷链物流业是融合金融、运输、仓储、货代、商贸、信息产业的复合型服务业是支撑国家经济发展的基础性、战略性产业。加快发展现代物流产业，对提高国民经济竞争力和建设生态、文明具有重要战略意义。</p><p>　　区位优势：</p><p>　　邳州大蒜种植历史悠久，是国内最大的优质大蒜主产区，享有“中国大蒜之乡”的美誉。全市有70多万亩标准化种植示范基地，主要分布在车辐山、宿羊山、碾庄、、赵墩、邳城、八义集镇，年产优质大蒜70余万吨，“邳州大蒜”被认定为国家地理标志保护产品，“邳州大蒜”获批国家生态原产地保护产品，品牌价值评估151.5亿元，可保证冷库仓储不会闲置问题。</p><p>　　市场优势：</p><p>　　当前，我国经济社会发展和人民生活水平不断提高，城乡居民对于高品质生鲜农产品和食品消费需求日趋旺盛，对食品质量安全尤为关注，作为物流业的重要分支，冷链物流面临着难得的高速发展期及机遇期。</p><p><br/></p>','','','江苏,大型,恒温,仓储,冷库,建设项目','','','','中國太平洋保險（香港）有限公司',2000,'99.99',3300,0,10000000,1,0,'0.75',28,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(32,1,0,1,'湖北药品物流配送中心建设项目','<p>项目概述</p><p>项目名称：药品物流配送中心建设项目</p><p>　　项目地址：武汉蔡甸区</p><p>　　发展现状：项目目前总投资9000万元，其中土地购置1200万元，建筑工程费3000万元，设备购置及安装费900万元，流动资金3000万元。资金来源由湖北**医药有限公司自筹5000万元，占总投资的67%，银行贷款2100万，占总投资的33%。</p><p>　　项目规模：项目总用地面积16807㎡（约25.2亩）。规划总建筑面积15000㎡，其中仓库10000㎡，办公楼3000㎡，宿舍1700㎡，食堂300㎡。配套建设停车位60个，绿化1700㎡。建筑密度为59%，容积率1.23，绿地率10.3%。</p><p>　　主要建设内容：项目创始人拟在武汉市蔡甸区朱家湾物流园内建设一家集药品仓储管理、药品物流配送、员工培训为一体的大型药品物流配送中心。项目主要建设内容有仓库、药品配货区、办公楼、宿舍、食堂、职工培训中心，配套建设停车位、道路、绿化、供配电、给排水、消防、环保等设施。项目建成后将满足项目建设单位在药品配送与储存上的需要。</p><p>　　项目介绍：本项目旨在利用现代物流及信息技术，建立在供应商、分销商、用户之间，集仓储管理和物流配送为一体。实现对蔡甸区医药物流进行总体调度和控制，实现蔡甸区内外大批量医药制品的往来和流通，及对城区各连锁药店、医院等用户的医药配送。完善仓储、网络、信息、配送等多项物流功能的配置，打造蔡甸区具有蔡甸区特色的现代药品物流交易及配送中心。</p><p><br/></p><p>项目优势</p><p>一、公司资质实力雄厚</p><p>　　公司经过十几年的经营发展，目前已经具有完善的连锁经营网络，现有自己的直营药店6家，加盟药店22家，遍布蔡甸区城关、乡镇。占据整个蔡甸区药品零售市场的三分之一。形成了一个成熟的零售终端市场。在职员工150人，其中药学专业技术人员77人，含执业药师22人，医师1人，主管药师3人，药师46人，药士5人，约占职工总数的50%，从事质量管理，验收养护及计量的专职人员共33人，约占职工总数的20%。有完善的全面的质量管理网络，对药品购销存实施全面监控。质量保证体系和检测、监控管理机构齐全。2013年8月公司通过GSP的认证，被国家药品监督管理局授予GSP达标公司称号。并每年获得工商部门颁发的“重合同守信誉”的荣誉证书；被药品监督管理局多次授予“药品质量信誉四星级公司“的称号。2009年国家食品药品监督管理局对我区药品两网建设进行检查验收，在区药监局的指导和我公司全体员工的共同努力下，以全省最高的评分顺利通过了我区的药品两网建设检查验收，为蔡甸区药品监督与配送赢得了荣誉。公司于2011年4月28日经湖北省药品集中采购平台专家评议审核通过，成为我省合格的药品配送公司。</p><p>　　二、完善的机制和资源配置</p><p>　　公司具有建立健全的公司管理制度和完善有效的质量管理体系，并有反应迅速、服务周到的售后服务系统。公司的仓储和运输设备完善，有包括冷库和阴凉库在内总面积达到2300㎡的库容，是全区药品库容量最大，硬件条件最完善的仓储设施；有运输车辆10台，均具有冷藏运输能力，运力充裕；并分片区定人员的无条件的每天为每家客户配送相关的药品</p><p>　　三、市场需求</p><p>　　在区委、区政府的大力支持下，我公司于2011年6月开始实行基药配送。现已覆盖武汉市。其中二级医疗机构2家，乡镇医院32家、村办卫生所327家，药店60家，年配送额达8000万元，让全区60万人得到了真正的实惠。我司作为蔡甸区唯一一家指定的配送公司，承担着整个蔡甸及周边地区的用药及药品配送，随着基药的需求量剧增，销售量增加，此项目具有广阔的市场空间，一经落地必将带来巨大的商业利润。</p><p><br/></p>','','','湖北,药品,物流配送,中心,建设项目','','','','中國太平洋保險（香港）有限公司',5000,'99.99',6500,0,10000000,1,0,'0.83',23,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(33,1,0,2,'合肥太阳能无人烘干中心(粮食)项目','<p>项目概述</p><p>项目名称：太阳能无人烘干中心（粮食）项目；</p><p>　　融资主体：合肥**太阳能热力工程科技有限公司；</p><p>　　项目介绍：本项目位于合肥市庐江县白湖镇**农场——为全国特大型农场之一，项目占地50亩，建筑面积30000㎡，主要是做太阳能热力供应，通过把太阳能的热能收集到集装箱，再将所收集的热应用到烘干机上，攻克农业粮食方面的烘干问题，项目将遵循“合理和集约用地”的原则，按照烘干机行业生产规范和要求进行科学设计、合理布局，符合烘干机制造和经营的规划建设需要。</p><p>　　项目进展：公司现有员工总数37人；公司目前已获的发明专利12项，实用新型专利8项，其中“太阳能中高温在废旧塑料再生应用”荣获2016年安徽省级创新大奖；目前项目的试验论证及小样已完成。</p><p>　　融资用途：主要用于建设示范用地、烘干设备、集热装置、烘干控制系统与除尘设施、烘干用房、移动热源集装箱以及云平台与知识产权保护等。</p><p>项目优势<br/></p><p>&nbsp; &nbsp; &nbsp; 团队优势：</p><p>　　高效优质的管理团队是公司发展最有利的保障。本项目拥有优秀的专业团队，团队人员具有丰富的行业经验、资源及专业知识，能够保证项目的顺利进行与持续运营。</p><p>　　项目团队拥有先进的技术经验，丰富的资本和市场资源，并且熟知行业运营管理模式，对本项目的发展契机、目标市场定位、营销策略、运营模式、盈利模式、发展战略、预期达到的目标以及相关的风险等已有深入的思考与清晰的规划。</p><p>　　公司技术力量和综合研发能力都属国内前列，同时项目方的管理层皆有丰富的行业从业经验，都是行业的突出人才，对于项目的战略发展有全方位的把控，对于市场趋势有合理的分析，在团队建设上有自己独到的见解。</p><p>　　项目方自身拥有丰富的行业流量、渠道及客户资源，拥有众多潜在的客户群体，销售渠道有保障，为技术的产业化和项目的市场推广奠定了良好的基础，未来项目还会继续扩充组建一支精干且富有活力的队伍。</p><p>　　产品优势：</p><p>　　公司经过多年的研究与开发，培养出一支专业扎实、团结进取、朝气蓬勃的技术研发团队，坚持以客户服务为核心，以技术创新为导向，提升自主创新能力，走出了以研发驱动市场的新模式。项目团队还有20多项发明专利，这对整个项目以及太阳能无人烘干的升级转型起到重要推动作用。</p><p>　　本项目自动化程度高，生产采用新技术、新工艺，工艺设备先进，具有高科技技术，主要工艺机械化、自动化程度高，改善传统工艺繁重的体力劳动条件，提高劳动生产率、节能减排，通过自动化装置控制生产主要工艺流程，优化工艺过程，提高效率和产量，降低生产成本，提高市场竞争力和经济效益。</p><p>　　模式优势：</p><p>　　项目业务规划清晰，可行性强，充分发挥项目的人脉资源以及渠道优势，进行业务的拓展，目前公司已经有成熟的技术，后期还将根据市场需求不断丰富业务板块，让客户有更多的选择；同时全面整合行业资源，以终端渠道端口对接带动项目运转，预计随着项目知名度的提升和人气增长，收入在保持持续稳定增长的前提下将有望大幅增长，收入来源也更将多元化，抗风险能力强，具有可持续发展性，资本增值潜力大。</p><p>　　本项目的复制能力强，融资成功之后能够迅速向市场铺开，以取得市场份额。本项目以团队多年的实践为基础，营销及盈利模式清晰，可行性强，市场前景广阔，处于上升发展期，具有良好的经济效益，且能够实现地区经济的快速发展，促进产业的升级，能够很好地推动研发技术的交流与共享，有效促进技术的升级及地方的建设，具有良好的社会效益。</p><p><br/></p>','','','合肥,太阳能,无人,烘干,中心,(,粮食,),项目','','','','中國太平洋保險（香港）有限公司',7500,'99.99',9800,0,10000000,1,0,'0.91',18,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(34,1,0,2,'湖南生态农业基地建设及技术推广项目','<p>项目概述</p><p>&nbsp; &nbsp; &nbsp; 项目名称：生态农业种养殖及技术推广项目</p><p>　　项目地址：常德西洞庭</p><p>　　项目阶段：发展期</p><p>　　项目介绍：项目创始人在经过多年观察研究农业产业发展行情，计划承包2000亩土地用于农业种养殖并推广先进农业技术，项目计划与湖南农业大学合作，引入先进的种养殖技术，并为广大农业专业的学生提供实践平台，为推动当地的农业生产技术献上自己的一份力。本项目集合了种养殖生产业务、时蔬瓜果采摘、观光游览、产品展销等功能，具有极强业务经营能力和观赏性，并且依托当地优质的土地资源结合当地政府的大力支持，发展当地特色农业种养殖一体化产业园，打造成为当地龙头示范基地。</p><p>　　项目规划：总面积2000亩，主要分为以下几大功能区域：畜牧区、水产养殖区、时蔬瓜果种植区、观光区、零售区等。</p><p>　　品种介绍：畜牧区主要饲养牛、猪，时蔬瓜果种植区主要种植当地蔬菜和时令水果。</p><p><br/></p><p>项目优势</p><p>&nbsp; &nbsp; &nbsp; 模式优势：本项目相较于普通的农业产业模式更新颖，也更具发展性。项目创始人在建设项目的同时引进先进的农业技术，为自身的发展提供可靠的技术支持并将技术进行推广，利国利民。</p><p>　　政策优势：发展现代化生态农业是推进农业供给侧结构性改革、加快结构调整的必然要求，也是加快富民增收的主要渠道。项目致力于实现优质稳产、快速高产、绿色环保，完全符合中央一号文件内提出的推动农林牧渔结合、种养加一体、一二三产业融合发展，走产出高效、产品安全、资源节约、环境友好的农业现代化道路需求。</p><p>　　区位优势：项目地处环洞庭湖经济圈，环洞庭湖地区作为全国重要的商品粮、油、麻、蚕桑、水产基地，如今，环洞庭湖区横跨鄂中南和湘北，城市密集，在这一地区环绕着湖北的荆州、石首，湖南的长沙、益阳、常德、澧县、津市、岳阳、汨罗、沅江等十余座城市。根据《洞庭湖生态经济区规划》在积极对接长株潭、武汉等大城市群的同时，湖区将培育岳阳、常德、益阳、荆州、津澧新城五大中心城市，以增强区域辐射带动作用。</p><p><br/></p>','','','湖南,生态农业,基地建设,及,技术推广,项目','','','','中國太平洋保險（香港）有限公司',12000,'99.99',13000,0,10000000,1,0,'1.02',13,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(35,1,0,11,'广西古建筑商业综合体建设项目','<p><span class=\"title-span\" style=\"bder-bottom: 2px solid rgb(233, 78, 56); display: inline-block; height: 56px; font-size: 16px; padding: 0px 30px; col: rgb(0, 50, 178);\">项目概述</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">项目名称：古建筑商业综合体建设项目<br/>　　项目地址：广西桂林<br/>　　项目介绍：项目依托桂林优质的旅游资源，着力打造当地特色商业综合体，项目融合特色古建筑街道、连体商铺及寺院等元素，计划打造成兼具文化展示、特色餐饮、商业于一体的商业综合体，致力推动当地的实体经济，为当地人民创造就业机会贡献一份力量。<br/>　　项目建设规划：<br/>　　1.项目规划用地450亩，进行购买和办理政府批复手续。<br/>　　2.建造古典街道，多条古典式步行街道（占地400亩），街道两边均建商铺，二三楼为住宅，合计三层建筑，合理规划街道宽度与交通网络。<br/>　　3.复建古寺一座（占地50亩）其中大殿占地10亩，寮房，食堂占地10亩，广场占地10亩，观音殿，药王殿占地10亩，钟楼，莲花池占地10亩。<br/>　　5.修葺两条流经园区的水系。<br/>　　总共分为四期建设：<br/>　　第一期为购地立项与两条街道的建设和古寺院的重建。预计融资5亿元。<br/>　　第二期为两条街道的建设。预计融资3亿元。<br/>　　第三期为两条街道的建设。预计融资2亿元。<br/>　　第四期未定。</p><p><span class=\"title-span\" style=\"bder-bottom: 2px solid rgb(233, 78, 56); display: inline-block; height: 56px; font-size: 16px; padding: 0px 30px; col: rgb(0, 50, 178);\">项目优势</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">&nbsp; &nbsp; 区位优势：项目所在地位于广西壮族自治区桂林市临桂区***镇，距桂林市区以及之后的临桂高铁站均为30公里，距世界著名旅游目的地阳朔县城30公里。南与南新村接壤，北与朗联村交界，东与钱村毗邻，西面0.5公里处为南边山镇政府所在地。距医院0.5公里，距三甲医院20公里，距小学中学均为一公里，距桂梧高速六塘镇出口5公里，距“阳光100”最新楼盘15公里。<br/>　　环境优势：当地空气清晰宜人，其中负氧离子含量达到每立方5000-8000个，下雨过后可达到1万-2万个每立方米。下雨的时候，雨水跟山体的石灰岩接触瞬间，会释放出大量的负氧离子。雨水经过灰岩过滤，层层切割的时候因产生摩擦，有很多矿物质的产生，其中富含大量的矿物质“硒”，它是一种抗癌、防癌、治癌的物质含量特别丰富，比其它的城市高出36倍，是宜居的风水宝地。<br/>　　经济效益：据市统计局公布，2018年，桂林市房地产开发投资325.80亿元，同比增长8.5%。商品房销售面积595.43万平方米，同比增长12.6%，其中住宅销售面积547.10万平方米，增长10.5%。商品房销售额368.55亿元，同比增长25.8%，其中住宅销售额319.08亿元，同比增长19.2%。2019年1-5月商品房销售面积218.7万平方米，实现商品房销售额139.52亿元。经测算，1-5月全市商品房销售平均价格为6379.5元/平方米，同比增长3.2%。各项数据显示，全市房地产市场稳步增长。</p><p><br/></p>','','','广西,古建筑,商业,综合体,建设项目','','','','中國太平洋保險（香港）有限公司',15000,'99.99',18000,0,10000000,1,0,'1.15',7,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(36,1,0,5,'【黑龙江煤矿开采贸易项目】','<p>项目概述</p><p>项目名称：黑龙江煤矿开采贸易项目；　　</p><p>项目进展：项目总投资3.7亿元人民币、目前已投入1.5亿元人民币。</p><p>　　证件情况：证件及手续齐全。</p><p>　　矿区介绍：</p><p>　　为了有效解决五家矿平庄煤田回采率问题，切实改普生态环境，维护社会大局和谐稳定，</p><p>　　黑龙江煤炭工业局以“黑煤局字〔2015〕181号”文对《黑龙江煤矿采空区灾害综合治理总体规划》（以下简称“总体规划”）进行了批复，批复文件同意总体规划中采用露天剥挖方式对采空区进行综合治理，同意总体规划确定的灾害治理工程生态恢复规划。开展本项目，有效的解决该问题并提升煤田开采效率。</p><p>　　开采方案：</p><p>　　五家矿采空区治理项目中采空区灾害治理工程技术方案主要采用露天剥挖法，治理工艺为单斗-卡车工艺，其工艺流程为：采空区剥离—排渣—残煤的回收及运输—开挖坑底部边界煤层露头黄土封堵、覆盖—开挖坑回填、压实、整平—黄土覆盖（以备绿化复垦）—绿化。</p><p>项目优势<br/></p><p>市场优势</p><p>　　“一带一路”战略实施为沿线国家经济发展增添了新的动力。目前已有50多个国家参与探讨合作机会，国内约31个省区市宣布加入“一带一路”规划建设中来，合作重点以政策沟通、设施联通、贸易畅通、资金融通、民心相通为主要内容，铁路、公路、航空、港口等基础设施建设将成为这一战略的突破点，基础设施建设和设备制造一定程度上会拉动钢铁、有色、建材等耗能产品的市场需求，继而拉动对国内煤炭的需求。</p><p>　　行业优势</p><p>　　广泛且实力显赫的行业上下游合作资源能够给项目带来异常丰富的发展机会。</p><p>　　市场竞争：煤主要用于燃煤发电、钢铁、化工、建材四个行业。其中电力行业用煤占52%，钢铁行业用煤占17%，化工用煤占7%，民用及其它用煤占11%，钢铁行业用煤主要为炼焦煤和喷吹煤，其它行业主要利用动力煤。作为不可替代的国家战略资源及煤炭资源的稀缺性，市场逐渐进入了一个买方市场。</p><p>　</p><p><br/></p>','','','【,黑龙江,煤矿,开采,贸易,项目,】','','','','中國太平洋保險（香港）有限公司',22000,'99.99',55000,0,10000000,1,0,'1.31',50,1000000,'0.00','0.00',1,0,0,1,255,1583040472,1583040472,0),(37,1,0,5,'【北京发动机维修与再制造智能化扩规发展项目】','<p>项目概述</p><p>&nbsp; &nbsp; &nbsp; &nbsp;项目名称：北京发动机维修与再制造智能化扩规发展项目</p><p>　　项目所在地：北京</p><p>　　建设周期：12个月</p><p>　　发展状况：项目公司成立多年、团队凝聚力强，产品需求旺盛，销售渠道广阔。</p><p>　　由于技术制约，目前我国发动机等主要零件在维修过程中只能更换新件，旧件以废旧金属的形式处理，造成极大的资源浪费，以及成本损失。本项目积极响应《中国制造2025》、《高端智能再制造行动计划》等政府号召，引进国内外智能制造前沿技术，打破国外相关核心技术的行业垄断，推进动力设备关键零部件再制造技术的研发，达成节能减排与资源循环利用的环境效益和社会效益。</p><p>　　凭借集团公司强大的产业链整合能力以及成熟的工艺体系，本项目计划与多家重点实验室展开合作，在北京建立再制造研发中心，并在内蒙古锡盟启动维修硬件升级改造计划，新成立2个现代化工厂，以达成产研一体化能力。</p><p>　　动力设备零部件激光再制造项目，将突破技术壁垒，解决动力设备及配件依赖进口的困境，降低企业维修运营成本以及零部件库存，完成产业链的转型升级。</p><p>　　技术诠释：再制造是一种对废旧产品实施高技术修复和改造的产业，它针对的是损坏或将报废的零部件，在性能失效分析、寿命评估等分析的基础上，进行再制造工程设计，采用一系列相关的先进制造技术，使再制造产品质量达到或超过新品。</p><p>　　再制造产业在国内属于新兴产业，是循环利用、节能减排的生产制造业，可以推动绿色发展理念，有利于节约资源、减少原材料消耗、减少污染物。再制造能够发挥节能减排之效，与制造新品相比，再制造可节能60%，节材70%，节约成本50%，几乎不产生固体废物，大气污染物排放量降低80%以上。</p><p><br/></p><p>项目优势</p><p>院士团队</p><p>　　公司即将组建一支由1名院士、2名国家级研究员以及若干博士研发人员组成的技术团队。此外，公司与装备再制造技术国防科技重点实验室、增材制造国家重点实验、高能束流重点实验室、航空科技重点实验室等机构取得了战略合作关系，将获得强大的技术支持。</p><p>　　强大的技术团队能够为企业创新、产品发展提供有力的内部支持。且公司核心管理层在该领域已从业多年，拥有丰富的行业资源与人脉关系。公司团队成员稳定，相互之间配合默契，凝聚力强。凭借这支团队，我们必定能够不断适应市场变化，保证项目的平稳运作，迅速发展。</p><p>　　技术领先</p><p>　　大型进口动力设备的零部件制造和维修是“卡脖子”技术，国内用户生产成本随其销售成本涨价而攀升。企业不得不投入大量资金用以备品备件，而废旧零部件则造成严重资源浪费。通过项目工艺生产的再制造零部件的价格仅是进口零部件原值的50%-60%，大量废旧零部件不再以废旧金属廉价处理，可以作为再制造零部件的材料来源。一旦国产化替代得以实现，则将大幅度得降低机械维修成本，突破国外企业的行业垄断。</p><p>　　公司注重知识产权保护，并希望通过不懈的努力构建技术壁垒，目前已有2项专利技术正在进行审核、并有多项专利正在整理申报当中。</p><p>　　实力雄厚</p><p>　　集团旗下子公司**机械设备有限公司是行业内知名动力设备销售与维修服务企业，是**斯授权的中国区旗舰店和标杆店，曾受到过神华、大唐、包钢、冀东水泥、中电投等大型国有企业的嘉奖。公司业务是提供动力设备的销售及维修服务，经过几十年的发展，聚焦矿山发动机的整机销售、配件销售、维修保养、整机大修、客户培训业务，区域覆盖内蒙古各矿区、河北唐山等各矿区、山东矿区、山西矿区，建立了稳定良好的客户关系。由于业务板块相同，经过再制造技术加工的零部件可以直接对接客户资源。</p><p>　　市场庞大</p><p>　　目前国内大型进口柴油机的保有量巨大，仅露天矿山、石油行业大概在500亿左右，所以进口动力设备关键零部件再制造和国产化替代项目市场前景广阔，社会效益和循环利用经济效益显著。现北京**京源机械设备有限公司协助最终用户维护的大型矿用设备1000余台。其中矿用卡车和工程机械的设备数量分别各占50%左右，仅内燃发动机每年的零件消耗量2亿元以上人民币。所以，零部件的再制造市场异常庞大，技术有很大的发挥空间。</p><p>　　绿色环保</p><p>　　本项目具有节约能源、降低环境污染的特点，这也正好符合我国当前建设“资源节约型、环境友好型”社会的时代主题。政府非常重视经济的可持续发展，对能源、环保等影响长期发展的因素非常关心，提出了降低单位GDP能耗、改善环境的政策目标。从长远来看，再制造产业关系到环境保护、节能减排的成败与否。</p><p>　　其次，除了节约能源和环境保护以外，再制造产业的另一个特点就是节约资源。通过再制造，既可以做到资源的回收利用，又可以减少能源消耗和环境污染。资源的节约，可以有效的降低我们对重要国际资源的消耗，并降低国际资源价格波动对我国经济造成的不利影响。项目的推出，必将受到政府的大力支持。</p><p><br/></p>','','','【,北京,发动机,维修,与,再,制造,智能化,扩,规,发展,项目,】','','','','中國太平洋保險（香港）有限公司',12000,'99.99',32000,0,10000000,1,0,'1.11',30,1000000,'0.00','0.00',1,0,0,1,255,1583040473,1583040473,0),(38,1,0,2,'【湖南AI立体高科技农业示范基地建设项目】','<p>项目概述</p><p>&nbsp; &nbsp; &nbsp; 项目名称：AI立体高科技农业示范基地建设项目</p><p>　　项目地址：湖南常德桃源县</p><p>　　项目进展：项目已投入3000万元，政府批文已到位，手续证件齐全。本项目占地面积2000亩，土地流转合同已签，25年租期，工程施工周期为22个月，预计2年内达成设计目标。</p><p>　　项目介绍：本项目引进国外AI立体高科技技术，主要用于农业种养殖。项目主体分为上下两大部分，地下开挖10米深度大水池利用日本淡水合成海水技术进行高端海产品养殖，地面建造18米高钢架构玻璃大棚，引进荷兰花卉种植技术和以色列、沙特AI农业科技技术进行农作物和植物的培育。本项目利用高科技带动农业向高端市场发展也带动了当地人民的就业增收，市场机遇前景良好。</p><p>　　主要建设内容包括：</p><p>　　1、光伏有机生态立体棚种区1600亩（106.56万平方米），引进新技术，新品种种植高产、高效的无土挺水植物与蔬菜；</p><p>　　2、对应棚种区复式平面沉降水养1150亩（765.9万立方米），引进世界领先的模块化路基养殖系统进行商品鱼、虾、蟹、海洋植物类养殖；</p><p>　　3、节能环保水处理中心30亩；</p><p>　　4、海洋生物科技馆100亩；</p><p>　　5、现代农业技术孵化中心20亩；</p><p>　　6、农产品深加工50亩；</p><p>　　7、农家康养、科普、度假、休闲、文旅100亩；</p><p>　　8、道路、设施、库房、办公、配套设施100亩。</p><p><br/></p><p>项目优势</p><p>技术优势：本项目海产品和农产品全部利用国外高端科技技术培育养殖，目前已与湖南省农业厅专业技术团队达成合作协议，待项目落地后全权由其团队负责经营管理，所有生产的产品绿色环保、有机健康，可供国内高端消费市场。</p><p>　　区位优势：桃源县，隶属于湖南省常德市，位于湖南省西北部，西与沅陵县、张家界市的慈利县、永定区交界，东与常德市的临澧县、鼎城区接壤，北枕石门县，南抵益阳市的安化县。县域为中亚热带向北亚热带过渡地段，属中亚热带季风气候，冷热四季分明。素有“滇黔孔道”之称。国道319线，省道1848、1801线纵横全境。过境桃源的常张（常德至张家界）高速公路、常桃（常德至桃源）高等级公路已经建成通车；石长铁路桃源站已经全面启用。沅水黄金水道过境99公里，逆水至贵州，顺水入洞庭至长江各码头。桃花源机场距县城15公里，可起降波音737客机。</p><p>　　政策支持：2018年1月，国务院办公厅印发了《关于推进农业高新技术产业示范区建设发展的指导意见》，提出到2025年中国将打造一批具有国际影响力的现代化农业创新高地、人才高地和产业高地。今年的一号文件也强调，要“强化农业科技创新推广”，并指出“着力在生物种业、现代农机、智慧农业、绿色投入品等领域，加快关键核心技术攻关与装备创制应用。”中央财政通过现有资金和政策渠道，支持公共服务平台建设、农业高新技术企业孵化、成果转移转化等，推动农业高新技术产业发展。</p><p><br/></p>','','','【,湖南,AI,立体,高科技,农业,示范基地,建设项目,】','','','','中國太平洋保險（香港）有限公司',7500,'99.99',23000,0,10000000,1,0,'1.03',24,1000000,'0.00','0.00',1,0,0,1,255,1583040473,1583040473,0),(39,1,0,0,'【江苏减震器批量生产项目】','<p>项目概述</p><p>项目介绍：</p><p>　　为了提升产品档次，增强竞争力，通过几年的持续研发，现成功开发气压减震，又在气压减震的基础上成功开发油气混合减震。现已申请了10多项专利（包括发明和新型实用），气压减震和油气混合减震已经在电动两轮车，电动三轮车，摩托车上形成了强大的专利壁垒。使用范围包括：自行车、电动两轮车、电动三轮车、摩托车、电动汽车以及需要减震的设备或产品。油气混合减震是现有除高档汽车减震以外减震性能最好的，目前市面上没有任何类似的可竞争产品，现计划进行大批量生产。</p><p>　　运营模式：</p><p>　　（1）国内部分：在前期的推广阶段，所有的零部件外购，供应商选用就近的（方便协调），具有一定产能和以质量为导向的厂家，所有非标配件的模具，夹具全部自己出资，并相应的签署保密协议。厂家销售以一线和二线品牌中的中高档车型为主，售后市场则以区域代理的形式进行销售。</p><p>　　（2）国外部分（前期首选印度）：采用合资的形式进行生产和销售，前期所有零部件全部从中国出口（已有国内贸易公司营业执照），印度进口（已有印度贸易公司执照），在印度简单组装（可享受印度政府税收补贴），最后销到整车厂和售后市场，当销售达到一定程度后，部分配件在印度当地制造，（可减少15%的关税和5%的相关费用）。整个东南亚市场如果申领相关的国家的贸易公司，一站式销售，盈利能力会大幅上升。</p><p>　　项目规划：</p><p>　　充分利用在相关国家设立的贸易公司，并仓储式现货且直达终端市场销售的模式，适用于各行各业产品的销售。通过我们的国外贸易公司运至相关国家的仓库，并在批发市场（线下）和网站上进行销售，并通过我们售后把资金随时随地的打给客户。目前公司已经在印度实施该操作模式。</p><p>　　利润来源：首先公司会对企业以具体利润的百分比进行收费，这时的收费百分比是固定的，经过几批货的销售，公司会降低产品好的企业的收费，逐步提高产品有问题的企业的收费，通过调整收费百分比来确保中国制造都是好产品。</p><p><br/></p><p>项目优势</p><p>1、目前市场上油气混合减震的舒适性没有竞争对手，产品先进。</p><p>　　2、产品目前正在申请国际专利，可受到相关法律的保护。</p><p>　　3、油气混合减震可演化成自行车鞍座，转椅支撑（使用寿命比现有的气弹簧支撑提升数倍），替代部分阻尼器，以及任何需要减震的设备或产品上，产品具有多功能性。</p><p>　　4、技术顾问很多：有四川大学高分子专业的博士生导师，气弹簧行业标准起草人之一，橡胶件专家，相关非标设备的电气工程师，机械工程师。</p><p>　　5、很多东南亚国家都在“一带一路”上，国家鼓励企业走出去，参展费用和相关费用国家都有补贴；</p><p>　　6、公司已经是“科技型中小企业”，可享受相关设备和研发费用补贴。</p><p><br/></p><p><br/></p>','','','【,江苏,减震器,批量生产,项目,】','','','','中國太平洋保險（香港）有限公司',4500,'99.99',15000,0,10000000,1,0,'0.92',18,1000000,'0.00','0.00',1,0,0,1,255,1583040473,1583040473,0),(40,1,0,4,'【山西青砖产业园项目】','<p>项目概述</p><p>项目背景</p><p>　　随着国家对环保工作的重视，大批小规模、重污染的制砖厂被相继取缔，能够保留下来的制砖企业已为数不多，为了传承这一技艺，必须做到加大投入，既合法合规，又能满足社会需求，这就需要把企业做大做强，做深做细。传统向现代过渡、粗放向精细过渡、单一向多元化过渡。</p><p>　　社会的进步与快速发展人们对文化、对生活品质的需求，必然成为未来推动社会发展一大动因，表现为新农村改造特色小镇建设，特别是对旅游业的快速兴起发展，而这一需求的达成，青砖产业这一特殊而传统产业，是其基础和必需，因而随着社会的发展青砖产业也将迎来发展的春天。</p><p>　　项目介绍</p><p>　　项目名称：左云青砖产业园。</p><p>　　投资总额：11000万元</p><p>　　产品方案：本项目主要产品仿古建筑用青砖、青瓦、花件、砖雕的等系列产品，项目完成后，以标砖计达到年产1亿块青砖的规模。</p><p>　　继承千百年来祖先流传下来的传统工艺，结合现代技术，生产各种规格的墙砖、地砖、城砖，以及筒瓦、滴水、猫头、五脊六兽，砖雕等，最大限度的满足古建恢复、旅游景区建设、美丽乡村建设等各种需求。项目共分三块：</p><p>　　(一)、生产板块：主要有制坯、烧窑、后期加工。</p><p>　　（二）、旅游体验板块：青砖已成为一种稀缺资源，中华几千年的历史传统，延续了人们对青砖建筑中美感的认知，高楼林立，方盒中生活的人们渴望与自然的和谐融合，增添了对四合院的向往。因而对青砖瓦十二道生产工序的了解、体验已成为必然。</p><p>　　（三）、弘扬中华古建文化基地：收集整理历代砖瓦生产工具，各年代砖瓦实物，建立陈列室，联络古建专家学习交流，召开研讨会，组织从研究、生产到建筑施工等多方人才，共同推动中国古建技艺的发展。</p><p>　　本项目实施分三期实行</p><p>　　一期从2016年3月—2019年底，共计投资4000万，达到年生产3000万块砖的规模，可在2020年实现产值1亿元，利润3000-5000万元。</p><p>　　二期从2020年10月—2021年4月，投资2800万，达到年生产7000万块规模，可在2021年实现产值2亿，利润5000-7000万元。</p><p>　　三期从2021年10月—2022年4月，投资3500万，达到年生产1亿块规模，可在2022年实现产值3亿，利润1亿元以上。</p><p>　　项目预期收入：按目前已达到的规模生产，2020年预计年收入1亿元，净利润3000万-5000万之间，2021年收入2亿元，净利润5000万-7000万之间，2022年收入3亿元，净利润1亿元以上。</p><p>项目优势</p><p>1、竞争优势</p><p>　　本公司已经县市环保局批准，有环评报告，有环评验收报告，取得了《排污许可证》，环保手续齐全。</p><p>　　本公司经营的制砖厂，前身可追溯到清朝末年，“左云青砖烧制技艺”在2018年1月被大同市政府批准为“市级非物质文化遗产”，正申报省级和国家级非物质文化遗产。</p><p>　　在制砖行业经过大的洗牌后能够保留并生存发展壮大起来的企业，未来有无限的成长和发展空间。</p><p>　　2、生产条件优势</p><p>　　制砖的主要原料就是当地的粘土，地处塞北黄土丘岭地带，黄土资源丰富，品质优良，取之不尽用之不完。</p><p>　　原料为煤炭，左云本身为煤矿产区，较其他同行具有明显的价位和成本优势。</p><p>　　产业工人，制砖行业有个特点，工人都必须为熟练优秀的技术工人，而这几年适应环保要求，大量砖厂关停，为我们招聘优秀员工创造了条件。</p><p>　　3、规模优势</p><p>　　目前公司已建成16座4000立方容量的窑炉，已是北方规模最大，到2020年窑炉容量将达到12000立方，可以同时生产多个品种，多个规格的产品，更好的满足市场的需求。</p><p>　　4、市场优势</p><p>　　（1）稀缺性。由于国家环保力度的加大，原来的传统生产地山东、河北等省份的青砖厂关闭待尽，山西以繁峙代县一带的青砖窑多为手工作坊，规模小，数量多，也于2019年全部关闭，能够保留生存且手续齐全的青砖企业已成为稀缺资源。</p><p>　　（2）唯一性。中国大力推进新农村建设，特色小镇建设，特别是旅游业的蓬勃发展，含有中国文化元素的古代雨后春笋般的兴起，而在这些建筑中青砖青瓦是其主要的建筑材料，没有任何产品可以替代，因而本产品具有唯一性、不可替代性。</p><p>　　目前，产品供不应求，价格上涨，利润空间巨大。</p><p><br/></p>','','','【,山,西青,砖,产业园,项目,】','','','','中國太平洋保險（香港）有限公司',2800,'99.99',7200,0,10000000,1,0,'0.81',11,1000000,'0.00','0.00',1,0,0,1,255,1583040473,1583040473,0),(41,1,0,963,'【上海智能制造知识分享平台项目】','<p>项目概述</p><p>项目背景：“中国制造2025”是中国政府实施制造强国战略的第一个十年的行动纲领，其根本目标在于改变中国制造业“大而不强”的局面，通过10年的努力，使中国迈入制造强国行列，为到2045年将中国建成具有全球引领和影响力的制造强国奠定坚实基础。</p><p>　　项目名称：智能制造软件&amp;知识分享平台</p><p>　　项目所在地：上海</p><p>　　目标群体：专注六大行业为客户打造核心竞争力。</p><p>　　项目发展现状：公司已经成立20年，2015年公司营业额1080万元；2016年公司营业额2800元；2017年公司营业额5710万元；2018年公司营业额7100万元。</p><p>　　2018年公司获得高新技术企业认证、完成双软企业审查、2018中国新兴产业年度诚信价值品牌、中国智能制造技术应用示范基地、和Stibo达成战略合作联盟。</p><p>　　项目介绍：公司一贯秉承以“互联网+企业信息化整体解决方案”及“智能制造解决方案”为核心发展领域，以优化客户的整体价值链为方向，以独特的落地方法论为基础，精心打造敏捷组织，致力于为客户持续提供整体解决方案以实现各类全生命周期管理的咨询服务。</p><p>　　产品介绍：代理产品：已经代理SAP/Stibo正在申请微软、思科；自有产品：智能制造MES、WMS、条码系统、销售管理、人力资源、OA等20个软件著作权；</p><p>　　在建平台：专业顾问技术人员行业知识分享平台（*乎+猪*戒）；提供服务：基于前面三块业务提供软件及自有产品咨询、销售、实施、培训、维护等相关业务</p><p>　　项目规划：2019：加大主流市场品牌推广，建立在IT几个行业的竞争优势，实现营业收入1亿元，完善MES产品及知识平台建设；</p><p>　　2020：拓展MES分销渠道，营业收入预计1.5亿元，转换收入结构，40%以上收入来自自有产品，完善知识平台加大推广。</p><p>　　2021：转型软件公司，转型平台服务商，营业收入达2.5亿元以上。</p><p><br/></p><p>项目优势</p><p>1、在国内有6个办事机构，分别为：北京、上海、广州、大连、浙江、长春。是全球最大的企业管理软件供应商SAP公司在中国内地的重要的资深咨询合作伙伴和市场推广合作伙伴，是目前国内规模较大的企业管理咨询机构之一。</p><p>　　2、近几年来，公司连续打造了不同领域的自主知识产权，多次获得了合作伙伴及业界的持续认可。公司咨询目前拥有近100名咨询顾问及专家，覆盖众多行业领域，为客户提供完整的End-To-EndSolution，包括：项目需求调研、项目规划、项目实施、项目运营维护（安装、升级、远程故障支持支持、现场故障解决、补丁服务等）、项目外包（SO/Hosting）、专业培训、以及项目实施第三方监理和品质管理。为客户提供专业的、优质的客户化服务，并利用长期积累的丰富经验为客户开发新的应用，帮助客户提高运作效率，使客户通过技术获得投资回报。</p><p>　　3、深厚的行业和专业知识积累、资深的专业服务团队公司，有丰富的IT行业资源，团队经验丰富能力优秀。</p><p><br/></p>','','','【,上海,智能,制造,知识,分享,平台,项目,】','','项目概述项目背景：“中国制造2025”是中国政府实施制造强国战略的第一个十年的行动纲领，其根本目标在于改变中国制造业“大而不强”的局面，通过10年的努力，使中国迈入制造','','中國太平洋保險（香港）有限公司',9800,'98.37',30000,0,10000000,0,0,'5.69',180,1000000,'2.00','1.00',1,0,0,1,11,1583040473,1583040473,0),(45,1,0,4,'【福建区块链云算力平台项目】','<p>项目概述</p><p>项目名称：区块链云算力平台项目；</p><p>　　项目地点：福建泉州（运营中心）、云南/贵州/四川（矿场）。</p><p>　　项目介绍：本项目是专业的矿机分时共享平台，平台提供矿机的销售和租赁，并负责托管和云平台管理业务。共享专业运算设备和技术，使用户资产配置更经济更灵活。凯撒矿业自2016年开始涉足挖矿行业，目前我们运营中的专业矿场分布在云南、四川、内蒙古等地，接下来将对接收购正规电厂，继续开发矿场可用资源。</p><p>　　项目发展阶段：三年矿场运营经验，掌握3个亿以上现货算力（矿机）渠道；现有算力可随时切换；初步搭建算力销售平台。目前已和*大陆、*马、*动、*达、*硕等矿机销售厂家均为战略合作伙伴。</p><p>　　项目盈利介绍：区块链挖矿行业一直是区块链行业中的传统并且稳健的投资行业，30%-80%的资金回报比属于常态。挖矿环境的稳定性和单位算力的功耗决定了投资回报比率。本次投资的公司前身为专业且资深的区块链传统矿工，通过收取50%的数字货币挖矿回报作为运营成本帮助矿机主管理矿机，并为矿机主创造365天不停机的挖矿环境与矿机主互惠共赢。</p><p>　　公司业务流程：</p><p>　　1、面对散户：注册—实名—签订电子协议—购买算力—收益区块链—算力转让—结束服务；</p><p>　　2、面对合作型资方：购买矿机—委托管理—到期回购—结束服务。</p><p>　　挖矿方式：私人挖矿、矿机托管、云算力挖矿。</p><p>项目优势<br/></p><p>1、可预估收益有坚实的数学模型和现实数据支撑，投资年化24%-30%以上；</p><p>　　2、提供套保（套期保值）业务，大幅减小投资回报预期波动；</p><p>　　3、稳定的挖矿环境保障——365天不停机保障；</p><p>　　4、支持保本、对赌协议签订；</p><p>　　5、矿机回购方式灵活。</p><p>　　政策推动：《产业结构调整指导目录（2019年本）》已经2019年8月27日第2次委务会议审议通过，现予公布，自2020年1月1日起施行。经查阅，挖矿产业从淘汰产业中剔除。</p><p>　　“互联网+”升级到“区块链+”这是国家政策导向，具有国家层面级高度，在施行的过程中，政府扮演着一个引导者与推进者的角色，助推有发展潜力的创新成为其它企业发展的风向标。</p><p>　　未来发展趋势：中国互联网产业发展面临着新形势、新挑战、新机遇，期待产业各界应以人为本，以更加务实的精神，更加开放的姿态、更加宽阔的视野，共同促进我国互联网产业繁荣发展。</p><p><br/></p>','','','【,福建,区块,链,云,算,力,平台,项目,】','','','','中國太平洋保險（香港）有限公司',2000,'99.99',3500,0,10000000,1,0,'0.78',26,1000000,'0.00','0.00',1,0,0,1,255,1583040473,1583040473,0),(46,1,0,3,'【北京新型碳纤维滑道救人消防车项目】','<p>项目概述</p><p>全世界一半以上高层建筑在中国，现有高层建筑消防云梯车都是以喷水喷泡沫灭火为基本功能，是以保护财产损失为目标的，而不是以高层建筑火场人员逃生为主要目标的，致使目前高层建筑火灾缺乏生命救援逃生手段和装备。</p><p>　　本项目运用德国工业4.0和碳纤维新材料技术，按照移动滑道原理，研发出最高150米新型碳纤维高层建筑救人消防车，解决高层建筑火灾人员逃生这一世界性难题，为高层建筑火灾人员逃生和生命救援提供应急救援设备。根据设计方案，每30秒钟可以从150米的高层建筑往下救援一个人，1分钟可以帮助2个人逃离火灾现场。这种以救人为主并继续保留灭火功能的新型消防车，是对过去传统高层建筑消防车的颠覆性创新，重新格式化原来的传统消防车产品，必将成为全球未来消防救援行业的新标配。融资6000万元，主要用于与德国最高150米新型碳纤维滑道救人消防车样车的设计生产和欧盟认证。国内大规模量产，采用与大型专业央汽合作组装生产制造，不再单独建厂制造。</p><p>项目优势<br/></p><p>1、高度为世界最高，高度达到150米；</p><p>2、功能全球唯一，目前全世界还没有以高层建筑逃生为主要功能的产品。</p><p><br/></p>','','','【,北京,新型,碳纤维,滑道,救人,消防车,项目,】','','','','中國太平洋保險（香港）有限公司',3500,'99.99',7500,0,10000000,1,0,'0.88',21,1000000,'0.00','0.00',1,0,0,1,255,1583040473,1583040473,0),(47,1,0,2,'【湖南落潮井天然气30万方CNG母站项目】','<p>项目概述</p><p>项目名称：凤凰落潮井天然气30万方CNG母站项目</p><p>　　项目所在地：河南省湘西土家族苗族自治州凤凰县</p><p>　　建设用地：25亩。</p><p>　　项目介绍：本项目为30×104Nm3/dCNG母站工程，为一座压缩天然气母站。建成后不但为湘西地区的加气子站供气，而且可以辐射至湖南省及贵州省的其它地区，如怀化市、铜仁市等地区。其中主要目标市场是同仁市，黔相段37公里管道就是直供铜仁市两区八县空白市场，此前没有管道气进入。母站方圆二百公里范围内没有母站，而且是空白市场。</p><p>　　建设内容：在湖南省湘西土家族自治州凤凰县落潮井乡境内拟投资兴建一座设计产能为30×104Nm3/d的CNG加气母站；分两期建设，其中一期设计能力为15×104Nm3/d。</p><p>　　区域介绍：凤凰县是国家历史文化名城、首批中国旅游强县、国家AAAA级景区、湖南省湘西土家族苗族自治州所辖八县市之一。曾被新西兰著名作家路易艾黎称赞为中国最美丽的小城。所以凤凰县环境要求很高，政府十分重视经济发展对环境造成的影响，协调经济发展及环境保护工作成为了重中之重。铜仁市44万人口，经济较好，现年需求6亿方气，潜在需求12亿方气。</p><p>　　效益分析：</p><p>　　（1）本项目为《天然气利用政策》（国家发展和改革委员会发改能源【2007】2155号文件）规定的优先类天然气利用项目，符合国家能源调整政策。方便人民使用天然气资源，提高了人民生活品质，增强了公众身心健康，促进建立和谐社会。还可以增加当地税收，拉动“绿色”GDP增长。</p><p>　　（2）本项目属于直接利用资源项目，不涉及资源开发，取气非常便捷，而且气量、气源的稳定性和气质有保障，合理有效地利用了天然气资源。已有年供气两亿方气的批复。</p><p>　　（3）与汽（柴）油、液化气相比，压缩天然气具有价格和环保优势，具有较强的竞争力。本项目的建设迎合了市场，市场前景不可限量，为当地天然气行业的发展起到了推动作用。</p><p>　　（4）天然气压缩技术经过多年发展，已日趋成熟。可供选择的压缩机组较多。脱水装置能满足气体露点要求。储气设施形式较多，制造加工技术、检验技术完全能满足要求。因此，本项目所需的各种工艺技术已经成熟。</p><p>　　（5）本项目经济效益显著，在财务上是可行的。</p><p>　　（6）本项目不会对凤凰历史文化遗产、自然遗产、风景名胜和自然景观等造成不利影响，反而会进一步间接保护历史文化遗产、自然风景和景观等。项目实施后，有利于改善城市空气质量，大气能见度将得到提高，建筑物外表装饰面灰尘减少，金属、石料饰品酸性腐蚀延缓，使城市景观改善，属于环境友好型项目。</p><p>　　（7）本项目采用节能技术，合理利用能源，提高了设备及系统的效率，优化了系统运行，贯彻国家关于节能的方针，体现了国家“构建节约型社会”和“可持续发展”的理念。</p><p>　　综上所述可知：本项目的工艺技术已成熟可行，符合国家环保、能源政策，是国家重点支持的产业工程，项目建成后的经济效益显著，投资回收期较短，社会效益明显，本项目是完全可行的。</p><p><br/></p><p>项目优势</p><p>定位明确、规划清晰</p><p>　　项目创始人对本项目的发展契机、目标市场定位、营销策略、运营模式、盈利模式、发展战略、预期达到的目标以及相关的风险等已有深入的思考与清晰的规划。项目盈利模式清晰，可行性强，产业下游客户认可度高，同时引入完善的运营体系，加强了项目的中间作用，有效实现商业模式的创新发展，充分发挥项目的复合服务及服务升级优势。</p><p>　　市场优势</p><p>　　1、气源保证，这是天然气项目关键点！本项目气源不仅有保证，还可增量，已经谈好可保证2亿方气源。已有2亿供气批复。</p><p>　　2、价格优势，因距离较近湖南省管网给的底价较低。即使将来中缅、中卫管线铺到铜仁市，其管道气价格因距离因素每方气差价0.3元。</p><p>　　3、大湘西天然气管道（包括铜仁支线）全线只有落潮乡30万方CNG母站一家母站，在其200公里范围内再没有CNG母站。已经和铜仁市天然气能源投资有限公司达成协议。铜仁市不会再建CNG母站。再者，铜仁、湘西两市至今无管道天然气。这是在全国也是绝无仅有的空白市场！</p><p>　　气源保证、价格始终低于未来竞争对手0.3元/方、绝无仅有的空白市场，这是项目三大主因，是优质项目标志。</p><p>　　国家政策优势</p><p>　　（1）习总书记明确提出了我国能源安全发展的“四个革命、一个合作”战略思想；</p><p>　　（2）中国能源安全面临新的挑战，且对外依赖程度过高；</p><p>　　（3）现阶段和未来多年各油气生产单位都将保障油气供应安全作为重大政治任务摆在突出位置，持续推动国内油气增储上产见实效、见长效；</p><p>　　（4）19个油气勘探开发重点省（区、市）设立了大力提升油气勘探开发力度专项工作组；</p><p>　　（5）国家和地方政策鼓励大力发展高端装备制造业；</p><p>　　（6）十四五能源规划要点：加快传统能源技术进步，提高煤炭、石油、天然气等传统化石能源的清洁化利用水平；瞄准清洁低碳战略方向；鼓励关键技术创新。</p><p><br/></p>','','','【,湖南,落潮,井,天然气,30万,方,CNG,母,站,项目,】','','','','中國太平洋保險（香港）有限公司',5000,'99.99',11000,0,10000000,1,0,'0.98',15,1000000,'0.00','0.00',1,0,0,1,255,1583040473,1583040473,0),(48,1,0,3,'【陕西中空纤维膜式氧合器生产运营项目】','<p>项目概述</p><p>项目名称：国产中空纤维膜式氧合器项目；</p><p>　　项目所在地：西安；</p><p>　　项目简介：经过长时间的市场调查研究和行业经验积累，项目方十分看好医疗器械行业市场，尤其是氧合器行业市场。为扩大营收，公司计划投入大量资金用于新建厂房和扩大研发团队，取得各项证书后，项目方将着手于生产制造氧合器及相应配件，在国内外进行大批量销售；</p><p>　　项目产品：普通氧合器、ECMO套包；</p><p>　　目标客户：</p><p>　　1、呼吸ECMO：南京**医院、北京**医院、北京**医院；</p><p>　　2、循环ECMO：北京**医院、北京**医院、**大学第一附属医院、上海**医院、上海市**医学中心。</p><p>　　项目现状：</p><p>　　1、项目方拥有十余年医疗器械行业经验，公司持有《人工心肺机体外循环管道》和《一次性使用心脏停跳液灌注器》两张NMPA三类医疗器械注册证书；</p><p>　　2、公司持有III类6845-4血液净化设备和血液净化器具生产许可证；</p><p>　　3、公司在西安拥有产品生产厂房；</p><p>　　4、公司自2018年开始生产销售心肌停跳液灌注器，体外循环管路等产品。2018年销售额40万人民币，2019年预计销售金额接近200万元；</p><p>　　5、现已投入资金1600余万元，用于厂房租赁、生产许可证申请、产品研发、产品注册证申请及公司日常运营；</p><p>　　6、项目方正在研发离心泵泵头、生物相容性涂层两个产品。</p><p>　　项目规划：项目方计划在苏州成立西安通标全资子公司。作为新型生物医药产业聚集地，苏州市物流方便，上下游配套设施完善，且拥有政策支持。公司计划在5年内取得所需许可证，融资后第三年实现产品出口，五年后产品可在国内进行销售。</p><p>　　项目盈利：氧合器销售（国内、外）、ECMO套包销售（国内、外）。</p><p><br/></p><p>项目优势</p><p>→项目运营风险小</p><p>　　1、资源可靠、客户稳定：项目方自身有可靠的合作方资源，拥有国内外销售渠道，并且十分了解国内销售模式正在发生的变化，众多的合作方资源让项目方对于此项目的落地更有信心。另一方面，项目方熟知专业领域所有VIP客户，不必担忧客户量问题。公司可尽快实现营收正增长，保证公司收益。</p><p>　　2、资金风险低：项目落地和实施均由项目方自己负责，成本可控。融资后项目方会拥有大量流动资金，减少资金风险。</p><p>　　→团队效益</p><p>　　项目团队发起人有多年的业内管理研究经验，同时团队内部人员皆有相关领域从业经验，公司5位股东中，有4位已在本专业领域从事市场营销工作10年以上。另一方面，产品研发部成员负责此项目落地维护，技术知识过硬且经验丰富。</p><p>　　→定位明确、规划清晰</p><p>　　项目创始人对本项目的发展契机、目标市场定位、营销策略、运营模式、盈利模式、发展战略、预期达到的目标以及相关的风险等已有深入的思考与清晰的规划。</p><p>　　→技术及市场优势</p><p>　　项目方采用最新的生产设备和生产工艺，产品质量好，且在生产效率上超越国外厂商。ECMO氧合器和普通氧合器除了中空纤维膜材料不同，生产工艺几乎完全一样，便于项目方进行生产。另一方面，氧合器应用市场空间巨大，还有待进一步开发。</p><p><br/></p>','','','【,陕西,中空,纤维,膜,式,氧,合,器,生产,运营,项目,】','','','','中國太平洋保險（香港）有限公司',6000,'99.99',15000,0,10000000,1,0,'1.09',7,1000000,'0.00','0.00',1,0,0,1,255,1583040473,1583040473,0),(49,1,0,8,'辽宁沈阳智慧新零售项目','<p><span class=\"title-span\" style=\"bder-bottom: 2px solid rgb(233, 78, 56); display: inline-block; height: 56px; font-size: 16px; padding: 0px 30px; col: rgb(0, 50, 178);\">项目概述</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">项目背景<br/>　　随着网络购物的渗透率接近饱和，消费者的消费习惯也在随之变化。网络购物已经从一种时尚的购物方式转变为人们日常生活中常见的购物方式。本身的新奇性不再有吸引力，消费者现场体验的需求回归，而这种销售场景不断向消费者延伸靠近的服务能力，只有采用多渠道，创新化，科技化的新型零售可以实现。<br/>　　5G时代的到来，国家政策的支持，新零售迎来了第三个年头。人工智能、大数据以及物联网技术的运用，科技力量的发展已然成为了社会的强大助推力，智慧生活的内涵和应用越来越丰富，也必将改变着我们生活的点点滴滴。<br/>　　尽管统计口径不同，来自不同机构的数据均显示出，新零售将开启万亿级乃至十万亿级市场空间。市场研究咨询公司英敏特数据显示，2018年，新零售在中国消费者商品零售总额中的占比将达到22.4%，这一占比相较于2013年的8%，近乎翻了三倍，预计到2023年占比将增至33%。<br/>　　项目介绍<br/>　　项目名称：智慧新零售<br/>　　目标群体：零售购物的大众群体<br/>　　项目标语：高品质、最专业、最时尚、更优惠、更贴心<br/>　　行业痛点：<br/>　　1、传统线下零售成本高、覆盖范围有限、用户线上比价线下压价；<br/>　　2、传统的线上电商购物体验不及线下购物，始终没有找到能够提供真实场景和良好购物体验的现实路径。<br/>　　本项目运用“新零售”模式，以互联网为依托，通过运用大数据、物联网、人工智能等先进技术手段，对线上服务、线下体验以及现代物流进行深度融合，实现线上线下商品信息共享，启动消费购物体验的升级。<br/>　　盈利模式：<br/>　　1、打通新零售线上，打造流量，发挥线上时空优势，向线下引流。<br/>　　2、发挥线下优势，专业、人性、面对面沟通。<br/>　　3、线下无人店与体验店共存。<br/>　　4、引进新技术，从上游成本与下游成本整体降低（采购、人力、管理等）<br/></p><p><span class=\"title-span\" style=\"bder-bottom: 2px solid rgb(233, 78, 56); display: inline-block; height: 56px; font-size: 16px; padding: 0px 30px; col: rgb(0, 50, 178);\">项目优势</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">1、商业模式。本项目盈利模式清晰，可行性强，抓住了市场的需求，为消费者提供更专业，高品质，更快捷的服务。<br/>　　2、政策支持。国务院办公厅印发《关于推动实体零售创新转型的意见》（国办发〔2016〕78号）在促进线上线下融合的问题上强调：“建立适应融合发展的标准规范、竞争规则，引导实体零售企业逐步提高信息化水平，将线下物流、服务、体验等优势与线上商流、资金流、信息流融合，拓展智能化、网络化的全渠道布局。”<br/>　　3、市场规模。前瞻产业研究院发布的《2017-2022年中国零售行业市场前瞻与投资战略规划分析报告》预测，未来几年新零售交易规模年复合增长率将达115.27%，到2022年市场规模将突破1.8万亿元。辽宁省目前有大中专140多所，高校2-4万人/所，高职1万人/所，在东北区域开辟新零售市场是很好的机会。</p><p><br/></p>','','','辽宁,沈阳,智慧,新,零售,项目','','','','中國太平洋保險（香港）有限公司',800,'99.99',3000,0,10000000,1,0,'0.71',30,1000000,'0.00','0.00',1,0,0,1,255,1583040473,1583040473,0),(50,1,0,25,'河南太阳能空气净化器项目','<p><span class=\"title-span\" style=\"bder-bottom: 2px solid rgb(233, 78, 56); display: inline-block; height: 56px; font-size: 16px; padding: 0px 30px; col: rgb(0, 50, 178);\">项目概述</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">项目名称：一种太阳能空气净化器；<br/>　　广告标语：自然好空气，幸福好生活，前人做环保，后人更健康；<br/>　　产品简介：每天生活在碧水蓝天，绿草茵茵的环境中，健康幸福是我们共同的心愿。然而，污染却严重影响着我们的环境空气的质量，严重影响着我们和家人的身心健康，雾霾、粉尘、PM2.5会给我们自己和家人的生命健康会造成极大的危害，严重时会造成呼吸道疾和咳嗽，吐痰，哮喘甚至是肺癌，心脑血管疾病等，为此我公司针对这种现实情况发明了一种太阳能净化器，它是一款以太阳能为主要能源的空气净化设备，它可悬挂于室内亦可悬挂于室外，通过吸收空气污染物如：PM2.5、烟尘、风沙尘土、工业粉尘、建筑粉尘等颗粒物质以及蚊虫等，从而达到净化空气，减少可吸入颗粒，更好的维护人体健康的效果。<br/>　　本产品份太阳能板发电和插电两种方式，1度电可用24小时，噪音低，功效明显。节约1度电，相当于节省400克标准煤，节省4升净水，减少272克粉尘，减少30克二氧化硫的排放。</p><p><span class=\"title-span\" style=\"bder-bottom: 2px solid rgb(233, 78, 56); display: inline-block; height: 56px; font-size: 16px; padding: 0px 30px; col: rgb(0, 50, 178);\">项目优势</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">1、产品优势：产品放置场地广泛，可放于工地、政府路政、工厂、学校、医院、酒店、公园、煤场、采石场、搅拌站等等，室内外都可使用。放置灵活，可挂墙，可落地，可移动，不怕磨损。<br/>　　2、市场优势：空气净化市场前景广阔，随着人们健康意识增强和净化器企业宣传教育的结果，会有越来越多的人使用空气净化器，另外空气净化器的实实在在的使用效果是最好的说服力。<br/>　　2014年国内空气净化器市场品牌数达556个，较2013年的151个增长了268%。市场销量和销售额双双增长30%以上，2015年中国空气净化器销售量达到677万台，同比增长35.7%，销售额将达153.5亿元，同比增长32.6%。经过2009年到2105年行业的萌芽期，2017年-2019年处于高速发展期，市场上对净化器产品和新风系统产品从最初的存疑到普遍接受。可以证明消费者对于净化器类型的产品有了一定的接受。<br/>　　3、创新优势：具有依据市场及应用场景的不同，快速研发新产品的能力。其技术填补了国内空白，国际领先。</p><p><br/></p>','','','河南,太阳能,空气,净化器,项目','','','','中國太平洋保險（香港）有限公司',2000,'99.99',5500,0,10000000,1,0,'0.78',25,1000000,'0.00','0.00',1,0,0,1,255,1583040473,1583040473,0),(201,1,1,597,'【云南智能农业水产养殖及水生态治理项目】','<p>项目概述</p><p>&nbsp; &nbsp; &nbsp; 项目市场</p><p>　　水产品生产需求，已从产量高速增长解决温饱阶段发展优质和确保食品安全的新阶段，水产品的品质成为我国食品安全的重要组成部分。传统养殖环境的不断恶化，淡海水主要养殖鱼类品质不断下降，导致单位商品价值不断下降，高品质“野生品种”价格不断攀升，价格往往比“养殖品种”高数倍到数十倍。随着健康观念日益深入人心，水产品将以其低脂肪、低胆固醇、高蛋白、高营养等特性打开市场，市场前景巨大。</p><p>　　项目概述</p><p>　　项目名称：智慧水产养殖农业项目；</p><p>　　水产产品：水产品养殖品种；虾类：澳洲淡水龙虾、罗氏沼虾等；鱼类：鱇浪鱼、黄金草鱼、滇池高倍鲫鱼等；米类：生态米、虾蟹米等；水生植物：水葡萄、水白菜等。</p><p>　　一、项目经营核心战略：</p><p>　　1、水产品养殖及销售，技术推广；</p><p>　　2、智慧农业水产养殖系统应用；</p><p>　　3、水生态还原修复治理。</p><p>　　二、经营目标：成立品牌，经营性研发单位。</p><p>　　三、2020年项目商业模式思考：</p><p>　　1、多功能旗舰店扩散经营方式；</p><p>　　2、生鲜平台：自制销售平台，大众消费网络平台优选建立货源准备管理员；</p><p>　　定位明确清晰：项目创始人对本项目的发展契机、目标市场定位、营销策略、运营模式、盈利模式、发展战略、预期达到的目标以及相关的风险等已有深入的思考与清晰的规划。</p><p>　　项目优势</p><p>市场优势：水产品生产需求，已从产量高速增长解决温饱阶段发展优质和确保食品安全的新阶段，水产品的品质成为我国食品安全的重要组成部分。传统养殖环境的不断恶化，淡海水主要养殖鱼类品质不断下降，导致单位商品价值不断下降，高品质“野生品种”价格不断攀升，价格往往比“养殖品种”高数倍到数十倍。随着健康观念日益深入人心，水产品将以其低脂肪、低胆固醇、高蛋白、高营养等特性打开市场，市场前景巨大。</p><p>　　政策优势：政府大力支持水产养殖产业的发展。水产养殖业已成为我国农业的重要组成部分和当前农村经济的主要增长点之一。</p><p>　　团队优势：本项目拥有的专业管理运营团队，团队人员都具有丰富的行业经验、资源及专业知识，能够保证项目的顺利进行与持续运营。项目负责人人李女士有丰富的创业经验和企业管理经验，以及丰富的资本和市场资源，熟知行业运营管理模式。</p><p>　　管理优势：公司还具有较为先进的管理和经营理念，注重在经营管理中去积极发扬创新意识，善于运用创新的手段来找到更多切实可行的企业经营管理途径，从而提高企业的实际运营效率，促使企业可以产生更大的市场收益。</p><p><br/></p>','','','云南,智能,农业,水产养殖,及,水,生态,修复,治','','项目概述      项目市场水产品生产需求，已从产量高速增长解决温饱阶段发展优质和确保食品安全的新阶段，水产品的品质成为我国食品安全的重要组成部分。传统养殖环','','中國太平洋保險（香港）有限公司',6000,'96.13',6500,0,9999998,1,0,'1.08',7,1000002,'2.00','1.00',1,0,0,1,4,1583040494,1583040494,0),(202,1,1,471,'【山东智能设备经济开发区共享产业园项目】','<p>项目内容</p><p>激光共享产业园项目，以激光切割机、激光焊接机、激光打标机、激光清洗机、激光雕刻机等多种品类为主导设备，总投资10亿元，建设起止年限为2018年至2020年。规划建设8个智能化厂房，分别为两层和四层建筑，建筑面积138000方。配套11层综合楼一座，包括了办公区、展销区、餐厅、健身房、会议报告厅和影视放映厅等日常办公休闲的基础设施，建筑面积45500方，园区内还配有专业的会计事务所、法律顾问、电子商务和国际贸易团队。</p><p>投资环境<br/></p><p>园区周边配套齐全，2公里半径内有两所高校、幼儿园、小学、初中、高中，体育休闲运动场所齐全，区医院西院区正在建设，政府购置公寓20余套可用于专家临时周转用房。给予入园企业专家、职工在住房、孩子就学等各方面的支持。配套建设职工公寓一处，共144间，每个房间面积约36㎡，餐厅一处，一层为制作区和大餐厅，二层为餐厅和接待室。</p><p>项目背景<br/></p><p>通过本项目打造中国北方地区首席高端激光智能化解决方案供应商，促进区域产业优化升级。本产业园2020年将初步建成，领跑整个华北地区激光加工和激光应用产业的发展。</p><p>改变招商政策着力点，由点对点引进优秀企业，转变为产业链条招商，经济生态招商。成立共享设备加工中心，改变同类化企业共性生产设备中的重复投资，低效投资，低端投资的传统模式，帮助产业链内的企业共生共荣，提升链条竞争优势。</p><p>项目规模<br/></p><p>总投资10亿元，建设起止年限为2018年至2020年。规划建设8个智能化厂房，分别为两层和四层建筑，建筑面积138000方。配套11层综合楼一座，包括了办公区、展销区、餐厅、健身房、会议报告厅和影视放映厅等日常办公休闲的基础设施，建筑面积45500方，园区内还配有专业的会计事务所、法律顾问、电子商务和国际贸易团队。</p><p>优惠政策<br/></p><p>高端产业人才“引领工程”。对我市引进的国际国内一流或顶尖创业人才团队，实行“一事一议”，市财政给予最高2000万元的资助。对从市外到我市创业的顶尖、高端、高层次人才，市财政分别给予500万元、300万元、100万元的项目启动资金。对我市自主申报入选和全职引进的国家级“千人计划”“万人计划”、省级“泰山系列人才工程”及相当层次的人才，市财政分别给予100万元、50万元一次性支持。提档升级“淄博英才计划”，每年增设10个名额，专门用于选拔培育一批本土产业领军人才，并给予相应支持。</p><p>“对新引进的外来投资1亿元以上的重点产业招商项目，自开工之日起3年内，按照项目实际到位外来投资额（扣除土地政策支持部分）的6%给予补助”。</p><p><br/></p>','','','山东,智能,设备,经济,开发区,激光,共享,产业','','项目内容激光共享产业园项目，以激光切割机、激光焊接机、激光打标机、激光清洗机、激光雕刻机等多种品类为主导设备，总投资10亿元，建设起止年限为2018年至2020年。规划建设8','','中國太平洋保險（香港）有限公司',7000,'6.12',5000,5000,9999998,1,1,'1.05',5,1000002,'2.00','1.00',0,0,0,1,3,1583040494,1583040494,0),(203,1,1,600,'【江苏生态农业示范园运营项目】','<p>项目概述</p><p>&nbsp; &nbsp; &nbsp; 项目名称：江苏生态农业示范园运营项目。</p><p>　　项目所在地：江苏。</p><p>　　项目阶段：成长期。</p><p>　　项目介绍：**生态农业示范园是江苏博*生态农业发展有限公司建设的高效生态农业示范园，是一个以生态开发为宗旨，集种植、养殖、旅游休闲观光为一体的绿色生态园。</p><p>　　1、项目产品：农业种植；水产养殖；生态休闲游览等</p><p>　　2、项目规模：园区内土地整理、水利设施、电力设施、道路管网、路灯、监控、围栏、深井、塘坝等基础设施基本完成，现以建成高效农业种植园100亩，田园竹休憩园5亩，青木榆风景树观赏园20亩，朴树、榉树小道500米，冬青树围篱7500米，银杏大道350米，香樟树、大叶女贞树、银杏树小广场5亩，香樟树、大叶女贞树、桂花树、银杏树大广场10亩，桑葚采摘园30亩及石榴采摘园30亩，建成水产养殖锦鲤7亩、黑鱼20亩、昂刺鱼5亩、鳡鱼7亩、鸭嘴鱼10亩、青鱼5亩、草鱼5亩、花鲢鱼5亩、小龙虾350亩。</p><p>　　3、项目发展规划：预计总投资1.08亿元，基础打造期：2017年一2019年，品牌树立期：2019年一2021年，全面开发期：2021年一2022年。生态园一期基础建设现以基本完成，高效农业种植以及水产养殖已经开始经营生产。</p><p>　　生态园二期将全力打造“博*”商标品牌。将充分挖掘区域文化开发特色休闲项目产品，依托现代化科技农业，打造生态循环体系，开发区域景观，满足不同家庭及游客的需求，同时做好市场营销宣传工作，不断开拓客源市场，使得“博*”商标品牌得到市场的认可。</p><p>　　生态园三期在前期的基础上，根据党和政府的指导思想，完善涉及园区开发的所有证件，继续弘扬园区文化并不断的完善和更新，并开始兴建集餐饮、垂钓、健身、休闲、游乐、观光于一体的特色产业，创立属于园区自己的“博*”商标品牌，大力打造小龙虾养殖示范园，以生态水产养殖销售为支柱产业，最终发展成为集餐饮、垂钓、健身、休闲、游乐、观光于一体的特色产业，运用现代化市场营销手段，积极发展观光采摘业，建立绿色产品生产基地，建设农业生态休闲观光园，打造全面“农旅结合”+“生态颐养”的新格局。</p><p>　　项目优势</p><p>&nbsp; &nbsp; &nbsp; 1、政策优势：鼓励创新农业。</p><p>　　2、区位优势：**生态园坐落于仪*市马*镇合*村，环境优美，空气清新，南面紧邻G40高速马集出口，东面紧邻S333省道，5公里范围是仪征市区，30公里范围是扬州市区，60公里范围是镇江市及南京市区，200公里范围涵盖苏锡常州。</p><p>　　3、产品优势：生态养殖果蔬种植，绿色产品纯天然无污染，同时开展餐饮、垂钓、健身、休闲、游乐、观光于一体的特色产业。</p><p>　　4、渠道优势：本地农副水产批发市场、扬州市农副水产批发市场、镇江市农副水产批发市场、南京市农副水产批发市场、常州市农副水产批发市场、无锡市农副水产批发市场、泰州市农副水产批发市场、苏州市农副水产批发市场。</p><p>　　5、团队优势：与北京金*合现代农业有限公司签订了中农服务站战略规划单位服务合同，成为金*合战略规划单位，**生态园总规及**生态农业示范园建设项目可行性研究报告由北京金*合现代农业有限公司合作单位北京五*农城乡规划设计有限公司，经过实地考察及市场调研编写。有专业的团队规划指导及生态园专业的团队建设实施。</p><p><br/></p>','','/uploads/2020/04/202004122155286246.jpg','江苏,生态农业,示范园,运营,项目','','项目概述      项目名称：江苏生态农业示范园运营项目。项目所在地：江苏。项目阶段：成长期。项目介绍：**生态农业示范园是江苏博*生态农业发展有限公司建设的高效','','中國太平洋保險（香港）有限公司',5000,'12.35',3000,3000,9999994,1,1,'1.01',3,1000006,'2.00','1.00',0,0,0,1,2,1583040494,1583040494,0),(204,1,0,2813,'【北京脉冲强光消毒行业项目】（限投一次）','<p>项目概述</p><p>&nbsp; &nbsp; &nbsp; 由于年初新冠肺炎的暴发，给我国，亚洲乃至全球人民的正常生活，生产秩序造成极大的破坏，损失不可估量。</p><p>　　在封闭/半封闭的环境内，需要在传统消毒技术的基础上，提供更高效，更环保/无残留/无腐蚀的新技术，尤其是针对传统消毒方法不好处理的区域。</p><p>　　项目介绍</p><p>　　采用脉冲强光技术，这是一种安全（无汞）、强效、节能的新型冷杀菌技术。该技术采用在短时间（微妙级）释放大量光能量（可达千焦耳级别），峰值功率可达到1MW。脉冲强光技术对室内MRSA（耐甲氧西林金黄色葡萄球菌）、VRE（耐万古霉素肠球菌）、C.diff（艰难梭菌）、GNR（革兰阴性杆菌）等微生物有显著的灭菌效果，基于脉冲强光技术开发的杀菌设备是近年来多学科研究成果的高技术综合产品，在很多领域已成为优先于其他技术的替代选择。</p><p>　　并已获得了行业龙头企业蒙牛、伊利、农夫山泉、新希望、中亚股份、卡士牛奶、优诺乳业、四国包装等一大批企业的高度认可并大量使用。</p><p>　　现计划将脉冲强光消毒头与机器人技术/物联网技术相结合，为高档酒店/公寓/办公楼宇提供设备租赁服务。</p><p>　　可实现：</p><p>　　快速消毒：5分钟≥99.99%的灭杀率。</p><p>　　消毒范围：1min——可对半米范围内的局部进行快速强化杀菌。</p><p>　　5min——可处理1.5米半径内区域。</p><p>　　10min——可处理3米半径内区域。</p><p>　　广谱杀菌：对各类微生物都有效，对埃博拉病毒、新型冠状病毒都有很好杀灭效果。</p><p>　　安全、灵活、环保：不含汞、无化学药剂释放残留，太阳光杀菌对传统消毒处理手段不好处理的天花板，地毯，装饰墙面，高档窗帘等具有同样的消毒效果，且不会造成损害，有效降低业主单位的损失。</p><p>　　由于目前这些业主单位处于停业/半停业状态，随着疫情的逐步好转，社会正常秩序的恢复，全面恢复营业前及在相当长的一段时间内，确保安全是首位的，消毒是一个刚性的需求，这就给长期的租赁市场创造了非常好的机会，既可以满足消毒的需求，还可以减少业主单位的投入。</p><p>　　与机器人技术及物联网技术结合使用，降低业主单位的人力成本投入，消毒过程更规范且有保障，避免人为因素造成的不良结果。应用物联网技术，可有效了解设备的工作信息，并将有关消毒服务信息提供给酒店预订服务平台，让客人安心入住。</p><p>　　融资规模：2000万</p><p>　　融资用途：生产50台消毒机器人，投放到长三角地区的五星级酒店，15家左右完善机器人定型，物联网模块定型，服务云定型，并生产两台展示/检测用样机，需使用150万组装第一批定型成品，计划在10台，并租用联通的物联网及企业云，完成专用APP开发，需使用500万按租赁合同需求，完成一代消毒机器人40台，需使用1200万其它资金用于完善二代产品定型，及向北，广，深地区拓展业务，并向行业用户拓展业务：地铁，政府机关，养老机构等。</p><p><br/></p>','','','北京,脉冲,强光,消毒,行业,项目','','项目概述      由于年初新冠肺炎的暴发，给我国，亚洲乃至全球人民的正常生活，生产秩序造成极大的破坏，损失不可估量。在封闭/半封闭的环境内，需要在传统消毒技','','中國太平洋保險（香港）有限公司',2500,'74.65',1000,1000,9999964,1,1,'2.10',100,1000036,'2.00','1.00',0,0,0,1,8,1583040494,1583040494,0);

/*Table structure for table `fl_project_type` */

DROP TABLE IF EXISTS `fl_project_type`;

CREATE TABLE `fl_project_type` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `parent_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '父级栏目ID',
  `name` varchar(30) NOT NULL DEFAULT '' COMMENT '栏目名称',
  `seotitle` varchar(150) NOT NULL DEFAULT '' COMMENT 'SEO标题',
  `keywords` varchar(60) NOT NULL DEFAULT '' COMMENT '关键词',
  `description` varchar(250) NOT NULL DEFAULT '' COMMENT '描述',
  `content` mediumtext COMMENT '内容',
  `filename` varchar(30) NOT NULL DEFAULT '' COMMENT '别名',
  `templist` varchar(50) NOT NULL DEFAULT '' COMMENT '列表页模板',
  `temparticle` varchar(50) NOT NULL DEFAULT '' COMMENT '文章页模板',
  `litpic` varchar(150) NOT NULL DEFAULT '' COMMENT '封面或缩略图',
  `is_part` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '栏目属性：0列表栏目（允许发布文档），1频道封面（不允许发布文档）',
  `listorder` int(11) unsigned NOT NULL DEFAULT '50' COMMENT '排序',
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户发布者ID',
  `shop_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '店铺发布者ID',
  `admin_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '管理员发布者ID',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `delete_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除，0未删除',
  PRIMARY KEY (`id`),
  UNIQUE KEY `UK_PROJECT_TYPE_FILENAME` (`filename`)
