/*Table structure for table `fl_region` */

DROP TABLE IF EXISTS `fl_region`;

CREATE TABLE `fl_region` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(64) NOT NULL DEFAULT '' COMMENT '名称',
  `parent_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '父级ID',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '层级，0国家，1省，2市，3区',
  `sort_name` varchar(50) NOT NULL DEFAULT '' COMMENT '拼音或英文简写',
  `is_oversea` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0国内地址，1国外地址',
  `area_code` varchar(10) NOT NULL DEFAULT '' COMMENT '电话区号',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态，0正常',
  PRIMARY KEY (`id`),
  KEY `idx_parent_id` (`parent_id`),
  KEY `idx_name` (`name`)
) ENGINE=MyISAM AUTO_INCREMENT=55763 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

