/*Table structure for table `fl_shop` */

DROP TABLE IF EXISTS `fl_shop`;

CREATE TABLE `fl_shop` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `email` varchar(60) NOT NULL DEFAULT '' COMMENT '邮箱',
  `user_name` varchar(60) NOT NULL DEFAULT '' COMMENT '用户名',
  `password` varchar(50) NOT NULL DEFAULT '' COMMENT '密码',
  `pay_password` varchar(50) NOT NULL DEFAULT '' COMMENT '支付密码',
  `introduction` varchar(250) NOT NULL DEFAULT '' COMMENT '企业简介',
  `mobile` varchar(20) NOT NULL DEFAULT '' COMMENT '手机号码',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '用户状态，0完善资料，1正常，2锁定，3待审',
  `openid` varchar(100) NOT NULL DEFAULT '' COMMENT 'openid',
  `unionid` varchar(128) NOT NULL DEFAULT '' COMMENT 'unionid',
  `push_id` varchar(30) NOT NULL DEFAULT '' COMMENT '推送ID',
  `consumption_money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '累计消费金额',
  `annual_fee` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '年费',
  `cover_img` varchar(250) NOT NULL DEFAULT '' COMMENT '封面',
  `proxy_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '代理商ID',
  `province_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '省',
  `city_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '市',
  `district_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '区县',
  `address` varchar(150) NOT NULL DEFAULT '' COMMENT '详细地址',
  `point_lng` varchar(20) NOT NULL DEFAULT '' COMMENT '经度',
  `point_lat` varchar(20) NOT NULL DEFAULT '' COMMENT '纬度',
  `head_img` varchar(250) NOT NULL DEFAULT '' COMMENT '头像',
  `company_name` varchar(100) NOT NULL DEFAULT '' COMMENT '公司名称',
  `business_license_img` varchar(250) NOT NULL DEFAULT '' COMMENT '营业执照',
  `industry_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '行业ID',
  `click` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '点击量',
  `website` varchar(100) NOT NULL DEFAULT '' COMMENT '官网',
  `contact` varchar(30) NOT NULL DEFAULT '' COMMENT '联系人',
  `contact_information` varchar(30) NOT NULL DEFAULT '' COMMENT '联系方式',
  `token` varchar(32) NOT NULL DEFAULT '' COMMENT 'token',
  `tuijian` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '推荐等级',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '企业类型，0个人，1公司',
  `wechat` varchar(20) NOT NULL DEFAULT '' COMMENT '微信号',
  `qq` varchar(20) NOT NULL DEFAULT '' COMMENT 'QQ号',
  `main_product` varchar(100) NOT NULL DEFAULT '' COMMENT '主营产品或服务',
  `business_license_no` varchar(20) NOT NULL DEFAULT '' COMMENT '营业执照号',
  `zipcode` varchar(10) NOT NULL DEFAULT '' COMMENT '邮编',
  `fax` varchar(20) NOT NULL DEFAULT '' COMMENT '传真',
  `zhiwu` varchar(20) NOT NULL DEFAULT '' COMMENT '职务',
  `content` mediumtext COMMENT '店铺详情介绍',
  `category_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '店铺所属分类ID',
  `qrcode` varchar(150) NOT NULL DEFAULT '' COMMENT '店铺二维码',
  `expire_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '过期时间',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '注册时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `delete_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除，0未删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='店铺表';

/*Data for the table `fl_shop` */

insert  into `fl_shop`(`id`,`email`,`user_name`,`password`,`pay_password`,`introduction`,`mobile`,`status`,`openid`,`unionid`,`push_id`,`consumption_money`,`annual_fee`,`cover_img`,`proxy_id`,`province_id`,`city_id`,`district_id`,`address`,`point_lng`,`point_lat`,`head_img`,`company_name`,`business_license_img`,`industry_id`,`click`,`website`,`contact`,`contact_information`,`token`,`tuijian`,`type`,`wechat`,`qq`,`main_product`,`business_license_no`,`zipcode`,`fax`,`zhiwu`,`content`,`category_id`,`qrcode`,`expire_time`,`add_time`,`update_time`,`delete_time`) values (1,'','15280719357','e10adc3949ba59abbe56e057f20f883e','e10adc3949ba59abbe56e057f20f883e','繁橙工作室为广大客户提供企业建站、微信建站、手机建站、微商城、分销系统、微官网、小程序等一站式服务。5年专注于网站建设，已服务过1000+用户和客户。','15280719357',1,'','','','0.00','360.00','/uploads/2018/12/201812180242081768.jpeg',0,16,1315,1316,'软件园二期观日路48号','118.193202','24.489506','/uploads/2018/12/201812180241389463.png','繁橙工作室','',0,609,'123456','萨达','15280719357','',1,0,'jkui2012','123456','中小企业解决方案：PC+手机+微信网站+小程序+APP','','','','经理','<p>繁橙工作室为广大客户提供企业建站、微信建站、手机建站、微商城、分销系统、微官网、小程序等一站式服务。5年专注于网站建设，已服务过1000+用户和客户。</p><p><br/></p><p>我们是一群来自美亚柏科，美图，网龙等善于学习、怀揣梦想、追求卓越的年轻人，由兴趣开始，因理想坚持，在瞬息万变的移动互联网，不断挑战自我，拥抱变化，紧跟时代的发展，不断通过思维、技术赋能传统企业转型升级，谋求新发展，助力企业的转型升级，推动行业发展。</p><p><br/></p><p>核心价值观：以客户为中心，结果导向，删繁就简，追求极致。</p><p><br/></p><p>专注于中小企业一站式产品服务，助力中小企业轻松拥抱互联网。</p><p><br/></p><p>经营理念：平台化、可定制、低成本、一站式。</p>',2,'/uploads/2018/12/201812180241527937.png',1640966400,1528955444,1572251743,0);

/*Table structure for table `fl_slide` */

DROP TABLE IF EXISTS `fl_slide`;

CREATE TABLE `fl_slide` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(150) NOT NULL DEFAULT '' COMMENT '标题',
  `url` varchar(150) NOT NULL DEFAULT '' COMMENT '跳转的url',
  `target` smallint(2) unsigned NOT NULL DEFAULT '0' COMMENT '跳转方式，0_blank，1_self，2_parent，3_top，4framename',
  `group_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '分组ID,0pc，1weixin，2app，3wap，4miniprogram，5mobile',
  `pic` varchar(150) NOT NULL DEFAULT '' COMMENT '图片地址',
  `shop_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '店铺ID',
  `listorder` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0正常，1禁用',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

