/*Table structure for table `fl_sms_log` */

DROP TABLE IF EXISTS `fl_sms_log`;

CREATE TABLE `fl_sms_log` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `mobile` varchar(20) NOT NULL DEFAULT '' COMMENT '手机号',
  `content` varchar(200) NOT NULL DEFAULT '' COMMENT '发送的内容',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '1成功，2失败',
  `result` varchar(512) NOT NULL DEFAULT '' COMMENT '返回结果',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `idx_mobile_status` (`mobile`,`status`)
) ENGINE=MyISAM AUTO_INCREMENT=98 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

