/*Table structure for table `fl_tag` */

DROP TABLE IF EXISTS `fl_tag`;

CREATE TABLE `fl_tag` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(36) NOT NULL DEFAULT '' COMMENT '名称',
  `title` varchar(100) NOT NULL DEFAULT '' COMMENT '标题',
  `keywords` varchar(100) NOT NULL DEFAULT '' COMMENT '关键词',
  `description` varchar(150) NOT NULL DEFAULT '' COMMENT '描述',
  `content` mediumtext COMMENT '内容',
  `click` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '点击量',
  `litpic` varchar(150) NOT NULL DEFAULT '' COMMENT '缩略图或封面',
  `template` varchar(30) NOT NULL DEFAULT '' COMMENT '模板名称',
  `filename` varchar(60) NOT NULL DEFAULT '' COMMENT '别名',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0正常，1禁用',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

