/*Table structure for table `fl_token` */

DROP TABLE IF EXISTS `fl_token`;

CREATE TABLE `fl_token` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `token` varchar(128) NOT NULL DEFAULT '',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '来源：0app,1admin,2weixin,3wap,4pc,5miniprogram',
  `user_id` int(11) unsigned NOT NULL DEFAULT '0',
  `data` mediumtext COMMENT 'token相关信息,json_encode字串',
  `expire_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '过期时间',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_token` (`token`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='token表';

