/*Table structure for table `fl_user` */

DROP TABLE IF EXISTS `fl_user`;

CREATE TABLE `fl_user` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `parent_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '推荐人ID',
  `mobile` varchar(20) NOT NULL DEFAULT '' COMMENT '手机号码',
  `email` varchar(30) NOT NULL DEFAULT '' COMMENT '邮箱',
  `nickname` varchar(30) NOT NULL DEFAULT '' COMMENT '昵称',
  `user_name` varchar(60) NOT NULL DEFAULT '' COMMENT '用户名',
  `password` char(32) NOT NULL DEFAULT '' COMMENT '密码',
  `password2` varchar(30) NOT NULL DEFAULT '',
  `pay_password` char(32) NOT NULL DEFAULT '' COMMENT '支付密码',
  `pay_password2` varchar(30) NOT NULL DEFAULT '',
  `head_img` varchar(250) NOT NULL DEFAULT '' COMMENT '头像',
  `sex` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '性别：1男2女',
  `birthday` date NOT NULL DEFAULT '1990-01-01' COMMENT '生日',
  `money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '用户余额，单位：元',
  `commission` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '累计佣金，只增不减，单位：元',
  `commission_available` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '可用佣金，累积金额扣除已提现或别的',
  `consumption_money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '累计消费金额',
  `consumption_income` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '累计收益',
  `frozen_money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '用户冻结资金，单位：元',
  `point` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户能用积分',
  `user_rank` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '用户等级',
  `user_rank_points` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '会员等级积分',
  `address_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '收货地址ID,与user_address表对应',
  `openid` varchar(128) NOT NULL DEFAULT '' COMMENT 'openid',
  `unionid` varchar(128) NOT NULL DEFAULT '' COMMENT 'unionid',
  `refund_account` varchar(30) NOT NULL DEFAULT '' COMMENT '退款账户，支付宝账号',
  `refund_name` varchar(20) NOT NULL DEFAULT '' COMMENT '退款姓名',
  `true_name` varchar(20) NOT NULL DEFAULT '' COMMENT '真实姓名',
  `idcard` varchar(18) NOT NULL DEFAULT '' COMMENT '身份证号',
  `idcard_area` varchar(150) NOT NULL DEFAULT '' COMMENT '身份证所在地+出生年月',
  `bank_name` varchar(60) NOT NULL DEFAULT '' COMMENT '银行名称',
  `bank_branch_name` varchar(60) NOT NULL DEFAULT '' COMMENT '支行名称',
  `bank_card_number` varchar(30) NOT NULL DEFAULT '' COMMENT '卡号',
  `bank_card_type` varchar(60) NOT NULL DEFAULT '' COMMENT '银行卡类型',
  `signin_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '签到时间',
  `signin_num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '签到次数',
  `group_id` int(11) unsigned NOT NULL DEFAULT '50' COMMENT '分组ID',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '用户状态：0正常，1待审，2锁定',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '注册时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `delete_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '删除时间，0未删除',
  `login_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '登录时间',
  `login_ip` varchar(20) NOT NULL DEFAULT '' COMMENT '登录IP',
  `user_agent` varchar(60) NOT NULL DEFAULT '' COMMENT '登录终端',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_user_name` (`user_name`)
) ENGINE=InnoDB AUTO_INCREMENT=101333 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='会员表';

