/*Table structure for table `fl_user_address` */

DROP TABLE IF EXISTS `fl_user_address`;

CREATE TABLE `fl_user_address` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL DEFAULT '0',
  `name` varchar(60) NOT NULL DEFAULT '' COMMENT '收货人姓名',
  `country_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '收货人的国家',
  `province_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '收货人的省份',
  `city_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '收货人城市',
  `district_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '收货人的地区',
  `address` varchar(120) NOT NULL DEFAULT '' COMMENT '收货人的详细地址',
  `mobile` varchar(20) NOT NULL DEFAULT '' COMMENT '收货人的手机号',
  `telphone` varchar(30) NOT NULL DEFAULT '' COMMENT '收货人的电话',
  `zipcode` varchar(20) NOT NULL DEFAULT '' COMMENT '收货人的邮编',
  `is_default` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否默认,0:为非默认,1:默认',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `idx_user_id` (`user_id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

/*Data for the table `fl_user_address` */

insert  into `fl_user_address`(`id`,`user_id`,`name`,`country_id`,`province_id`,`city_id`,`district_id`,`address`,`mobile`,`telphone`,`zipcode`,`is_default`,`add_time`) values (1,3,'雨途悦',86,16,1317,22464,'123号','15280719357','','',1,1560764792),(2,3,'范例',86,1,52129,52130,'100号','15296354787','0995-2354154','361566',0,1560916600);

/*Table structure for table `fl_user_bonus` */

DROP TABLE IF EXISTS `fl_user_bonus`;

CREATE TABLE `fl_user_bonus` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `bonus_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '优惠券ID',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态：0未使用1已使用2已过期',
  `use_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '优惠券使用的时间，0表示未使用',
  `get_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '优惠券获得时间',
  `bonus_name` varchar(60) NOT NULL DEFAULT '' COMMENT '优惠券名称',
  `bonus_money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '优惠券金额',
  `min_amount` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '满多少使用',
  `start_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '优惠券开始时间',
  `end_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '优惠券结束时间',
  PRIMARY KEY (`id`),
  KEY `idx_user_id_status` (`user_id`,`status`)
