  KEY `idx_user_id_status_type` (`user_id`,`status`,`type`)
) ENGINE=InnoDB AUTO_INCREMENT=101331 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='用户消息表';

