/*Table structure for table `fl_user_project` */

DROP TABLE IF EXISTS `fl_user_project`;

CREATE TABLE `fl_user_project` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `project_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '项目ID',
  `money` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '投资金额',
  `title` varchar(150) NOT NULL DEFAULT '' COMMENT '项目名称',
  `dividend_mode` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '还款方式，0到期还本还息，1每日返息到期返本，7每周返息到期返本，10000每日复利到期返本返息',
  `daily_interest` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '日化收益，单位%',
  `hike` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '等级加息，单位%',
  `term` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '产品期限，单位：天',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '分红状态：0投资中，1已完结',
  `note` varchar(250) NOT NULL DEFAULT '' COMMENT '备注',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=100266 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='用户投资的项目';

