/*Table structure for table `fl_user_project_income` */

DROP TABLE IF EXISTS `fl_user_project_income`;

CREATE TABLE `fl_user_project_income` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_project_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户投资的项目ID',
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `project_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '项目ID',
  `title` varchar(150) NOT NULL DEFAULT '' COMMENT '项目名称',
  `money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '金额=利息',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态：0未支付，1已支付',
  `is_last` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否最后一期，0否1是',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间，应支付利息时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_add_time` (`add_time`)
) ENGINE=InnoDB AUTO_INCREMENT=104249 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='用户投资的项目收益明细';

