  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(30) NOT NULL DEFAULT '' COMMENT '会员等级名称',
  `min_points` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '该等级的最低积分',
  `max_points` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '该等级的最高积分',
  `discount` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '该会员等级的商品折扣',
  `rank` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '等级',
  `listorder` int(11) unsigned NOT NULL DEFAULT '50' COMMENT '排序',
  `hike` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '等级加息，单位%',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_rank` (`rank`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='用户等级表';

