/*Table structure for table `fl_user_recharge` */

DROP TABLE IF EXISTS `fl_user_recharge`;

CREATE TABLE `fl_user_recharge` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `recharge_sn` varchar(60) NOT NULL DEFAULT '' COMMENT '充值单号',
  `money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '充值金额',
  `pay_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '充值时间',
  `pay_type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '充值类型：1微信，2支付宝，3银行入款',
  `pay_money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '支付金额',
  `trade_no` varchar(60) NOT NULL DEFAULT '' COMMENT '支付流水号',
  `note` varchar(250) NOT NULL DEFAULT '' COMMENT '备注',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '充值状态：0处理中，1成功，2失败',
  `is_ignore` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否忽略，0不忽略，1忽略',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `delete_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '删除时间，0未删除',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_recharge_sn` (`recharge_sn`),
  KEY `idx_user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1033 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='用户在线充值明细表';

