/*Table structure for table `fl_user_referral_commission` */

DROP TABLE IF EXISTS `fl_user_referral_commission`;

CREATE TABLE `fl_user_referral_commission` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `commission_total` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '累计佣金，只增不减，单位：元',
  `commission_available` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '可提取佣金',
  `commission_withdraw` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '已提取佣金',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='用户推介资金';

