/*Table structure for table `fl_user_referral_commission_log` */

DROP TABLE IF EXISTS `fl_user_referral_commission_log`;

CREATE TABLE `fl_user_referral_commission_log` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '金额',
  `desc` varchar(100) NOT NULL DEFAULT '' COMMENT '描述',
  `user_commission` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '余额，每次增减后面的金额记录',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0增加,1减少',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `idx_user_id_type` (`user_id`,`type`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='用户推介资金明细';

