/*Table structure for table `fl_user_withdraw` */

DROP TABLE IF EXISTS `fl_user_withdraw`;

CREATE TABLE `fl_user_withdraw` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '金额',
  `name` varchar(30) NOT NULL DEFAULT '' COMMENT '姓名',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '提现状态：0未处理,1处理中,2成功,3取消，4拒绝',
  `note` varchar(250) NOT NULL DEFAULT '' COMMENT '用户备注',
  `re_note` varchar(250) NOT NULL DEFAULT '' COMMENT '回复备注信息',
  `bank_name` varchar(60) NOT NULL DEFAULT '' COMMENT '银行名称',
  `bank_place` varchar(150) NOT NULL DEFAULT '' COMMENT '开户行',
  `account` varchar(30) NOT NULL DEFAULT '' COMMENT '支付宝账号或者银行卡号',
  `method` varchar(20) NOT NULL DEFAULT '' COMMENT '提现方式，weixin，bank，alipay',
  `is_ignore` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否忽略，0不忽略，1忽略',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `delete_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '删除时间，0未删除',
  PRIMARY KEY (`id`),
  KEY `idx_user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=100179 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='提现记录表';

